INSERT INTO `reg.excerpt` VALUES (1,0,1,1,'Davao City is the largest city in the world in terms of land area. ',NULL,NULL,NULL,NULL,'Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(2,0,1,7,'It has a total land area of 244,000 hectares or 8% of the land area of Southern Mindanao Region','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(3,0,1,7,'It is divided into (3) Congressional Districts, and furthermore divided into (11) eleven administrative districts.','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(4,0,1,7,'Poblacion and Talomo District covers District I ','','','Poblacion District','Poblacion District','Davao City','Davao del Sur','Davao Region','Philippines',7.072838,125.6040785),(5,0,1,7,'Poblacion and Talomo District covers District I ','','','Talomo','Talomo','Davao City','Davao del Sur','Davao Region','Philippines',7.0826111,125.5438967),(6,0,1,7,'District II is includes Agdao District.','','','Agdao','Agdao','Davao City','Davao del Sur','Davao Region','Philippines',7.0840619,125.6239014),(7,0,1,7,'District II is includes Buhangin District.','','','Buhangin','Buhangin','Davao City','Davao del Sur','Davao Region','Philippines',7.1590395,125.5986093),(8,0,1,7,'District II is includes Bunawan District.','','','Bunawan','Bunawan','Davao City','Davao del Sur','Davao Region','Philippines',7.2247288,125.6408633),(9,0,1,7,'District II is includes Paquibato District.','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.3518379,125.4672368),(10,0,1,7,'The 3rd Congressional District includes Toril District.','','','Toril','Toril','Davao City','Davao del Sur','Davao Region','Philippines',7.0149514,125.4978745),(11,0,1,7,'The 3rd Congressional District includes Tugbok District.','','','Tugbok','Tugbok','Davao City','Davao del Sur','Davao Region','Philippines',7.1321486,125.4920497),(12,0,1,7,'The 3rd Congressional District includes Calinan District.','','','Calinan District','Calinan District','Davao City','Davao del Sur','Davao Region','Philippines',7.188222,125.4217),(13,0,1,7,'The 3rd Congressional District includes Baguio District.','','','Calinan District','Calinan District','Davao City','Davao del Sur','Davao Region','Philippines',7.188222,125.4217),(14,0,1,7,'The 3rd Congressional District includes Marilog District.','','','Marilog District','Marilog District','Davao City','Davao del Sur','Davao Region','Philippines',7.3707311,125.3029807),(15,0,1,7,'Davao City is composed of 182 Barangay(s)','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(16,0,1,7,'A substantial part of Davao City is mountainous','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(17,0,1,7,'This mountain range nurses the highest peak in the Philippines, which is Mt. Apo located at the boundaries of North Cotabato, Davao del Sur and Davao City. Mt. Apo has an elevation of about 10,311 feet (3,144 meters) above sea level. It has been considered as a semi -active volcano','','','','','Kidapawan City','Davao del Sur','Davao Region','Philippines',6.9874561,125.2709964),(18,0,1,7,'The slopes in the region are classified into 5 categories. An estimated area of 491,795 hectares that fall under 0-8 percent;\n 314,749 hectares under slope 8-18 percent;\n 432,780 hectares under slope 18-30 percent;\n 432,782 hectares under slope 30-50 percent;\n and 295,077 hectares with slope over 50 percent.','','','','','','Davao del Sur','Davao Region','Philippines',6.7662687,125.3284269),(19,0,1,7,'The entire land area of Davao City is drained towards the Gulf.','','','','','','','','Philippines',6.7171767,125.7830029),(20,0,1,7,'The secondary drainage system of the city is the Talomo River, which serves as drainage outlets of the eastern slopes of Mt. Apo.','','','','','Davao City ','','','Philippines',7.0469777,125.5598013),(21,0,1,7,'The quality of the soil in Davao City varies depending on its location and in terms of color, texture, depth, drainage, relief, permeability, and fertility.','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(22,0,1,7,'Forest constitutes one of the city’s important resources','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(23,0,1,7,'Its major products are: timber, lumber, water for domestic, agricultural and industrial uses, agro forestry crops, and fuel wood. Likewise, minor products can be obtained from the forests namely: wildlife such as orchids, mammals, reptiles, birds, and other avian species;\n rattan;\n furniture materials;\n gums;\n resin;\n bees wax;\n soil;\n gravel;\n earth fill;\n firewood;\n among others.','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(24,0,1,7,'Davao City’s forests are noted to contain mineral deposits such as;\n silica, copper, and gold which are still untapped.','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(25,0,1,7,'There are 43,147 hectares comprising Davao City’s forestlands or woodland','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(26,0,1,7,'Davao Gulf is the city’s major fishing ground where fishes like, skipjack, yellow fin tuna, nig-eyed scud, slip-mouth, herring, anchovy and other marine products like, sea cucumbers, seaweeds and ornamental shells could be found. Livelihood activities are not only confined to fishing related operations.','','','','','','','','Philippines',6.7171767,125.7830029),(27,0,1,7,'The coastal areas of the city are likewise being used as venue for socio-cultural and economic activities such as beach resorts, housing, industrial and others, thereby providing pressure to the coastal and marine environment','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.072838,125.6040785),(28,0,1,7,'Davao coastline has a minimal wave and current due to its location.','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(29,0,1,3,'The center of trade and commerce of Davao city is located in the Poblacion and Agdao Districts. Various hotels, banks, malls and recreational areas are located at Poblacion District.','','','Poblacion District','Poblacion District','Davao City','Davao del Sur','Davao Region','Philippines',7.072838,125.6040785),(30,0,1,3,'The center of trade and commerce of Davao city is located in the Poblacion and Agdao Districts. Various hotels, banks, malls and recreational areas are located at Poblacion District.','','','Agdao','Agdao','Davao City','Davao del Sur','Davao Region','Philippines',7.0840619,125.6239014),(31,0,1,3,'The International Airport is located in Buhangin District','','','','Buhangin','Davao City','Davao del Sur','Davao Region','Philippines',7.1590395,125.5986093),(32,0,1,3,'the Industrial areas can be found in Toril District.','','','','Toril','Davao City','Davao del Sur','Davao Region','Philippines',7.0149514,125.4978745),(33,0,1,3,'the Industrial areas can be found in Bunawan District.','','','','Bunawan','Davao City','Davao del Sur','Davao Region','Philippines',7.2247288,125.6408633),(34,0,1,3,'the Industrial areas can be found in Buhangin District.','','','','Buhangin','Davao City','Davao del Sur','Davao Region','Philippines',7.1590395,125.5986093),(35,0,1,3,'Residential areas like low-cost housing, subdivisions, and depressed areas can be found in Poblacion District.','','','Poblacion District','Poblacion District','Davao City','Davao del Sur','Davao Region','Philippines',7.072838,125.6040785),(36,0,1,3,'Residential areas like low-cost housing, subdivisions, and depressed areas can be found in Agdao District.','','','','Agdao','Davao City','Davao del Sur','Davao Region','Philippines',7.0840619,125.6239014),(37,0,1,3,'Residential areas like low-cost housing, subdivisions, and depressed areas can be found in Talomo District.','','','','Toril','Davao City','Davao del Sur','Davao Region','Philippines',7.0149514,125.4978745),(38,0,1,3,'Residential areas like low-cost housing, subdivisions, and depressed areas can be found in  Toril District.','','','','Talomo','Davao City','Davao del Sur','Davao Region','Philippines',7.0826111,125.5438967),(39,0,1,3,'Residential areas like low-cost housing, subdivisions, and depressed areas can be found in parts of Calinan District.','','','','Calinan District','Davao City','Davao del Sur','Davao Region','Philippines',7.188222,125.4217),(40,0,1,3,'Residential areas like low-cost housing, subdivisions, and depressed areas can be found in Tugbok District.','','','','Tugbok','Davao City','Davao del Sur','Davao Region','Philippines',7.1321486,125.4920497),(41,0,1,4,'Due to the steady rise of its population, depress areas consequently were getting larger in urban areas of Davao City including in Poblacion','','','','Poblacion District','Davao City','Davao del Sur','Davao Region','Philippines',7.072838,125.6040785),(42,0,1,4,'Due to the steady rise of its population, depress areas consequently were getting larger in urban areas of Davao City including in Agdao,','','','','Agdao','Davao City','Davao del Sur','Davao Region','Philippines',7.0840619,125.6239014),(43,0,1,4,'Due to the steady rise of its population, depress areas consequently were getting larger in urban areas of Davao City including in Toril','','','','Toril','Davao City','Davao del Sur','Davao Region','Philippines',7.0149514,125.4978745),(44,0,1,4,'Due to the steady rise of its population, depress areas consequently were getting larger in urban areas of Davao City including in Calinan','','','','Calinan District','Davao City','Davao del Sur','Davao Region','Philippines',7.188222,125.4217),(45,0,1,4,'Due to the steady rise of its population, depress areas consequently were getting larger in urban areas of Davao City including in Talomo','','','','Talomo','Davao City','Davao del Sur','Davao Region','Philippines',7.0826111,125.5438967),(46,0,1,4,'Due to the steady rise of its population, depress areas consequently were getting larger in urban areas of Davao City including in Bunawan','','','','Bunawan','Davao City','Davao del Sur','Davao Region','Philippines',7.2247288,125.6408633),(47,0,1,4,'Due to the steady rise of its population, depress areas consequently were getting larger in urban areas of Davao City including in  Buhangin ','','','','Buhangin','Davao City','Davao del Sur','Davao Region','Philippines',7.1590395,125.5986093),(48,0,1,4,'Population growth is a major contributory to the environmental problem. This has resulted to the depletion of the groundwater supply, over fishing, degraded soil due to large scale plantation and uncontrolled logging. As an economic center in the region, disruption of the economic activity will have untold effect on the people in the area.','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(49,0,1,7,'Davao City enjoys a mild tropical climate as compared with other parts of the country which has two distinct seasons, the dry and wet season.','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(50,0,1,7,'falls outside the typhoon belt and generally lacks a major seasonal weather variation','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(51,0,1,7,'The pre dominant wind direction is northwest from the Davao Gulf were the center air of the sea replaces the warm air over the city. The surroundings mountain range protects the city effectively from strong winds','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(52,0,1,6,'Davao City has improved its technological system of farming where the average income of farmers has doubled although some still relies on the rain feed method of farming. The increase in production has given much help in improving the living status of farmers','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(53,0,1,3,'Calinan District is the foremost area in terms of output for fruit products.','','','','Calinan District','Davao City','Davao del Sur','Davao Region','Philippines',7.188222,125.4217),(54,0,1,3,'Tugbok and other districts are known to produce vegetables crops, banana and rice.','','','','Tugbok','Davao City','Davao del Sur','Davao Region','Philippines',7.1321486,125.4920497),(55,0,1,3,'Marilog and other districts are known to produce vegetables crops, banana and rice.','','','Marilog District','Marilog District','Davao City','Davao del Sur','Davao Region','Philippines',7.3707311,125.3029807),(56,0,1,3,'Paquibato and other districts are known to produce vegetables crops, banana and rice.','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.3518379,125.4672368),(57,0,1,3,'Various industrial facilities such as cement, plywood, paper, steel and tuna factory can be found in key areas of the city','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(58,0,1,7,'The “Dumoy Water” which is the pride of the city Davao city is rated number 2 in the world as the best fresh water','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(59,0,1,7,'The city has also mineral deposits such as;\n silica, copper, and gold which are still untapped./','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(60,0,1,4,'Rice is the staple food of the majority of the inhabitants in the City','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(61,0,1,6,'Davao City Water District (DCWD) supplies water for residential, commercial/industrial, government/institutional and other users in Davao City./','','','','','Panabo','Davao del Norte','Davao Region','Philippines',7.2997502,125.682935),(62,0,1,3,'To propel Davao City to the big growth path and towards the industrial status, it is the policy of the City Government to ensure a rational mix of heavy, medium and light industries to maximize utilization of agricultural output and to generate jobs','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(63,0,1,6,'The electric supply of Davao City is mainly being provided by the National Power Corporation through the Mindanao Grid whose main source of electric generating capacity is the Maria Cristina Hydro – Electric Complex./','','','','','Maramag','Bukidnon','North Mindanao','Philippines',7.7122627,125.0257369),(64,0,1,6,'Public transport in Davao City is mainly served by PUJ’s (jeepney), taxis, shuttle buses, tricycles (interior and minor roads) and regular bus routes.','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(65,0,1,6,'Provincial buses are not allowed to operate within the CBD and have to utilize the Davao City Overland Transport Terminal at Ecoland to pick up passengers in the city. There is an existing privately owned bus terminal operating within the CBD mainly to serve mini-aircon buses plying the Davao del Sur and Davao del Norte provincial route','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(66,0,1,6,'Air transportation is provided in Davao City thru its Davao International Airport located in Buhangin, about 12 kilometers from the city proper. Its facilities can suit international airlines','','','','Buhangin','Davao City','Davao del Sur','Davao Region','Philippines',7.1590395,125.5986093),(67,0,1,6,'The Port of Davao City is one of the major ports of the country. It serves as the forefront in the development of commerce and trade in Davao City and its neighboring provinces namely Davao Del Norte, Davao del Sur and Davao Oriental','','','','','Municipality of Sarangani','Davao del Sur','Davao Region','Philippines',5.4126399,125.426504),(68,0,1,6,'Davao City’s current push for development is anchored on its communications system. Compared with other key cities in the Philippines, it has relatively better communication facilities.','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(69,0,1,1,'Pursuant to Commonwealth Act No. 51, otherwise known as the City Charter of Davao, dated October 16,1938, and section 448 of the Republic Act No. 7160 (Local Government Code of 1992), the City of Davao is mandated to provide basic services for its constituents within its territorial jurisdiction.','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(70,0,1,2,'There are friendly troops stationed both in rural areas and urban centers in Davao City','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(71,0,1,2,'The “Task Force Davao” composed of both regular AFP members from 104TH DRC, 10ID, PA (OPCON) and City paid SCAA’s under the command of COL OSCAR T LACTAO. TF Davao Hqs is located at Sta. Ana wharf, Brgy Leon Garcia, Agdao, Davao City.','','','','Agdao','Davao City','Davao del Sur','Davao Region','Philippines',7.0767031,125.6268597),(72,0,1,2,'The Tactical Operation Group XI of the Philippine Air Force and the ACP Southern Command located at Old DIA, Sasa, Davao City, Naval Forces Eastern Mindanao based at Camp Panacan, Panacan, Davao City','','','','Bunawan','Davao City','Davao del Sur','Davao Region','Philippines',7.1523559,125.6587899),(73,0,1,6,'And also the city has an emergency assistance unit patterned with that of the United States and Canada of Emergency Hotline 911 with state of the art equipments and reliable communication system','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(74,0,1,6,'The unit is tasked to address the following: Local and Foreign Terrorist Organization, DCWAC, RWAC, SMR and Guerilla Front 52, Guerilla Front 54 all of Southern Mindanao Regional Committee, KOMMID, Southern Philippines Secessionist Group, and Sectoral Groups','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(75,0,2,4,'“Colon-biao” was the original name given by the B’laan Datu to a certain Sitio of Barangay Lower Bunawan, Municipality of Buluan, and Province of Cotabato. It was called such because the place is blanketed with evergreen “colon” (cogon) and “biao” from the word “Lumbang nut” trees','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(76,0,2,4,'Late in the early 50’s, when the Christian settlers from Luzon and Visayas inhabited the place, “Colon-biao” was renamed to Columbio in order to correlate with its mysterious, but captivating “Column of Views”.','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(77,0,2,1,'The Municipality of Columbio was created on August 6, 1961, when the late President Carlos P. Garcia signed it into law Executive Order Number 39.','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(78,0,2,1,'It was composed of twenty-seven (27) barangays namely, Alip (now the new municipality of Datu Paglas), Bantangan, Lower Bunawan, Upper Bunawan, Damalusay, Damawato, Datalblao, Eday, Elbebe, Kalomanga, Katil, Libertad, Lomoyon, Makat, Sumali Pas, Malala, Maligaya, Manindolo, Mayo, Natividad, Poblacion, Polomolok, Puya, Sepaka, Sinapulan, Sucob, Telafas and Tukay Baloen','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(79,0,2,7,'Geographically, the municipality of Columbio is located in the easternmost of the Province of Sultan Kudarat. It is bounded in the north by the Municipality of Tulunan, Cotabato;\n in the east, by the Municipalities of Matan-ao and Magsaysay, Davao Del Sur;\n in the west by the Alip and Quezon ranges bordering the Municipalities of Buluan and Datu Paglas, Maguindanao;\n and in the south by Municipality of Tampakan, South Cotabato. It is located at the geographical coordinates of 6o29’56” to 6o48’12” east longitude and 124o52’05” to 125o11’54” north latitude','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(80,0,2,7,'Columbio is a regular shape surrounded by its barangays situated in the mountainous portion of the municipality. It has a total land area of approximately 92,615 hectares.','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(81,0,2,7,'The municipality is a valley enveloped by mountain ranges with hills, plains plateaus in its sides. Some Fjord ravines could be seen in barangays such as Sucob, Makat, Eday, Mayo, Elbebe, Polomolok, Lasak and Sinapolan. Largest Valleys and Plains could be found in Barangay Poblacion, Bantangan, Datal Blao, Libertad, Lomoyon, Maligaya and Telafas. These are good for level and Palay Planters. Lower areas are located Eastern portion of the Poblacion','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(82,0,2,7,'the municipality of Columbio has seven (7) slope classifications ranging from 0.3% to as high as 18% and above slopes category of 0.3% marked by largest area of 26,555 hectares accounting to 28.67%./','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(83,0,2,7,'The eastern portion of Columbio is bounded by Sucob Ranges along its slopes and slightly hilly portions. Vast forest and cogon lands and numerous creeks and springs could be seen. Beneath it spreads a vast plain fitted for agricultural crops, going forth to south are the towering Alip and Quezon Ranges where scattered mountains of cogon and forestlands defined their majestic grandeur. Cultivated farmlands along the sides of the mountains, hills and valleys can be noted. Numerous creeks and streams running along its vast plains abound with commercial type sand and gravel. The area is originally volcanic in origin, composed of fine texture in soil and rocky along its slopes./','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(84,0,2,7,'Columbio has a soil type of San Miguel Sitty Clay Loam of approximately 63,405 hectares accounting to 68.48%. The other type of soil is Tupi Fine Loam with an area of 29,210 hectares sharing 31.54% of the total, which is about to 92,615 hectares./','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(85,0,2,7,'Columbio belongs to the fourth type of climate of which its rainfall is more or less evenly distributed throughout the whole year','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(86,0,2,7,'The Municipality of Columbio has a total of about 14,110 hectares of agricultural land accounting to 15.13% of the total, which is 92,615 hectares','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(87,0,2,7,'7,615 hectares or 65.70% are devoted for rice production of which 54.35% are irrigated area, 22.79% are rain fed and 21.31% are upland while corn lands total to 4,800 hectares sharing about 34.26% of said agricultural land. Coconut area is only 61 hectares representing 0.61 percent. Other agricultural crops grown in the area are mango, banana, cassava, durian and coffee with a total area of 588, 634, 104, 94, and 115 hectares, respectively','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(88,0,2,7,'There are ten (10) barangays with irrigated lands such as Datalblao, Natividad, Libertad, Telafas, Makat, Polomolok, Eday, Maligaya, Mayo and the Poblacion','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(89,0,2,3,'The average yield per hectare every harvest of said irrigated areas is 68.05 cavans. This is still considered low production as compared to other municipalities in the province. Treating the barangays individually, it revealed that the highest average yield is in Barangay Telafas of 90.35 cavans and the lowest of 51.40 cavans in Barangay Polomolok','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(90,0,2,3,'Establishments of various post harvest machineries such as solar driers, irrigation pumps and shallow tube well, farm tillers, and corn and rice threshers are some projects of the Department of Agriculture to the Local Government Unit. These were distributed to different cooperatives members in order to enhance their problems on post harvest production activities','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(91,0,2,3,'Currently, Columbio has a total of 3,927 heads of livestock of which 1,431 or 36.44% are carabaos, 1,055 or 26.87% are hogs, and 1,049 or 26.71% goats and only 392 or 9.98% are cattle','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(92,0,2,3,'The municipality has a good inland fish grounds. The swamplands can be developed as a potential fishpond. The town abounds with two rivers, numerous streams and creeks that tame with fresh water and other aquatic resources like dalag, hito, carpa, gurami, tilapia and others. Local residents fished for their daily consumption only and not for commercial purposes. The municipality has a total of thirty-five (35) hectares for inland fishponds.','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(93,0,2,3,'At present, there are thirty-two (32) farmers engaged in small fishponds activities distributed to different barangays of Columbio.','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(94,0,2,3,'The bulk of land area in the Municipality of Columbio, Sultan Kudarat is on forestlands with a total area of approximately 50,206.08 hectares accounting to 54.21 percent of which only about 15,167.17 hectares remained with forest cover. These are located in portions of Barangays Datalblao, Sinapulan, Sucob, Polomolok and Bunawan','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(95,0,2,3,'As of 1999, there are sixty-five (65) commercial establishments (sari-sari stores) and ten (10) buy and sell of all types of grains, six (6) tailoring shops, and two (2) blacksmiths. An average of three (3) persons per establishment was reported as the employment size of the commercial establishment.','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(96,0,2,3,'There are twenty two (22) existing rice mills in the Municipality of Columbio, which are located in nine (9) different Barangays. Handicraft making is the pet project of B’laans, Muslims and Ilonggos. Various kinds of baskets, mats, bamboos and rattan handicrafts are produced and being sold at the Poblacion','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(97,0,2,6,'The Sultan Kudarat Electric Cooperative (SUKELCO) is the source of electricity in the area. The barangays benefited on this power source are barangays Mayo and Poblacion. Around seventy (70%) percent of the total household is being served;\n this is due to the reason that the resident whose income is below average could not afford to pay house wiring installation bill./','','','','','','Sultan Kudarat','Region XII','Philippines',6.5069401,124.4198243),(98,0,2,6,'Currently, the Municipality of Columbio has a total length of 145 kilometers of roads of which seventy (70) kilometers or 48.27% are classified as provincial roads;\n forty (40) kilometers or 27.59% as municipal roads;\n and the remaining thirty-five (35) kilometers or 24.14% as barangay roads. Not a single kilometer of road is administratively classified as national road.','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(99,0,2,6,'There are two (2) temporary jeepney terminal and parking facilities available in the municipality of Columbio. One is located in Barangay Poblacion capacity of six (6) and three vehicles','','','','','Tacurong City','Sultan Kudarat','Region XII','Philippines',6.6922735,124.6773561),(100,0,2,6,'There are two (2) temporary jeepney terminal and parking facilities available in the municipality of Columbio. One is located in Barangay Telafas with a capacity of six (6) and three vehicles','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(101,0,2,6,'There are two (2) existing communication facilities in the area that are located in the heart of Poblacion. One is a telegraphic service owned by the Bureau of Telecommunications and Postal Service Corporation and the other one is owned by the Philippine National Police known as the Police Enforcement Communication System (PLECS) that are serving the area especially the urban populace./','','','','','Tacurong City','Sultan Kudarat','Region XII','Philippines',6.6922735,124.6773561),(102,0,2,4,'Columbio’s population density is recorded at 0.23 person per hectare or 23 persons per square kilometer for 1995 and 0.27 person per hectare or 27 persons per square kilometer for 1999 which indicates that the municipality is sparsely populated and that there are still undeveloped land in the countryside. Urban density for the year 1990 rated some 0.19 person per hectare or 19 persons per square kilometer but for the years 1995 and 1996, it is estimated at 0.23 and 0.27 persons per hectare;\n rural density for the same year reaches from 0.18 and 0.21 persons per hectare, respectively','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(103,0,2,4,'The urban population during the 1990 Census is recorded at 4,218 or 24.06 percent of which male population accounted to 52.20 percent, while female is 47.80 percent of the whole urban population. There is a marked increase of 661 persons compared to that of the 1995 census of population. The latter recorded the urban distribution of population of 4,879 or 22.68 percent of the whole population. On the other hand, the rural population for the same year (1995) was recorded to be at 77.32 percent of the total municipal population, with an increase of 3,979. Male population for both urban and rural areas during 1990 was computed at 23.67 percent and 76.33 percent, respectively;\n while female population scored at 24.49 percent and 75.51 percent, respectively','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(104,0,2,4,'The 1995 urbanity/urbanization level has 22.68% as compared to 1990, which is 24.06%. This shows a decrease of 1.38 percent after a lapse of five (5) years time. While in the provincial level, the 1990 urbanization level is 31 percent. This indicates that there is still an economic opportunity in the different rural barangays in 1995. The provincial urbanization level is higher than that of the municipal with a difference of 6.9 percent for 1990','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(105,0,2,4,'1990 Census shows that majority in the area are of Maguindanao ethnic origin with 27.63 percent of the total population. This is followed by Badjao, Samal, Dilaut at 5,769 accounting to 26.82 percent and Hiligaynon – Ilongo and Ilocano of 18.19% and 20.01%, respectively','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(106,0,2,4,'Based on the 1990 Population Census conducted by the NSO on religious groups, it revealed that there is a total of twenty-one (21) religious groups existing in the municipality. As expected, the locality is dominated by a Roman Catholic and Islam believers of 8,994 or 51.30 percent and 29.55 percent, respectively./','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(107,0,2,4,'The 1990 marital status indicates that 25–29 age group has the highest number of married females. The same trend as of 1995 marital status of the municipality has been observed followed by age groups 30-34 and 35-39 of 8.90 percent each. For the single population, it shows in the younger age bracket of 10-14 and 15-19 of 2,954 or 19.36% and 2,378 or 13.92%, respectively. Over-all household population of ages 10 years old and over of 14,925 as of 1995 NSO population, reveals that greater population are either married or single of 8,065 or 54.04%;\n and 6,491 or 43.02%, respectively. Widowed population totals to 319 while separated of 28','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(108,0,2,4,'Currently, there are eleven (11) elementary, ten (10) primary, two (2) secondary and one (1) college school operating in the municipality to cater the educational needs of its populace at all levels of education.','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(109,0,2,4,'As of school year 2001-2002, there are 3,740 enrollees of which 3,286 or 87.86 percent are enrolled in the said elementary schools and the remaining 454 or 12.14 percent are in the primary schools.','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(110,0,2,4,'The 1990 Census showed that the urban population has total literates of 8,711 persons or 74.40 percent and illiterate persons of 2,998 persons or 25.60 percent. For purposes of comparing the said rate in urban area to the rural area, 90.66 percent of the urban population are literates and 69.20 percent to the rural population. The reason for low literacy rate in the rural area is probably due to lack of educational facilities on their respective barangays.','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(111,0,2,4,'As to sports and recreational facilities, there are three (3) playgrounds with an estimated area of 750 sq. meters in Barangays Libertad, Mayo, and Telafas and one (1) park with an area of 2.5 hectares at the heart of the Poblacion. Other barangays utilized part of their open spaces to serve as playground and park for the people','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(112,0,2,6,'At present, there is no existing government hospital in the municipality. There is one (1) Private Clinic and one (1) Rural Health Unit at Poblacion.','','','','','Tacurong City','Sultan Kudarat','Region XII','Philippines',6.6922735,124.6773561),(113,0,2,6,'One of the 3 Barangay Health Stations is esablished at at Barangay Maligaya with two (2) existing health beds each.  These are all constructed of permanent buildings and currently in good condition','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(114,0,2,6,'One of the 3 Barangay Health Stations is esablished at at Barangay Mayo with two (2) existing health beds each.  These are all constructed of permanent buildings and currently in good condition','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(115,0,2,6,'One of the 3 Barangay Health Stations is esablished at at Barangay Telafas with two (2) existing health beds each.  These are all constructed of permanent buildings and currently in good condition','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(116,0,2,4,'On the death statistics as per data acquired from the Rural Health Unit of municipality, most of the populace affected are those belonging to age bracket 0-4 years old with influenza and diarrhea as the main causes. As of year 1998, the nine (9) leading causes of mortality are: dehydration, stab wound (multiple), gun shot wound, hepatitis 2, rabies, cardiac arrest, CA of lungs, old age dehydration, and tetanus neonatorum.','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(117,0,2,1,'The Local Government of Columbio, Sultan Kudarat is currently run by a young, dedicated and competent Mayor Hon. Edwin F. Bermudez. Unanimously supporting him are the equally development-oriented municipal officials namely: Hon. Amirh M. Musali – Vice Mayor and Sangguniang Bayan members: Hon. Alfredo S. Caño, Hon. Mildred P. Segismundo, Hon. Edmund R. Condes, Hon. Welfredo J. Casamorin, Hon. Naida Sayra M. Manibpel, Hon. Orlando V. Baira, Hon Ali Madidis, Hon. Caniangca T. Latip, and the ABC President Hon. Romeo K. Madidis and the SKMF President Hon. Alinhor Sansarona.','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(118,0,2,1,'The existing local and fiscal administration of Columbio has thirteen (13) functional and effective offices with a total working force of 75 personnel assigned in the following offices: Office of the Mayor, Office of the SB (Vice-Mayor), Office of the Economic Enterprises, Office of the Municipal Planning and Development Coordinator, Office of the Municipal Treasurer, Office of the Municipal Budget Officer, Office of the Municipal Assessor, Office of the Municipal Agriculturist, Office of the Municipal Social Welfare Officer, Office of the Municipal Health Officer, Office of the Municipal Engineer, and then the Office of the Municipal Accountant and the Office of the Municipal Civil Registrar.','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(119,0,2,1,'During the conduct of May 14, 2004 National and Local Election, numerous political parties with their candidates were flaunted. Foremost of which are the NPC-LAKAS-CMD, AKSYON DEMOKRATIKO, NPC and LAKAS-NUCD-UMDP. Majority of the political candidates coming from the NPC were elected and subsequently took the reign of the municipal government','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(120,0,2,1,'Politics in the municipality is the same with that of the national level though it differs greatly in terms of scope. However, in the municipal government the off-shot of a multi party system is felt only in a short period since most of the political candidates were the same persons frequently seen in the municipal political arena.','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(121,0,2,1,'Political candidates were selected through casting of votes of the qualified voters as prescribed by the COMELEC. Popularity through campaigns and other forms of propaganda were the main basis of selection for the average inhabitants of the municipality while among the ranks of the intellects, stern studies and observation were made prior to its selection of candidates to be voted upon./','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(122,0,2,2,'27TH Infantry (ACTION) Battalion, 10TH Infantry (AGILA) Division, PA, has operational jurisdiction over the entire municipality of Columbio. The Battalion Headquarters is stationed at Brgy Kablon, Tupi, South Cotabato while the C Coy, 27IB is stationed at the Poblacion Proper of Columbio. Its two (2) other maneuver Companies are stationed at T’boli, South Cotabato and Maasim, Sarangani Province respectively','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(123,0,2,2,'Sixteen (16) policemen headed by the Station Commander, posting a population ratio of 1:1,269, man the existing police force of Columbio. The police headquarters is located beside the Municipal Hall. The municipality has CVO or Tanod Bayan members assigned in their respective barangays','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(124,0,2,2,'Columbio is beset with the two (2) potent threat groups;\n the Communist Terrorist Movement and the Southern Philippines Secessionist Group. Foremost of which is the CTM','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(125,0,2,2,'Guerilla Front 76 operates in the hinterland Barangays of Columbio, SK ','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(126,0,2,2,'Guerilla Front 76 operates in the remote Barangays of Koronadal City South Cotabato.','','','','','Koronadal City','South Cotabato','Region XII','Philippines',6.4973963,124.8471625),(127,0,2,2,'Guerilla Front 76 operates in the remote barangay of Tampakan South Cotabato.','','','','','Tampakan','South Cotabato','Region XII','Philippines',6.4912111,125.0828588),(128,0,2,2,'The CTM are monitored to be highly mobile adopting the consolidation and dispersion tactics, avoiding frontal confrontation with the government forces, the use of pre-arranged communications “Pasa Bilis” utilizing their contacts/sympathizers, use of ciphering/coding of radio messages and advanced communication such as cell phones, infiltration and social investigation and class analysis. In the conduct of tactical offensives, accurate intelligence and deception tactics are deeply emphasized. They also capitalized the economic and social issues in infiltrating/orchestrating multi-sector groups to conduct mass actions to incite people’s emotion and solicit popular support of the majority in their advantage. In relation to the forthcoming national election, they also capitalized the political issues against some politicians in support of their supported candidates.','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(129,0,2,2,'Generally, the CTM training is divided into two (2) fields: political and military. Recruited members must undergo educational programs through indoctrination on economic, political and communist ideology. Corresponding political education is provided, as they are elevated to the higher organizations. Likewise, local guerillas (militias and armed regulars) must undergo military training to enhance their combat effectiveness','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(130,0,2,2,'The CTM in the municipality of Columbio are capable of launching military offensive in selected targets through the merging of their forces like the MRGUs and FOCs. This is made possible in targets proximate and/or inside their influenced areas. However, they cannot sustain prolonged armed confrontation against the government troops due to their limited logistical capabilities. In worst situations, the CTM are capable of launching bombings and sabotage operations especially in urban centers that would create a deep impact in their propaganda quest. Recent developments however indicate that the CTM are wooing the support of MILF forces and vice versa in their respective jurisdictions as manifested by occasional meeting between CTM leaders and field commanders of the MILF. Politically, the CTM has the capability of mustering big number of people in furtherance of programmed mass actions particularly in urban areas. The NDF has proven its efficiency in mobilizing several organized groups designed to destabilize the government.','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(131,0,2,2,'The CTs of GF 76 will focus its IPO works in remote Sitios of Brgy Palavilla, Lutayan, SK in order to build up their depleted strength, after they abandoned their guerilla bases in Koronadal-Tampakan-Columbio complex and the series surrenderees from their members. Further, they are experiencing severe difficulties in recuperating strength since their logistical requirements and mass support have been denied due to the successful Area-SOT deployed by this Brigade. Likewise, they impose a Permit-To-Campaign (PTC) fee to political candidates and also fielded their own candidates hoping to gain more access in the government sector during the election campaign period. On the other hand, the MILF is observed to be on its wait and see posture with the ongoing peace negotiation. Further, they are expected to campaign their supported Local Politician for future furtherance of their organizational build-up.','','','','','Columbio','Sultan Kudarat','Region XII','Philippines',6.634899,125.0828588),(132,0,3,4,'On February 27, 1939, the Christian settlers landed on the shores of the beautiful Sarangani Bay led by General Paulino Santos with the 62 first batchers. In January 1948, Bauman District became a full pledged municipality as provided by Republic Act # 82 with NLSA Hospital Administrator, Ireneo I Santiago as its first mayor. The municipality was renamed – in honor of its great pioneer – to General Paulino Santos','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.171618),(133,0,3,4,'Gensan continued to grow as an influential economic center from 1992-1995 through the expertise in planning and economics of Hon. Mayor Adelbert W. Antonino. He promoted the SOCSARGEN, (South Cotabato, Sultan Kudarat, Sarangani & Gen. Santos) growth region a unified force with redefined geographical boundaries and economic borders','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.171618),(134,0,3,7,'General Santos City lies at the Southern part of the Philippines. It is located between 125°1’ and 125°17’ East longitude and between 5°58’ and 6°20’ North latitude. The city is Southeast of Manila, Southeast of Cebu and Southwest of Davao. The municipalities of Alabel, Malungon and Maasim of Sarangani Province and the municipalities of Polomolok and T’boli of South Cotabato surround the city','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.171618),(135,0,3,7,'The City belongs to the First Congressional District of South Cotabato and is one of the 5 cities in the SOCCSKSARGEN Region. Currently, the city has 26 barangays. Land Area.The total land area of the City is 53,606 hectares','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.171618),(136,0,3,7,'Majority of the entire land area constitutes wide flat lands stretching northeast of the city and undulating terrain.','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.171618),(137,0,3,7,'Mt. Matutum, towards the North, towers at 2,293 meters above sea level. Mt. Parker, at the Southwestern part of South Cotabato, towers at 2,040 meters above sea level','','','','','','','Region XII','Philippines',6.3577078,125.0718504),(138,0,3,7,'General Santos City is strategically located. Its location provides good trade access to major foreign markets -- Brunei, Singapore, Malaysia, Indonesia, Australia, Pacific Islands, Japan, Hongkong, Middle East, Continental Europe and the United States','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.171618),(139,0,3,7,'Uncertain quantities of mineral deposits are present in the city. Such minerals are limestone, iron sand, sulfur, copper, gold, nitrate, luminate, rutile and guano. Abundant sand and gravel are being quarried at the Silway river.','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.171618),(140,0,3,7,'Uncertain quantities of mineral deposits are present in the city. Such minerals are limestone, iron sand, sulfur, copper, gold, nitrate, luminate, rutile and guano. Abundant sand and gravel are being quarried at the Siguel river','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.171618),(141,0,3,7,'Uncertain quantities of mineral deposits are present in the city. Such minerals are limestone, iron sand, sulfur, copper, gold, nitrate, luminate, rutile and guano. Abundant sand and gravel are being quarried at the Buayan river','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.171618),(142,0,3,7,'There are six sluggish rivers draining the city. There are also six creeks, three large cold springs and several minor springs that have potentials as sources of potable water. Underground water is usually shallow./','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.171618),(143,0,3,7,'Climate is favorable. It is outside of the typhoon belt. Dominated by low plain areas and with evenly distributed rainfall, it is suitable for agricultural production and agri-based industries','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.171618),(144,0,3,3,'Fertile agricultural lands at 18,469.64 hectares including vast tract of lands for economic activities','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.171618),(145,0,3,3,'Upbeat local economy and unlimited opportunities for trade and investments because the city is home to a high percentage of the Philippines~ top 20 corporations like banks, manufacturers, and retail outlets. Power and water rates are among the most competitive in Mindanao. World-class telecommunication infrastructure requirements are among the best in the country for Internet-ready enterprises','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.171618),(146,0,3,7,'At present, there are three (3) main plant nurseries (City Hall compound, CENRO compound and the City Agri compound) which are being maintained to propagate the seedlings to ensure sustainability of the greening program. Landscaping works were implemented at Pioneer Avenue’s Center Island in Barangays West and South.','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.171618),(147,0,3,7,'Pedro St., Barangay Lagao, and Sarangani Highlands in Barangay Tambler. A few beaches (Dolores Tropicana Resort, Water Gran Beach Resort, London Beach Resort, Maharlika Beach Resort, T’boli Beach Resort, Rajah Beach Resort and Family Beach Resort) and spring resorts (Lagare Swimming Resort, and Olaer Swimming Resort) are available to the discriminating taste of visitors and local citizens','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.171618),(148,0,3,3,'Strong involvement and partnership between the government and various private stakeholders make General Santos an ideal place to demonstrate socio-economic actions with no less than the following nationally renowned non-government organizations are operating in the city: Notre Dame Business Resource Center, Marcellin Foundation, Gawad Kalinga, KPS Foundation, Philexport, Mahintana Foundation, Red Cross, Habitat for Humanity, among others','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.171618),(149,0,3,4,'Based on the recent Population Census conducted by the National Statistics Office, the total population as of August 1, 2007 was 529,542 persons, with an annual growth rate of 3.53 percent. The growth rate is lower than that of the 1995 to 2000 period which is 5.05 percent','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.171618),(150,0,3,4,'While close to 70.4% of the city population represent a ready supply in the labor market for the city and the region, unemployment poses a significant challenge with almost a quarter (21.4%) of the employable populace still looking for employment. Services sector (banking, finance, insurance) is an important employment engine. This reflected the dynamic importance of the city as the financial hub of the SOCCSKSARGEN region','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.171618),(151,0,3,3,'There are 47 banks (commercial, savings, and rural) operating in the city. Likewise, there are 49 lending investors, 105 pawnshops and 29 money shop/money transfer services','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.171618),(152,0,3,3,'The aggregate investment involved is estimated to be around PhP 38.65 billion. Gross sales of 8,247 registered and diverse business establishments amounted to PhP 49 billion./','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.171618),(153,0,3,6,'Electric power in the city is being provided by the SOCOTECO II. The latter gets its bulk supply from the state-owned National Power Corporation','','','','','General Santos','South Cotabato','Region XII','Philippines',6.121084,125.1896247),(154,0,3,6,'Moreover, General Santos City Water District provides water service in the city through several primary distribution mains. Domestic use accounts for 93% of the total water consumption in the city;\n commercial use accounts for 5% while industrial and government uses account for the remaining 2%','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1232495,125.1846787),(155,0,3,6,'General Santos City is only an hour and 20 minutes flight at some 1,200 statute miles from Manila, the main gateway and capital of the country. It is served by three air carriers -- Air Philippines, Philippine Airlines and Cebu Pacific – providing daily flights to Cebu and Manila. The international standard airport at Barangay Fatima is approximately fifteen (15) kilometers away from the city proper.','','','','','General Santos','South Cotabato','Region XII','Philippines',6.0546268,125.1047976),(156,0,3,3,'There are many registered existing agricultural enterprises in General Santos City. These agricultural enterprises are lead industries. Major products include corn, rice, banana, asparagus and pineapple.','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.171618),(157,0,3,6,'Presence of transportation facilities for sea, air and land is a competitive advantage. There is a good road network and adequate communication facilities within the city and neighboring places','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.171618),(158,0,3,6,'There is much water transportation in General Santos City it includes, boats, barges, cargo vessel, and other types of water transportation. There are also shipping lines and passengers vessel operates in and out of the city. The Negros Navigation and Superfery 14 &13','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.171618),(159,0,3,6,'The registered motor vehicles in the city have reached a total of 6,595 in 2001 posting an increase of 335 or 5.35% over that to the previous year of 6,260 and 4, 1270 or 63.23% that of 1999 with 2,425 motor vehicles. Of the 6,595 total numbers of vehicles in 2001, 5,855 are private vehicles, 428 are public utility or for hire and the remaining 312 are government-owned vehicles','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.171618),(160,0,3,4,'Based on the recent Population Census conducted by the National Statistics Office, the total population','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.171618),(161,0,3,4,'Literacy rate is high;\n good educational and training institutions are available. Two universities (Mindanao State University and Notre Dame of Dadiangas University) and a host of top-rated colleges (STI, AMA College and AMA CLC, RMMC and Holy Trinity College) are operating in the area','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.171618),(162,0,3,6,'General Santos City health services are supported by a strong network of 34 barangay health centers including 7 lying-in centers spread in 26 barangays. The 34 barangay health centers and 1 government hospital of the city have 51 physicians, 6 dentists, 44 midwives, and the remaining numbers of personnel are paramedic staff.','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.171618),(163,0,3,6,'Primary hospitals also provide services like health education, immunization, maternal/child health and family planning, nutrition and supply of essential drugs. Moreover, it renders services like minor surgery a simple laboratory examination. /','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.171618),(164,0,3,6,'The City hall of General Santos City is located in the heart of the city. Their vision is to have a livable community whose healthy, friendly, well educated and responsible citizens participated in effective governance and globally competitive economy by the year 2010. The political history of General Santos City came with the election rules created by the Commission on Election (COMELEC). Political leaders are very active in restoring the peace and order situation and community development in the city. Defeated politicians are likewise concerned with the same problems.','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.171618),(165,0,3,2,'Joint Task Force Gensan in support to the ISO and coordination with GSCPO and other Law enforcement agencies conducts Anti-Counter Terrorism operations to preempt terrorist plans and neutralize threat elements in order to protect the populace and secure vital installations facilities in the area','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.171618),(166,0,3,2,'The city has a stable peace and order condition. The incidence of crime is low, due to high police visibility and high crime solution efficiency of 98%. High-class educational institutions across levels are available. Cheap foodstuffs are available. Traffic congestion is not a problem. The city is accessible to nature-filled recreational sites. The city was recognized as the Cleanest and Greenest Highly Urbanized City in the Philippines in 2005','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.171618),(167,0,4,4,'Compostela Valley Province, the 78th province in the country, was carved out of Davao del Norte by virtue of Republic Act No. 8470, signed by President Fidel V. Ramos on January 30, 1998./','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(168,0,4,4,'The name originally proposed for the new province was Davao Del Norte, the former name, or so it was thought, of the mother province','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(169,0,4,7,'The province of Compostela Valley’s eleven (11) municipalities are group into two (2) legislative districts: District I – Compostela, Maragusan, Monkayo, Montevista, and New Bataan;\n and District II – Laak, Mabini, Maco, Mawab, Nabunturan, and Pantukan. ','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(170,0,4,7,'It has a total land area of 4,666.93 square kilometers and is classified as a First Class Province','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(171,0,4,4,'The origin of the province’s inhabitants came from the ethnic tribes of the mansaka, mandaya, manobo, mangguangan, dibabawon, aeta, kamayo, davaweño and kalagan. Similar to the history of other Mindanao provinces, most of the present populations of the province are descendants of migrants who came from Luzon and Visayas islands during the pre-war and post war eras','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(172,0,4,7,'The province of Compostela Valley lies in the mid-eastern portion of Mindanao Island, approximately within 125o40’ east longitude and 7o4’ to 8o00’ north latitude. It is bounded by Agusan Del Sur on the North, Davao Oriental on the East and South, Davao Gulf on the Southwest, and Davao Del Norte on the West and Northwestern portion','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(173,0,4,7,'The Southwestern portion of the province starts with a coastal plain rising gently from the Davao Gulf. This coastal plain develops into gently rolling hills and finally into mountains in the inland lying area. The central part, which is the greater plain, comprises the municipalities of Mawab, Nabunturan, Montevista, New Bataan, Compostela, and Monkayo','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(174,0,4,7,'On the other hand, the hydro-geological characteristic of the province is considered very favorable. The data indicate that the province has at least 47 rivers, 115 creeks, 4 lakes, 302 cold springs and at least 8 hot springs. The province is likewise endowed with potable spring water found in the different municipalities','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(175,0,4,7,'Agusan River is the biggest river traversing Compostela Valley. With its tributaries, it provides the major irrigation needs of the province','','','','','Butuan City','Agusan Del Norte','Caraga','Philippines',8.9175762,125.5541581),(176,0,4,7,'the monthly average temperature in the province from 2002-2006 is 27.81 degrees centigrade','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(177,0,4,7,'The rainy season is most likely to occur between in the months of May and January of the following year, with pronounced maximum rainfall during the months of October to December. The dry season is usually to start from February to April. ','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(178,0,4,7,'PAGASA records showed that the monthly average relative humidity of Compostela Valley Province is 90.72%. The annual highest relative humidity was 92.00% in 2004, while the lowest was 71.00% in 2002','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(179,0,4,7,'Record shows that the wind direction in the province is usually blowing to the north, specially during the months of June, July, and 