vis total consumption requirement. In 2006, total fish production was 4,443.28 metric tons with captured marine production of 4,007.70 metric tons of which Pantukan had the largest volume of catch at 1,877.50 metric tons, followed by Maco with 1,132.45 metric tons, and Maco with 997.75 metric tons./','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(231,0,4,3,'province was able to generate an actual income of 697,328,056.82 which is 21.32% higher than in CY 2005’s actual income. This is composed of 3.90% tax revenues;\n 8.05% non-tax revenues;\n 66.62% Internal Revenue Allotments (IRA);\n and 21.43% extraordinary receipts/grants/aids.','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(232,0,4,3,'Of the eleven (11) municipalities of Compostela Valley, six are classified as first class municipalities;\n two are second class;\n and three are third class municipalities. However, six municipalities are implementing salary rates equal to the first class province, while the other five municipalities are implementing salary rates equal to the level of first class, second class, and third class municipalities','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(233,0,4,6,'Compostela Valley Province has 13 banking institutions of which 6 are rural banks, 4 are enterprise cooperatives, and 4 are commercial banks. The services offered by these institutions generally include regular savings, time deposits, commercial loans, salary loans for government employees, agricultural loans and other credit assistance for farmers and investors','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(234,0,4,3,'Agricultural production is the major economic activity of the province. Large portion of the province’s total land area is allotted for agricultural activities which are planted with rice;\n corn;\n industrial and commercial crops such as coconut, coffee, abaca and rubber;\n fruit crops like banana, mango, pineapple, durian, calamansi, mandarin, and lanzones;\n and vegetable crops including root crops and tubers. The province has great potentials for food production','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(235,0,4,3,'The total volume of various crops produced by the province for CY 2006 was 264,620.62 metric tons (MT), which is 21.40% more than the 2005 production. It shows an average yield per hectare of 4.46 metric tons.','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(236,0,4,3,'The key production areas of rice are municipalities of Nabunturan;\n and in some barangays of Laak, Pantukan, Monkayo and Montevista','','','','','Nabunturan','Compostela Valley','Davao Region','Philippines',7.5853685,125.9805528),(237,0,4,3,'The key production areas of rice are municipalities of Compostela;\n and in some barangays of Laak, Pantukan, Monkayo and Montevista','','','','','Compostela','Compostela Valley','Davao Region','Philippines',7.6659683,126.084695),(238,0,4,3,'The key production areas of rice are municipalities of Mawab;\n and in some barangays of Laak, Pantukan, Monkayo and Montevista','','','','','Mawab','Compostela Valley','Davao Region','Philippines',7.4968622,125.958777),(239,0,4,3,'The key production areas of rice are municipalities of New Bataan;\n and in some barangays of Laak, Pantukan, Monkayo and Montevista','','','','','New Bataan','Compostela Valley','Davao Region','Philippines',7.554702,126.1403526),(240,0,4,3,'The key production areas of rice are municipalities of Maragusan;\n and in some barangays of Laak, Pantukan, Monkayo and Montevista','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(241,0,4,7,'Inventory of livestock and poultry conducted in 2006 shows that the province has 6,274 heads of cattle;\n 19,444 carabaos;\n 130,990 hogs/swines;\n 30,019 goats;\n 1,008,409 chicken (native & imported);\n 39,105 ducks;\n 1,078 geeses;\n and 1,572 turkeys','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(242,0,4,3,'There are 1,012 industrial and manufacturing establishments in the province, which are mostly composed of small-scale category. Among the component municipalities in the province, Pantukan has the largest number of establishments at 229, followed by Monkayo with 207, and at far next is Nabunturan with 129 establishments','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(243,0,4,3,'The province has accounted 9,314 registered commercial establishments engaging in various types of business such as banking and finance, wholesale trade, retail trade, real estate, and services','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(244,0,4,6,'In 2006, the total length of the road network of Compostela Valley Province was 3,387.3605 kilometers. It is classified as follows: national, provincial, municipal, and barangay roads. Table 40 shows that the barangay road is the most extensive one with the total length of 2,056.6865 kilometers, while municipal road is at the least with 228.4780kilometers','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(245,0,4,3,'Based on the record of the Land Transportation and Franchising Regulatory Board (LTFRB), there are 416 units of Public Utility Vehicles (PUV) that are conveying passengers to and from the province or within the province of Compostela Valley. Out of this number, Public Utility Buses summed up to 82 units;\n multicabs/Public Utility Jeeps (PUJs), 230 units;\n and Van, 104 units','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(246,0,4,6,'The province has no domestic air and water transport facilities, as well as railroad facility. However, the provincial governmrnt included in its development agenda the construction of water transport facilities at the municipality of Maco which caters the shipping needs of the province and the spillover from the nearby Sasa Wharf in Davao City. Nevertheless, airstrips are present in the municipalities with banana plantations.','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(247,0,4,6,'Compostela Valley Province has various sources of potable water. Drinking water is being provided by the local water system, particularly at the urban areas of the municipalities. The most functional and accessible water district in the province is the Nabunturan Water District situated at the Nabunturan itself, the capital town of the province. But such water district can serve only to few number of barangays of Nabunturan','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(248,0,4,6,'The electricity of the province has been served by the Davao del Norte Electric Cooperative (DANECO), a rural electric cooperative whose power supply sourced out from the National Power Corporation (NAPOCOR). DANECO has a total power capacity of 53.866 megavolt amperes distributed to 8 substations. Of the 8 power substations, 4 are situated in Compostela Valley and the other 4 are in Davao Del Norte. The 4 substations in Compostela Vallley are strategically installed in Monkayo, Maco, Nabunturan, and in Apex mining area in Maco. Moreover, the main power station of the DANECO is found in Montevista, Compostela Valley','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(249,0,4,6,'The Philippine Postal Corporation (PPC) has installed its field offices at one (1) office in every municipality of the province, utilizing office spaces afforded by the municipal governments to provide mailing and money order services to constituents.','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(250,0,4,6,'The Department of Transportation and Communication (DOTC) had established its provincial office at Nabunturan (DOTC-Telecommunication Office) to hasten facilitation in responding to the demand in telecommunication services.','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(251,0,4,4,'The province of Compostela Valley through the Department of Education has implemented pre-elementary school program for children 6 years old and below. Sixty-five public elementary schools provincewide in coordination with the Parent-Teacher Community Association (PTCA) have afforded classrooms and teachers to hold classes for pre-schoolers. It has a total of 82 pre-elementary school classes with a total of 2,661 enrollees as of school year 2006-2007','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(252,0,4,6,'In SY 2006-2007, there were 339 schools recorded for elementary level of education in the province, of which 321 are public and 18 are private. Out of the 321 public schools, 278 are complete elementary;\n 23 are complete primary;\n 9 are incomplete elementary;\n and 11 are incomplete primary. These elementary schools are clustered according to its location and form part of the municipal school districts, of which the province has 13 municipal school districts.','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(253,0,4,6,'Secondary level of education in the province has recorded a total of 68 schools, 56 are public and 12 are private high schools. Of the 56 public high schools, 36 are regular and 20 are annexes.','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(254,0,4,6,'In the tertiary level, there are 9 institutions recorded, 5 are state colleges, 3 are state universities, and a private institution. The five state colleges are the External Learning Centers (ELC) of Bukidnon State College, which were established in Montevista, Monkayo, Compostela, New Bataan, and Maragusan;\n while the three state universities are branches of the University of the Southeastern Philippines (USP) that were installed in Mabini, Pantukan, and Compostela. The lone private tertiary school named Assumption College of Nabunturan (ACN) is found in Nabunturan, the capital town of the province','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(255,0,4,6,'The lone private tertiary school named Assumption College of Nabunturan (ACN) is found in Nabunturan, the capital town of the province','','','','','Nabunturan','Compostela Valley','Davao Region','Philippines',7.5853685,125.9805528),(256,0,4,4,'In SY 2006-2007, there were 95,841 children enrolled in elementary level of education in the province. This number of enrollees represents 75.20% of the estimated school going age population for elementary level aged 6-12 years old (table 56), which means further that there were around 31,604 estimated number of children of the same age who were not in school for that school year','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(257,0,4,4,'There were 40,472 students actually enrolled in high school during SY 2006-2007. This number represents 64.04% of the estimated school going age population aged 13-16 years old for secondary level (Table 57), thus indicates that there were about 22,726 estimated supposed high students who were not in school for that school year or maybe others were enrolled in high schools outside Compostela Valley.','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(258,0,4,4,'During SY 2006-2007, there were 2,594 classrooms available for the 95,841 enrollees for public elementary level of education in the province. This implies a pupil-classroom ratio of 36.95. This means that there were around 37 pupils in a room which is 3 pupils lower than the DepEd standard of 40 pupils for every classroom. However, the total seats available for the actual enrolment during such school year are good only for 93,701 pupils, thus, having a shortage of about 2,140 seats','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(259,0,4,4,'The provincial government of Compostela Valley through the Department of Education (DepEd) has successfully implemented the Non-Formal Education (NFE) or Alternative Learning System (ALS) programs for the out-of-school youth and interested adults in the province. This program also caters to the indigenous people who mostly settled in the upland areas of the province.','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(260,0,4,4,'In 2000 National Statistics Office (NSO) Census of Population and Housing, it was recorded that the province of Compostela Valley has a total of 117,752 occupied housing units. Out of this number, single houses dominated the total at 111,600 units or 94.77%, while the remaining 5.23% is composed of 2,078 duplex units;\n 2,668 multi-unit residential;\n 487 commercial/industrial/agricultural buildings;\n 18 institutional living quarters;\n 5 other type of housing units;\n and 896 units which were not reported as to what type.','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(261,0,4,4,'In 2006, there were about 14,364 total livebirths in the province, which is 0.5% higher than in 2005. This year’s crude birth rate (CBR) is recorded at 21.42 or around 21 livebirths per 1,000 populations. Among the component municipalities of the province, Pantukan registered with the biggest number of livebirths at 1,865 or 12.98% of the provincial total live births, while Mabini recorded with the least number at 717 or 4.99%./','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(262,0,4,4,'In 2006, there were 1,920 deaths recorded in the province, representing a crude death rate (CDR) of 4.52 or around 5 persons for every 1,000 population. The number of deaths in 2006 was 7.22% higher than in 2005. Of the 11 municipalities in the province, Compostela registered with the highest CDR of 5.85 while Laak has the lowest at 2.47.','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(263,0,4,4,'In 2006, infant mortality rate (IMR) in the province recorded at 15.87, which means that for every 1,000 newly born babies there are around 16 babies died within the year. This year’s IMR is slightly higher than in 2005 by 2.32%. Among 11 municipalities in the province, Compostela registered with the highest IMR of 25.61, which is 61.37% higher than the provincial level IMR. At far second is Nabunturan with 21.64, while Laak registered with the lowest IMR of 10.70, closely followed by New Bataan with 10.95.','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(264,0,4,4,'Maternal Mortality Rate (MMR) in the province was recorded at 1.60 or around two mothers died due to child bearing for every 1,000 livebirths in 2006. Among 11 municipalities, Pantukan and Laak had no recorded incidents of maternal deaths. Montevista registered with the highest MMR of 4.42, while at far second was Compostela with 2.84, followed by Maco and Monkayo with 2.75 and 2.18, respectively.','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(265,0,4,4,'The child mortality rate (CMR) in the province during 2006 was recorded at 30.14 or around 30 children died within the year for every 10,000 child population (aged < 5 years old). This CMR is a bit lower than in 2005 by 0.46%. Of the 11 component municipalities, Compostela recorded with the highest CMR of 54.19 which is almost twice higher than the provincial level’s CMR','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(266,0,4,4,'In 2006, there were 96,665 individuals ranging from the age 0-65 years old and over who had induced by various diseases. It implies a morbidity rate of 14.42%, which means that for every 100 people of all ages in Compostela Valley, there were around 14 individuals who got sick in 2006./','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(267,0,4,4,'The ten (10) leading causes of morbidity in the province include: 1) acute upper respiratory infections;\n 2) pneumonia;\n 3) accidents, injuries;\n 4) urinary tract infections;\n 5) diarrhea & gastroenteritis;\n 6) hypertension;\n 7) intestinal parasitism;\n 8) cerebrovascular disease;\n 9) anemia;\n and 10) renal diseases','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(268,0,4,4,'Ninety-One Thousand Four Hundred Sixty-Three (91,463) children or 78.62% of the total estimated child population aged 0-71 months old in Compostela Valley were weighed during the conduct of Operation Timbang in March 2006. Of the 91,463 children, 799 weighed below normal (very low) and 9,793 weighed below normal','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(269,0,4,4,'Health services in the province are being delivered through concerted efforts of the provincial and municipal governments through its respective health personnel. Moreover, personnel of the Department of Health (DOH) both from regional and national levels have conducted regular visit to reinforce the existing number of health personnel in the province, as well as to monitor health programs and projects initiated from their levels','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(270,0,4,4,'Cebuano is the most common dialect in the province of Compostela Valley. It is being adopted by about 52.27% of the province’s total household population. Next to cebuano is boholano with 12.31%, while bisaya/binisaya and mansaka dialects have 8.77% and 5.53%, respectively','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(271,0,4,4,'Of all religious sects present in the province of compostela Valley, Roman Catholic has the largest number of followers at 433,086 or 74.71% of the province’s total population. At far second are Evangelicals with 53,171 members, followed by Iglesia ni Cristo, Islam, Aglipay, and Seventh Day Adventist with total members only closer to 10,000 individuals each','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(272,0,4,4,'Cebuanos dominate the province’s populace with a total of 302,979 or 52.27% of the total household populations of 579,676. The remaining 47.73% of the household populations are composed of Boholano, 12.31%;\n Mansaka, 5.53%;\n Hiligaynon-Ilongo, 4.75%;\n bisaya/binisaya, 8.77%;\n and other ethnic groups at 28.68%','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(273,0,4,4,'Filipino is the nationality of the most people living in Compostela Valley at 95.68% of the total household populations (per 2000 NSO Census). Foreign nationals to include Chinese, Indonesian, Indian, Spaniard, American, British, and other foreigners constitute only 4.32%/','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(274,0,4,4,'In 2000 POPCEN, Compostela Valley Province recorded a total population of 580,244 which is 11.56% more than the 1995 population of 520,110 and 11.18% of the Southern Mindanao (Region XI)’s total population of 5,189,335','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(275,0,4,4,'Sports facilities present in the province include basketball courts, volleyball courts, softball/baseball courts, gymnasium, soccer fields/track and field, and tennis courts that can be found in all municipalities of the province. Among the enumerated facilities, basketball courts registered with the largest in number as compared to other facilities mentioned','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(276,0,4,4,'The delivery of social welfare services of the province is primarily functioned by the Provincial Social Welfare and Development Office (PSWDO) of the provincial government of Compostela Valley in coordination with the Municipal Social Welfare and Development Offices (MSWDOs)./','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(277,0,4,4,'Compostela Valley Province has endowed with various natural and manmade tourist attractions. These tourist attractions include a number of waterfalls, caves, lakes, beach resorts, inland resorts, islands, mountain ranges, and hot and cold springs. The natural beauty and ambiance of these tourist spot makes recurrent and potential tourists attracted to come and visit the province','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(278,0,4,4,'A social organization present in the province is the Rotary Club of Compostela Valley Chapter, which has an office at Nabunturan. This organization was instituted in 1999 and it is a civic organization. The main objective of the organization is to provide assistance on socio-economic services. Another social organizations and at the same time religious organizations are the Knights of Columbus, Couples for Christ, and Youth for Christ','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(279,0,4,4,'The provincial government of Compostela Valley is composed of two branches of government, namely, executive branch and legislative branch. The executive branch, which is headed by the provincial governor, has 12 provincial offices or departments. Legislative branch, on the other hand, is the Sangguniang Panlalawigan (SP) with the vice governor as the presiding officer, and has the 10 regular members. Additional members to the legislative branch are the president of the Federation of the Association of the Barangay Captains, the president of the Federation of Sangguniang Kabataan, and the president of the Provincial Councilor’s League','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(280,0,4,2,'The AFP Forces operating in Compostela Valley Province is the 66th Infantry (Kabalikat) Battalion which is located at Brgy Cabinuangan, New Bataan, CVP. Its Area of Responsibility covers the municipality of New Bataan, Maragusan, Mawab and part of Nabunturan. While 25th Infantry ( Fireball ) Battalion the Hqs located at Camp Kalaw, Monkayo, CVP which covers the municipality of Monkayo, Compostela and part of Montevista, CVP. The two (2) battalions is under the operational control of 1001st Infantry (Pag-asa) Brigade, 10TH Infantry (Agila) Division stationed at So Quarry, Bry Mapaang, Maco, CVP','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(281,0,4,2,'The PNP Forces in the area is the Provincial Police Office (PPO) located at Brgy Poblacion, Nabunturan, CVP with respective PNP headquarters in every municipality and several outposts located at strategic areas in the AOR','','','','','','Compostela Valley','Davao Region','Philippines',7.512515,126.1762615),(282,0,5,4,'South Cotabato is a very young province. In almost three decades, it has attained phenomenal progress. Its progress can be attributed to the ingenuity of the development schemes planned for this province that are translated into tangible realities. But South Cotabato has a long history of pioneering immigrants who faced undauntedly the challenges of nature and the vagaries of politics. They were the men who laid the foundation of what was to become a progressive province.','','','','','','South Cotabato','Region XII','Philippines',6.3357565,124.7740793),(283,0,5,7,'South Cotabato is located in the southern part of the island of Mindanao. It is bounded by the province of Sultan Kudarat in the north and west, in the east and south by the city of General Santos and Province of Sarangani. It lies at the latitude of about 6 degrees and fifteen minutes north and about 125 degrees longitude. Its main access to the sea is through the Sarangani Bay where the modern port of General Santos City is located.','','','','','','South Cotabato','Region XII','Philippines',6.3357565,124.7740793),(284,0,5,7,'The province has a total land area of about 3,706 square kilometers. A large reduction of its land area was due to the creation of Sarangani province. The biggest municipality is Lake Sebu with a total land area of approximately 891.38 square kilometers. T’boli is the next with an area of 809.00 square kilometers followed by Polomolok with 339.97 sq km. The smallest municipalities are Tantangan and Sto Niño with an area of 126.00 and 109.04 sq km, respectively.','','','','','','South Cotabato','Region XII','Philippines',6.3357565,124.7740793),(285,0,5,1,'Upon its creation as a regular province, South Cotabato consisted of 11 municipalities, namely: Banga, General Santos (now a city), Glan, Kiamba, Koronadal, Maitum, Norala, Polomolok, Surallah, Tantangan and Tupi. These municipalities were established long before the creation of the province. Other component municipalities were constituted after it fully functioned as a province. A total of 18 municipalities have contributed much to the development of South Cotabato being one of the fast growing provinces in the country.','','','','','','South Cotabato','Region XII','Philippines',6.3357565,124.7740793),(286,0,5,7,'South Cotabato has many distinct physiographic features. The Daguma Range, consisting of a series of relatively high mountains, upland lakes, and some inactive volcanoes extend from the province of Maguindanao to the southern extreme of South Cotabato, where it forms the boundary of Sarangani Province.','','','','','','Sultan Kudarat','Region XII','Philippines',6.3913889,124.5938889),(287,0,5,7,'The landform is concentrated in the plains;\n valley floors, stream beds and alluvial forms and consist of unconsolidated clay, silt, sand, pebbles, angular and rounded gravel mixed in a sand or clay matrix. It shows mixed characteristics of volcanic and sedimentary origin. This landform is very extensive. It is found typically in the Koronadal Valley.','','','','','Koronadal City','South Cotabato','Region XII','Philippines',6.4973963,124.8471625),(288,0,5,7,'The landform is concentrated in the plains;\n valley floors, stream beds and alluvial forms and consist of unconsolidated clay, silt, sand, pebbles, angular and rounded gravel mixed in a sand or clay matrix. It shows mixed characteristics of volcanic and sedimentary origin. This landform is very extensive. It is found typically in the Allah Valley.','','','','','Surallah','South Cotabato','Region XII','Philippines',6.3821287,124.7520594),(289,0,5,7,'Several other alluvial deposits are found in the province, appearing as river terraces, marshes, broad plains, and narrow unfilled valleys, such as near Lake Sebu','','','','','Lake Sebu','South Cotabato','Region XII','Philippines',6.2447394,124.5528387),(290,0,5,7,'Several alluvial forms are found in the Allah River','','','','','Surallah','South Cotabato','Region XII','Philippines',6.3297214,124.7310236),(291,0,5,7,'Several alluvial forms are found in the T~boli','','','','','T~Boli','South Cotabato','Region XII','Philippines',6.1468256,124.906551),(292,0,5,7,'Several alluvial forms are found in Tampakan River','','','','','Tampakan','South Cotabato','Region XII','Philippines',6.4912111,125.0828588),(293,0,5,7,'These landforms are derived from both sedimentary and igneous rocks and are observed throughout the province. Sedimentary formations include limestone, shale, siltstone and conglomerates. Igneous formations are derived from quarternary volcanic pyroclastics, volcanic agglomerates, ultra basic rocks and metavolcanics.','','','','','','South Cotabato','Region XII','Philippines',6.3357565,124.7740793),(294,0,5,7,'Volcanic foot slopes are composed of thick and extensive pyroclastics, consisting of various volcanic ejecta including lapili, tuff, breccias, mixed with volcanic sand, ash and andesite boulders from the Mt. Matutum Volcano','','','','','','','Region XII','Philippines',6.3577078,125.0718504),(295,0,5,7,'Volcanic foot slopes are composed of thick and extensive pyroclastics, consisting of various volcanic ejecta including lapili, tuff, breccias, mixed with volcanic sand, ash and andesite boulders from the Mt. Parker Volcano.','','','','','T~Boli','South Cotabato','Region XII','Philippines',6.1030293,124.8955195),(296,0,5,7,'The landforms are composed of hills with significant relief having crests of less than 500 meters elevation. They are formed by warping and folding of sedimentary rocks, tectonic uplift and volcanic action and are found throughout the province.','','','','','','South Cotabato','Region XII','Philippines',6.3357565,124.7740793),(297,0,5,7,'Limestone hills are found in the Municipality of Lake Sebu.','','','','','Lake Sebu','South Cotabato','Region XII','Philippines',6.2447394,124.5528387),(298,0,5,7,'Volcanic hills derived from volcanic parent materials of different occurrence and stages are scattered throughout the province. hey are mainly derived from volcanic lava flows, volcanic ash and sand, and have been severely dissected to various depths, by streams flowing in a radial drainage pattern from the center of the volcanoes.','','','','','','South Cotabato','Region XII','Philippines',6.3357565,124.7740793),(299,0,5,7,'These landforms are formed by tectonic uplift by stress and divided into several types of mountains including limestone, sedimentary and volcanic mountains. These are found throughout the province, particularly the southwest and southeast portions.','','','','','','South Cotabato','Region XII','Philippines',6.3357565,124.7740793),(300,0,5,7,'There are several watersheds in South Cotabato. The Allah River has a total watershed area of 102,350 hectares. It originates in the peak of the Mt. Parker and flows northwest, being joined by the Banga and Lonon rivers.','','','','','Isulan','South Cotabato','Region XII','Philippines',6.575427,124.5950423),(301,0,5,7,'Banga River has a total watershed area of 32,925 hectares.','','','','','Banga','South Cotabato','Region XII','Philippines',6.3215362,124.8693743),(302,0,5,7,'Other watershed area is the Marbel River with a total of 58,668.50 hectares. It flows north to Buluan Lake','','','','','Koronadal City','South Cotabato','Region XII','Philippines',6.520232,124.8675898),(303,0,5,7,'South Cotabato belongs to the fourth type of climate that is rainfall is more or less evenly distributed throughout the year. The average number of rainy days is recorded between 142 to 156 days with the months of May, July, August and October having the most occurred.','','','','','','South Cotabato','Region XII','Philippines',6.3357565,124.7740793),(304,0,5,7,'South Cotabato contains approximately 370.590 hectares with almost 44.47% of the total land area classified as arable land suitable for agricultural crops. Grasslands consists an area of 106,063 hectares or 28.62% of the total land area of the province, of which 4,861 hectares are further sub-classified as pasture land.','','','','','','South Cotabato','Region XII','Philippines',6.3357565,124.7740793),(305,0,5,7,'The soils of the province exhibit the variability that is inherent in the geology of the area. Principal types of soil in the province are loam, sandy loam and fine sandy loam. The large portion is classified as undifferentiated mountain soils. The rivers and streams do not erode vertically to any significant degree but tend to horizontal erosion. Horizontal erosion and meandering of river traces through the years have caused significant mixing of soil types and particles sizes.','','','','','','South Cotabato','Region XII','Philippines',6.3357565,124.7740793),(306,0,5,7,'Much of the forestland requires reforestation.','','','','','','South Cotabato','Region XII','Philippines',6.3357565,124.7740793),(307,0,5,7,'The hills and mountains which were once fully covered with closed canopy dipterocarp rainforest have been or are now denuded.','','','','','','South Cotabato','Region XII','Philippines',6.3357565,124.7740793),(308,0,5,7,'The remaining forested areas of the province are mostly confined to the southwest in the Daguma Range around Lake Sebu and in the immediate vicinity of Mt Matutum.','','','','','','South Cotabato','Region XII','Philippines',6.3357565,124.7740793),(309,0,5,7,'Open canopy forest (or residual forest) generally results from logging operations in which preferred trees are harvested. Forest habitat in the highest elevations is of the type classified as mossy rainforest under the Philippine classification system. It is generally considered undesirable for commercial logging purposes because tree diameters are typically small.','','','','','','South Cotabato','Region XII','Philippines',6.3357565,124.7740793),(310,0,5,7,'The geological formation of South Cotabato has been affected by uplift, subsidence, faulting, marine transgressions, volcanic activity and water erosion. Consequently, the geology of the province is notable in its diversity. Basalt, andesite, rhyolite, agglomerates and similar materials form the base rock which is overlain with alluvium, much of which is of volcanic origin. Sedimentary rock is present in about 44 percent of the area.','','','','','','South Cotabato','Region XII','Philippines',6.3357565,124.7740793),(311,0,5,7,'About 5,150 hectares of timberland in the municipality of Lake Sebu has been identified as proposed wilderness areas supporting various species of wildlife.','','','','','Lake Sebu','South Cotabato','Region XII','Philippines',6.2447394,124.5528387),(312,0,5,7,'Lake Maughan on the other hand is found in T~boli and is part of the approximately 50,000 hectares also proposed to be Provincial Park and wildlife sanctuary.','','','','','T~Boli','South Cotabato','Region XII','Philippines',6.1014093,124.887245),(313,0,5,7,'The Philippine Eagle and some rare and endangered species of wildlife were reported to have been sighted in these areas.','','','','','T~Boli','South Cotabato','Region XII','Philippines',6.1014093,124.887245),(314,0,5,7,'About 28,450 hectares of land are allocated as civil reservations in the province. These are mostly located in the municipalities of Lake Sebu','','','','','Lake Sebu','South Cotabato','Region XII','Philippines',6.2447394,124.5528387),(315,0,5,7,'About 28,450 hectares of land are allocated as civil reservations in the province. These are mostly located in the municipalities of T~boli.','','','','','T~Boli','South Cotabato','Region XII','Philippines',6.1014093,124.887245),(316,0,5,7,'Most of these reservations are the ancestral lands of the tribal communities of T~boli, B~laan, Tasaday and Manobo.','','','','','','South Cotabato','Region XII','Philippines',6.3357565,124.7740793),(317,0,5,7,'The most popular waterfall is Lonon Falls in Lake Sebu.','','','','','Lake Sebu','South Cotabato','Region XII','Philippines',6.2447394,124.5528387),(318,0,5,7,'Many of the waterfalls in the province are rarely visited because of their distant locations, which are usually in the mountains and isolated areas.','','','','','','South Cotabato','Region XII','Philippines',6.3357565,124.7740793),(319,0,5,7,'San Jose Falls in Lake Sebu has a high water discharge capacity.','','','','','Lake Sebu','South Cotabato','Region XII','Philippines',6.2447394,124.5528387),(320,0,5,7,'Lambusong Falls in Norala has a high water discharge capacity','','','','','Norala','South Cotabato','Region XII','Philippines',6.5205908,124.6648038),(321,0,5,7,'Lake Maughan in T~boli is part of the approximately 50,000 hectares proposed to be Provincial Park and Wildlife Sanctuary.','','','','','T~Boli','South Cotabato','Region XII','Philippines',6.1014093,124.887245),(322,0,5,7,'The watersheds of Banga River is identified as critical. These areas require rehabilitation since they are being used as source of water for irrigation and domestic use. The degraded condition of these areas contributed to the decrease in the water infiltration capacity of its soils, resulting in the reduction in the recharge of groundwater aquifer, and loss of fertility in soil. Adequate vegetation on these catchment areas will help regulate and stabilize water run-off.','','','','','Banga','South Cotabato','Region XII','Philippines',6.3215362,124.8693743),(323,0,5,7,'The watersheds of Allah River is identified as critical. These areas require rehabilitation since they are being used as source of water for irrigation and domestic use. The degraded condition of these areas contributed to the decrease in the water infiltration capacity of its soils, resulting in the reduction in the recharge of groundwater aquifer, and loss of fertility in soil. Adequate vegetation on these catchment areas will help regulate and stabilize water run-off.','','','','','Surallah','South Cotabato','Region XII','Philippines',6.3297214,124.7310236),(324,0,5,7,'The watersheds of Marbel River is identified as critical. These areas require rehabilitation since they are being used as source of water for irrigation and domestic use. The degraded condition of these areas contributed to the decrease in the water infiltration capacity of its soils, resulting in the reduction in the recharge of groundwater aquifer, and loss of fertility in soil. Adequate vegetation on these catchment areas will help regulate and stabilize water run-off.','','','','','Koronadal City','South Cotabato','Region XII','Philippines',6.520232,124.8675898),(325,0,5,7,'Most of the critical areas are located in the mountainous areas of Lake Sebu. Major portions of the remaining forests are reserved to protect the remaining resource from over exploitation.','','','','','Lake Sebu','South Cotabato','Region XII','Philippines',6.2447394,24.5528387),(326,0,5,3,'Under the provision of Section 9 of Executive Order No. 249 issued by the President, the Secretary of Finance is vested with the authority to review the income ranges that serve as basis for the income classification of the local government units (LGUs). Upon considering the trends and patterns in the financial statements of the local government units for calendar years 1996-1999 the Department of Finance issued Department Order No. 32-01 dated November 20, 2001, prescribing a new classification scheme for LGUs effective as of date of Order amending Department Order No. 24-97 dated March 26, 1997.','','','','','','South Cotabato','Region XII','Philippines',6.3357565,124.7740793),(327,0,5,3,'The income of the province has been continuously growing at the rate of 2.7% from 2002 to 2003 and 2.4% from 2003 to 2004. Among the various sources of income in 2004, the share from the national tax collection or the provinces internal revenue allotment accounts the highest percentage of 85% out of the total income of P466.4 million. Tax revenue contributes 9% and the remaining 6% from the non-tax revenue.','','','','','','South Cotabato','Region XII','Philippines',6.3357565,124.7740793),(328,0,5,3,'Real Property Tax is a major local income of the province. It is a tax imposes to land, buildings, equipment and other improvements thereon. In terms of collection, the province has collected 89% out of its collectible in 2004 for basic tax of which a bigger portion comes from the current year collection. While Special Education Fund (SEF) collection is 85%. As a result 2004 collection for both basic and SEF is 87% which only shows that even in this prolonged economic crisis that the province or the whole county is experiencing still the province was able to collect this much. This is attributed by the massive tax campaign program of the provincial government.','','','','','','South Cotabato','Region XII','Philippines',6.3357565,124.7740793),(329,0,5,3,'Based on the new income bracket scheme of the municipality of Banga, formerly third class, is now elevated to a first class municipality, resulting to a total of four first class municipalities including Polomolok and Surallah who has retained their income classes, and T~Boli who was elevated from second class.','','','','','Banga','South Cotabato','Region XII','Philippines',6.3879114,124.7961722),(330,0,5,3,'Based on the new income bracket scheme of the municipality of T~Boli, formerly second class, is now elevated to a first class municipality, resulting to a total of four first class municipalities including Banga, who was elevated from third, and Polomolok and Surallah who has retained their income classes.','','','','','T~Boli','South Cotabato','Region XII','Philippines',6.1468256,124.906551),(331,0,5,3,'Polomok is a part of the first income class.','','','','','Polomok','South Cotabato','Region XII','Philippines',6.224513,125.0608405),(332,0,5,3,'Surallah is a part of the first income class.','','','','','Surallah','South Cotabato','Region XII','Philippines',6.3194959,124.7519807),(333,0,5,3,'Lake sebu is reclassified to the second income class.','','','','','Lake Sebu','South Cotabato','Region XII','Philippines',6.2447394,124.5528387),(334,0,5,3,'Norala is a part of the third income class.','','','','','Norala','South Cotabato','Region XII','Philippines',6.5205908,124.6648038),(335,0,5,3,'Tupi is part of the third income class.','','','','','Tupi','South Cotabato','Region XII','Philippines',6.3384936,124.9727096),(336,0,5,3,'Sto. Nino is part of the third income class.','','','','','Sto. Nino','South Cotabato','Region XII','Philippines',6.4371507,124.6744413),(337,0,5,3,'Tampakan is part of the third income class.','','','','','Tampakan','South Cotabato','Region XII','Philippines',6.4912111,125.0828588),(338,0,5,3,'Tantangan is part of the fourth income class.','','','','','Tantangan','South Cotabato','Region XII','Philippines',6.5712051,124.7608883),(339,0,5,3,'2004 was a period of great challenge for the agriculture sector. It was a time where determination of the farmers was tested. During the year the costs of farm inputs continued to escalate while the farmers experienced low productivity and low prices of outputs. More so, the province was declared under the state of calamity due to plant hoppers and rodent infestation. Around P93M worth of agricultural crops in 3,178 hectares of farmlands were damaged.','','','','','','South Cotabato','Region XII','Philippines',6.3357565,124.7740793),(340,0,5,3,'Almost 44.47% of the total land area of South Cotabato is classfied as arable land suitable for agricultural crops.','','','','','','South Cotabato','Region XII','Philippines',6.3357565,124.7740793),(341,0,5,3,'Rice, corn, coconut, pineapple, asparagus, papaya, and banana are the major crops of the province.','','','','','','South Cotabato','Region XII','Philippines',6.3357565,124.7740793),(342,0,5,3,' It should be noted  that area and production of pineapple, asparagus and papaya are too small since the data are only based on the partial reports taken from small farms under the area of concern of the Office of the Provincial Agriculturist (OPAgri) and the Bureau of Agricultural Statistics (BAS).','','','','','','South Cotabato','Region XII','Philippines',6.3357565,124.7740793),(343,0,5,3,'Big companies engaged in large plantation and production of rice, corn, coconut, pineapple, asparagus, and banana do not submit nor reveal the exact hectare and production as part of their company policies. Table 21 presents the details of the area and production of the major crops in three-year period, from 2002 to 2004','','','','','','South Cotabato','Region XII','Philippines',6.3357565,124.7740793),(344,0,5,3,'Area harvested for papaya steadily goes up for three consecutive years (2002-2004). The biggest increment is shown in 2003 where it displays an increase of around 17% as against the preceding years figure. Production on the other hand only divulge notable raise in 2003, where it soars to as high as 742.81% as against the prior years yield. But in 2004 it falls down by almost 17%.','','','','','','South Cotabato','Region XII','Philippines',6.3357565,124.7740793),(345,0,5,3,'In 2003 area planted to banana exhibits a 26.08% growth against previous year’s scope. But then during the subsequent year a reduction of 20% in its area is accounted. Meanwhile, production of this crop reveals unfavorable results in three years time, from 2002-2004. The unchanging trend during this period is much seen in 2004, where its production is down by almost 11% compared to 2003, while the latter’s production also fall short by 1.24% against its year-ago output.','','','','','','South Cotabato','Region XII','Philippines',6.3357565,124.7740793),(346,0,5,3,'Commercial crops particularly fruits still dominate the list of other crops planted in South Cotabato.','','','','','','South Cotabato','Region XII','Philippines',6.3357565,124.7740793),(347,0,5,3,'t is mango that displays good results in terms of average yieldhectare during the year (2004). Next to it is rambutan, then pomelo and watermelon.','','','','','','South Cotabato','Region XII','Philippines',6.3357565,124.7740793),(348,0,5,3,'On major vegetable crop, top five on the list in terms of area and production include camote, eggplant, cassava, tomato and cabbage. Vegetable like kangkong, squash fruit, gourd, ampalaya and ginger are considered the priority vegetable crops planted in the province in 2004.','','','','','','South Cotabato','Region XII','Philippines',6.3357565,124.7740793),(349,0,6,4,'Upon the arrival of the Spaniards in AD 1521 headed by the Portuguese Conquistador Ferdinand Magellan, with his chronicler “Pigafetta”, this southeastern part of Mindanao was called “Calaghan Island”. And according to the historian Combes, its etymology comes from the word “calag” which means “spirit or soul”;\n therefore, “Calaghan island” is an “island of spirited-men”. That’s why in the seventeenth century the whole territory of Caraga Province created in AD 1609, from the Cape of Surigao to the Cape of St. Agustine, Sigaboy, was called “regio de gente animosa”, that is, “region of spirited-men”. This courageous animosity was proven by the well known “Caraga Revolt”, a native Caragans’ uprising against the moro raids and the Spanish violent domination','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(350,0,6,4,'The people who lived in Calaghan were the Mandaya, Mansaka, Manubo, Mamanua, Mangguangan, Tagacaulo. They were called invariably as “caragans” or “calaghans”. At the turn of the centuries, the muslim counterparts of this side of the Mindanao mainland, maintain and applied it as an “exclusive name” to their muslim tribe;\n but such was an “inclusive name” of the tribes in the very beginning.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(351,0,6,4,'The missionaries from the 16th to the 19th centuries of the Philippine History, who were sent for mission to this island called “Caraga Province” in 1609 ranging from the Cape of Surigao to Cape St. Augustine of Sigaboy, were the prime movers of the creation of towns and villages under the governance of the “Incomienda system”. The first of these towns, later called as “municipalities” are: Caraga, Cateel, Baganga, Manay, Mati, Sigaboy. These municipalities were called the “centennial municipalities”.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(352,0,6,4,'That on February 27, 1849 in recognition to Don Juan Uyanguren’s successful conquest of Davao in 1846, the same Gov. Gen. Claveria decreed the partition of Caraga Province. The northern portion was named Surigao Province with Surigao town as its capital;\n the southern portion was named Nueva Guipozcoa (in honor of Gov. Claveria’s natal town in Spain) with Caraga town as its capital. Nueva Guipozcoa was later renamed “Davao”','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(353,0,6,4,'In August 31-Sept. 3, 1924 Caraga Convention, the municipal presidents of Caraga, Cateel, Baganga, Manay, and Mati approved a resolution petitioning the higher authorities concerned to declare Eastern Davao “the contracosta” as a sub-province to be called “Plaridel”. The petition was favorably endorsed but only remains a promise of administration.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(354,0,6,4,'In the year 1956, Congressman Ismael Veloso of Davao passed a bill in Congress creating Davao Province. He proposed the separation of the municipalities of Lianga, Hinatuan, Bislig, and Lingig from Surigao Province to be combined with the contracosta towns. Unfortunately, the bill failed the approval of the Senate. He then passed another bill dividing Davao into three provinces. The bill was approved in the Lower House but failed the Senate approval. Congressman Lorenzo Varmint revived the bill in 1965. This time, the bill finally passed the Lower House and the Senate with the help of Senator Alejandro Almendras. Then on July 1, 1967 the Republic Act No. 4867 brought about the birth of the PROVINCE OF DAVAO ORIENTAL.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(355,0,6,7,'Its geographic location follows the highly irregular southeastern coast of Mindanao facing the Pacific Ocean from Cateel Bay down to Cape San Agustin. The province is bounded by Agusan del Sur and the small river of Surigao del Sur on the north, by the Compostela Valley Province on the west and by the Davao Gulf and Celebes Sea on the South','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(356,0,6,7,'The capital town of Mati is 167 kilometers from Davao City in Davao del Sur and 112 kilometers from Tagum, in Davao del Norte. It has a total land area of 5,164.46 square kilometers, representing 16.21 percent of the total land area of Region XI. Among its municipalities, Baganga has the largest land area with 1, 177.10 square kilometers while San Isidro has the smallest land area with only 205.20 square kilometers.','','','','','Mati','Davao Oriental','Davao Region','Philippines',6.9437633,126.2467484),(357,0,6,7,'The eastern coast of the province is fringed with mountain ranges while the rest of the area has an uneven distribution of plateaus, swamps, and lowlands. Of the total land area of the province, about 493.68 kilometers are classified as lowlands;\n 235.90 square kilometers as uplands;\n 2, 263.48 square kilometers as hilly lands;\n and about 2, 154.35 as mountainous areas. The remaining 17.05 square kilometers covered by strength are covered by creeks, braided river beds, lakes, and quarries','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(358,0,6,7,'Of the 516,446 land area it has 200,846 hectares of Alienable and Disposable land or 39% of the total land area and 315,600 hectares of forestland representing 61% of its total land','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(359,0,6,7,'The province lies outside the typhoon belt. The province does not have a pronounced dry season although rainfall is at its maximum from November to January especially at the coastal towns. The province is not affected by tropical depressions or typhoons since it is outside typhoon belt and is protected by the mountain ranges along its coast.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(360,0,6,3,'Davao Oriental~s economy is agriculture-based. Its main agricultural products are coconut, rice, corn, banana, durian, mango, rootcropsvegetables, and abaca. The 250 hectare Menzi Plantation in Buso, Mati grows citrus, grapes, and mangoes.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(361,0,6,3,'All the major crops except corn, and abaca indicated decrease in output for the reported year. Palay Production showed a downward trend. For CY 2004, the average yield in production had dropped by .1 MT.Ha. Subsequently, the decrease affected the total Palay Production for the year. It was recorded to have reached to only 46,170.66 MT with Sufficiency Level of 70.5% as against the CY 2003 output of 46,495.61 MT having a Sufficiency Level of 72%','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(362,0,6,3,'The negative growth in Palay Production was due to high cost of farm inputs and insufficient supply of irrigation water. On-going NIA rehabilitation works in some municipalities had also caused the decrease in area planted for cultivation','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(363,0,6,3,'It’s worthy to note that while Palay Production had decreased, the total rice seed production area in CY 2004 was recorded at 1,997.20 hectares or an increased by 49% as compared to CY 2003 figure of 1,340.05 hectares only. The increasing national demand for certified and hybrid seed and the good market price encouraged the seed cooperative and seed companies to expand the area planted','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(364,0,6,3,'The Provincial Government through the Office of the Provincial Agriculturist continued to implement programs such as the Ginintuang Masaganang Ani (GMA) Program. For the reported year, the Government had given subsidy in terms of price, buy-one-take-one scheme for fertilizers (urea) and soil conditioner (biozome) Hybrid Rice Cultivators to farmer-beneficiaries and provision of technical briefing to 250 farmer-beneficiaries.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(365,0,6,3,'As always, the deficit in production on this crop was complemented by the intra-regional transfers especially those catered by the National Food Authority. A total of 196,174 bags of imported rice from Davao City and General Santos City were received in the reported year for distribution to areas where price of rice is high','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(366,0,6,3,'As of December 2004, the NFA’s stock inventory settled at 4,359 bags of rice. With the daily rice consumption requirement of 2,700 bags, a total inventory is good to last for 116 days. Thus, it helped stabilized the supply of rice for the 70% rice-eating population','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(367,0,6,3,'For Corn Production, the long dry spell which occurred in the second semester of CY 2004 had caused the Average Yield in Corn Production to decrease by .18 MTHa. as compared to the CY 2003 record of 2.94 MTHa. The attack of pests particularly corn borers also contributed to its decrease. Although the Office of the Provincial Agriculturist (OPAG) had stopped the production of Trichograma for distribution to farmers as pest control for corn bores, the production itself was not affected as it continues to surge in producing 72,352.43 MT in CY 2004 as compared to CY 2003 with only 70,815.56 MT','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(368,0,6,3,'The Coconut Industry is a dominant sub-sector in Agriculture. Of the total land area of 516,446 has. of the province, 30% or 154,454 has. is devoted to coconut.  Per record, 113,067 of the total 446,191 population or 25.34% are farmers who are directly and indirectly dependent on Coconut Industry','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(369,0,6,3,'Performance in fiber industry (abaca) soared as much as 44%, which placed Davao Oriental as the 4th among the ten (10) abaca-producing provinces in the country producing about 7,169.92 MT in CY 2004 higher than that of CY 2003 with only 6,190.44 MT. The Municipality of Manay still ranked Number 1 in the province in terms of area and production contributing about 42.23% share of the total provincial output. The bulk of production in abaca fiber form went to Southern Leyte','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(370,0,6,3,'The upswing in fishery production indicated a 5.7% increase in output for the reported year. The 5.2% increase in Marine Municipal Fishery contributed to the sub-sector’s continuing growth in CY 2004 of 42,606.92 MT as compared to CY 2003 with only 40,325.21 MT. An increase in Commercial Fishing and Aquaculture production was also noted','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(371,0,6,3,'The livestock sub-sector had performed well in CY 2004 as shown by the uptrend in production in all the components in the reported year as against that of CY 2003 performance.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(372,0,6,3,'Cattle or beef production demand is already sufficient at a level of 127.21% for the 85% beef-eating population of the province taking into consideration that all beef-eaters can afford to buy a cow’s meat. The increase in Sufficiency Level for beef is due to the increase in cattle population thru the Dispersal Program of FAITH. Carabeef supply in the province is still sufficient at 148.95% for the reported year','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(373,0,6,3,'In pork production, there is a slight decrease in its Sufficiency Level with 150.71% in CY 2003 down to 148.95% in CY 2004. But still, the decrease did not affect the supply as it is more than enough for human consumption','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(374,0,6,3,'The production on Goat (Chevon), Sheep (Mutton) and Duck (Meat) is still not sufficient for human consumption. Although production increased every year, yet the same is not meeting the demand for these meats. The production of these kinds of livestock is not yet fully developed in the province thus, the very low meat production','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(375,0,6,3,'For CY 2004, there were a total of 223.60 hectares inventoried resources from legitimate log supplier to determine the value of wood materials. Four (4) wood processing plants located province wide were evaluated as to the true-rated capacities of each plant.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(376,0,6,3,'The Agency strengthened the Multi-Sectoral Forest Protection Committee (MSFPC) at all levels for the protection of remaining forest cover. Under this sub-sector, the agency was able to conduct ground surveillance in identifying hotspots and critical areas. Twenty Six (26) hotspots were identified where illegal logging activities took place. The DENR thru its CENROs was able to protect and patrol 196,100 hectares of which 86 hectares were destroyed as a result of kaingin activities and due to the dry season','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(377,0,6,3,'Pursuant to Executive Order No. 263 series of 1995, all people-oriented programs had been integrated and unified in the belief that an efficient and sustained management of forest lands and coastal areas would only yield from responsible resource utilization by organized and empowered local communities. The issuance has been proven to be effective and each year CBFM areas were identified.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(378,0,6,3,'Actual area of forest plantations were inventoried and mapped for the reported period. A total of 25,915 hectares were identified as forest plantation sub-divided into two: 4,455 hectares were identified as within the Protection Forest and 21,460 hectares as Production Forest. The agency was able to accomplish 106% as against their target of only 24,520 has. to be surveyed and mapped for CY 2004','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(379,0,6,3,'In Davao Oriental, investments were generated by allied industries to include coconut, mango, banana and wood. For CY 2004, total investment infused was P1.024B, which was 159% higher as against the CY 2003 output with only P0.609B./','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(380,0,6,6,'The number of barangays energized in the province increased from 168 in 2003 to 174 in 2004. This resulted to a 3% increase in the energy coverage from 92%  in 2003 to 95% in 2004. Of the 183 barangays in the province, only nine (9) barangays remained not yet served with electricity but are provided with the services of power generators and other alternative sources of power like the solar power thru the Department of Energy','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(381,0,6,6,'Various mineral resources abound the province, both metallic and non-metallic. It has rich deposits of manganese ore, gold, and chromite for metallic. The most abundant resource is magnesite with an estimate reserved of 83,212,000 MT for non-metallic.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(382,0,6,6,'The province is richly endowed with navigable rivers, which are potential source of water supply and irrigation development projects. As of CY 2004, the total service level coverage of water had reached to 68% or 58,518 households out of the total registered household of 86,569 as compared to that of CY 2003 which was recorded at 66% service level coverage.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(383,0,6,6,'For the year under review, the agency was able to plant trees in about 17 hectare watershed areas in Sumlog River specifically in Barangay Calapagan, Lupon, this province in the amount of P236,000.00 coming from PENRO and CENRO Lupon.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(384,0,6,6,'The Province has a total road network of 1,904.62 kms. It has one airport with a concrete runway of 1,600 meters long that can accommodate both light jet and cargo planes. A total of 7 sea ports, two municipal ports, the Mati Wharf and the Baganga Feeder Port and the rest are privately owned were established.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(385,0,6,6,'All municipalities through out the province have a main post office to handle all mails and other postal services. In Mati, private cargo and mails forwarding services are also available./','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(386,0,6,4,'Davao Oriental has several tourist spots, mostly natural attractions that include hot springs, islands, beaches, lakes and waterfalls. The Mati Provincial Capitol is on a hill that overlooks the town and Pujada Bay. Pujada Island, one hour by pumpboat from Mati, is surrounded by white and beaches and is ideal for scuba diving','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(387,0,6,3,'The total realized income of the province for year 2004 amounted to P400,791,187.39 only compared to CY 2003 income of P405,218,051.03. The shortfall of P4,426,863.64 or 1.09 % was due to the following reasons : a.) The receipt of FY 2001Local Government Service Equalization Fund (LGSEF), as well as the Sale on Assets (JunkUnserviceable Equipment) both in FY 2003, were non recurring income such that same were not expected to be collected in FY 2004;\n b) a marked decrease in collection for Sand and Gravel Taxes of about 44.25% compared to that of FY 2003 collection of P124,952.06 due to lesser number of on-going Infrastructure Projects;\n c) the decrease in collection of Amusement Tax by 13% from FY 2003 collection of P 43,066.50, since Gallera de Madang was the only main source for this type of tax. In general the shortfall in the income was due to the economic crisis prevailing nationwide','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(388,0,6,3,'The revenue collection for registration, licensing and law enforcement by the Land Transportation Office (LTO) amounted to Nine Million Four Hundred Twenty Two Thousand Three Hundred Eighteen Pesos and 65100 (P9,422,318.65) compared to last year’s collection of Seven Million Nine Hundred Thirteen Thousand Nine Hundred Nine Pesos & 05100 (P 7,913,909.05) or an increment of One Million Five Hundred Eight Thousand Four Hundred Nine Pesos & 60100 (P1,508,409.6) or 19.06%. The increase in realized revenue was attributed to the 5.94% increase in the number of registered vehicles thru the registration fees and the intensified law enforcement operations against traffic violators. These collections are remitted to the Bureau of Treasury','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(389,0,6,3,'On real property assessment, the Provincial Assessor’s Office reported an increase of 1,060 or about 1.19% in terms of the number of the assessed taxable Real Property Units (RPU) from 89,138 units in CY 2003 to 90,198 units in CY 2004 that also resulted to the increase in taxable assessed value by P205,877,150.00 equivalent to 6.61% from P 3,114,691,460.00 in CY 2003 to P3,320,568,610 in CY 2004','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(390,0,6,3,'For CY 2004, the Register of Deeds - Provincial Office reported an increase in collection on registration fees of P 917,873.02 or 37.36% from P2,457,087.69 in FY 2003 to P3,374,954.71 in FY 2004. The increase in collection was due to the increase in newly issued Land Titles, increase in Real Estate Transaction and increase in the Registration of Chattel Mortgages to include personal properties.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(391,0,6,3,'The Bureau of Customs-Provincial Office reported a total realized revenue for CY 2004 of Four Million One Hundred Three Thousand Five Hundred Sixty Four Pesos (P 4,103,564.00) with a shortfall of P 1,896,435 or 31.61% based on its target for the reported year and a huge reduction as compared to its CY 2003 revenue of P 16,643,704.00. The P12,540,140 .00 or 75.31% decrease in its collection for CY 2004 was due to the slowdown in the importation of logs of Baganga Playwood Corporation which was noted to be the only importer in Mati Port. Another factor was the reduction of the rate of custom duties which used to be 7% for CY 2003 as against 3% for CY 2004.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(392,0,6,4,'The province has a projected population of 485, 346 inhabitants, a population density of 94 personsq. km., total number of household at 80, 676 and an average size of families at 5.3 as of 2005','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(393,0,6,4,'The pre-Spanish era of Davao Oriental, that is before 1521, was marked by a very primitive way of life, worship, culture, customs and traditions. Davao Oriental was populated by the lumads (indigenous people) since time past before the coming of the Asian Muslims and the Spanish Christians. On the later part, Davao Oriental was populated by mostly Visayan migrants, brought forth by the Spanish missionaries from the Visayas region who gradually intermarried with the local ethnic tribe, the Mandaya of which tribe is concentrated mostly in the whole east coast of Mindanao particularly the whole Davao Oriental. Cebuano and Pilipino are the pre-dominant languages of trade, instruction and communication although the indigenous languages are also widely spoken.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(394,0,6,4,'Almost 90% of the population of Davao Oriental are Roman Catholic that traced back to the Spanish Colonial Period particularly in the 19th century when the Spanish missionaries brought the Visayan tribe to Davao Oriental and intermarried with the Mandayas. This Visayan tribe were practically forced to learned the religion. Fear of punishment by the religious authorities forced the people to learn. The religion has now become a way of life of the people','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(395,0,6,4,'As of CY 2004, the entire division has 9 school districts in District I and 10 schools districts in District II with a combined 304 public elementary schools and 42 public secondary schools including annexes and 16 private schools. The performance indicator of the public elementary and secondary schools registered a better performance through the use of the latest technologies adopted in the new method of teachings.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(396,0,6,4,'In SY 2003-2004, it can be noted that Davao Oriental State College of Science and Technology (DOSCST) had experienced a decrease in the number of graduates from 336 in SY 2002-2003 to only 273 in SY 2003-2004 in different courses categorized into: 2 courses from Graduate Program, 15 from the Degree Programs and 5 from Non-Degree Programs. The decline in the number of graduates can be attributed to the phasing-out of 2 non-Degree Programs','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(397,0,6,4,'Of the total population of 485, 873, there are only 306, 478 belonging to the labor force or a labor force participation rate of 63%. 283, 193 of the working population are employed and 23, 285 are unemployed or an unemployment rate of 7.6%','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(398,0,6,4,'TESDA’s commitment for CY 2004 included mobilizing major TVET stakeholders as well as providers. This included the provincial government, two (2) political districts, and eleven (11) municipalities for the conduct of community-based training programs','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(399,0,6,4,'Of the ten leading causes of mortality for the reported year, Pneumonia still ranked number one followed by Cerebro Vascular Diseases;\n Hypertensive Diseases;\n Cancer of all forms;\n Assault;\n PTB;\n Ischemic Heart Disease;\n Congestive Heart Failure;\n Disease of arteries, arterioles and capillaries and Peptic Ulcer Disease','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(400,0,6,4,'As frontline in the delivery of health services, the Davao Oriental Provincial Hospital together with the other four (4) government-run hospitals in the province contributed a lot in providing preventive and curative measures especially to remote areas. To ensure a healthy community, the Provincial Government continuously support this sub-sector of which in CY 2004, the government-owned hospitals had been given an appropriation in the amount of P11,815,933.00 sourced-out from the Local Government Development Fund for its operation apart from the budget under the General Fund which is P63,854,485.00 or a total of P75,670,418.00 for the whole year operation. This fund however, is still not sufficient to meet the needs of the growing population of the province. Being government-run facilities, people tend to seek medical assistance in the five hospitals in the province and the Provincial Government had to cope with the increasing demand for health services. On top of the local fund provided for the operation of the hospitals, funds from the PCSO and from DOH Field Office XI had been released for the operation of the hospitals','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(401,0,6,4,'The height and weight measurement of the child are factors to be considered on nutritional status. With the recommendation of the Department of Health as well as the Department of Nutrition for Health and Development (DNHD) of the World Health Organization (WHO) and the United Nations International Children’s Fund (UNICEF) Philippines, it was decided that International Reference Standard (IRS) be adopted for use in the Philippines nationwide.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(402,0,6,4,'The percentage of Fully Immunized Children (FIC) had drastically gone down from 76% in CY 2003 to 69% in CY 2004. The factors affecting the reduction were the lack of manpower like Rural Health Midwives to cover immunization activities in far-flung barangays;\n delayed arrival of vaccines (OPV and DPT) and supplies needed for the program. The percentage of Fully Immunized Mothers (FIM) on the other hand, increased from  75% to 92% in the reported year','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(403,0,6,4,'One of the factors affecting environmental sanitation is the presenceabsence of household sanitary toilets. The Barangay Waterworks and Sanitation Association gave emphasis on the construction and utilization of sanitary toilets which led to an increase of 3 percent from 60,410 households for CY 2003 to 62,284 households for CY 2004./','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(404,0,6,4,'Prenatal consultation of all pregnant women especially during the first trimester is one of the activities in this program for the purpose of early identification of high risk pregnancies so that prompt and proper management will be instituted.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(405,0,6,4,'The Philippine Measles Elimination Campaign (PMEC) was conducted last February 2004 as a strategy to increase immunization coverage of children 9 – 11 months old in all barangays as part of a nationwide campaign. Davao Oriental’s accomplishment was 99 percent with Baganga garnering the highest with 117% while San Isidro got the lowest accomplishment of 79 percent.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(406,0,6,4,'The Provincial Health Office had conducted series of training for LCE, Suppliers and Retailers including health personnel regarding the RA 8976 known as Food Fortification Program. Its goal is to increase the dietary intakes of Vitamin C, Iron and Iodine equivalent to 50% of Recommended Dietary Allowance (RDA) contributed by fortified food. The Municipalities of Banaybanay, Lupon and Mati are the three pilot municipalities of this program','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(407,0,6,4,'In order to address the problem on lack of decent shelter for the underprivileged sector, the Provincial Task Force for Socialized Housing through the initiative of the Provincial Governor awarded for CY 2004 the 5.7 hectares to 200 beneficiaries residing at Sitio Cebuley, Pahamotang. The lots were sold at one hundred pesos per square meter payable within a period of five (5) years','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(408,0,6,1,'Davao Oriental is one of the provinces created from the Province of Davao under the Republic Act No. 4867 on May 8, 1967. The anniversary of its separation from the mother province is celebrated on July first','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(409,0,6,1,'GOVERNOR- the provincial governor is the head of the Provincial Government elected by the direct vote of the people for a term of four years. Under the existing law, the governor could only be elected to three consecutive terms. His power includes: Power of Appointment- all subordinate officers and the provincial governor hires employees in the various branches of the government whose salaries are paid from the government funds. Subject to certain limitations;\n Power Removal-the governor has the absolute power to remove employees who are not civil service eligible within his office but not in other provincial offices where the head of the office is the sole authority. Power of Supervision- being the chief executive of the province, the governor exercises general supervision over the provincial government, municipalities and other subdivisions. The governor sees to it that laws are properly being implemented and executed by all officers. In line with this, he is required by law to conduct periodic visits to all municipalities and municipal districts. Advise local administrations in the performance of their duties and receive complaints regarding the conduct of local ordinances. BudgetaryPower- the governor participates in the determination of provincial budget, he being the member of the provincial board, he also shares in the processing solutions on the subject within the competence of the board.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(410,0,6,1,'The municipal courts and the justice of the peace are presided over by a single judge. They have jurisdiction of civil cases that are not original. Appeals therefore are made to any of the courts of first instance found within the judicial districts.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(411,0,6,1,'The National Government exercises general control and supervision over the Provincial Government. In addition, has the power to appoint officials to key non-elected provincial positions. The national legislative is amply represented by the Congressman of each district of the province. Decisions by the National Government take precedence over those of the provincial government. However, in some cases the local authorities are being consulted before any decisions has to be made','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(412,0,6,1,'The National Internal Strategic Plan is a strategic plan of the national government which was formulated designed to fight insurgency and lawless elements and to respond to calamities through the creation of National Peace and Order Council;\n Provincial Peace and Order Council in the provincial level, to fight insurgency and criminalities, and the National Disaster Coordinating Council;\n Provincial Disaster Coordinating Council in the provincial level to respond to calamities. This will be attained through the cooperation and concerted effort of the Local Government Units, Local Government Agencies, Philippine National Police, and the Armed Forces of the Philippines. This was made possible through the establishment of Area Coordinating Centers in each area where linkaging, networking, and coordinating are made by the concerned agencies.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(413,0,6,1,'Davao Oriental has 499 PNP personnel maintaining 75 police visibilities scattered throughout the province and it is complemented by the Civilian Volunteers Organization (CVO) and The Civil Security Unit (CSU) maintained by the Provincial Government. Also present in the area is two (2) Infantry Battalions of 10th Infantry (Agila) Division complemented by several CAA detachments.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(414,0,6,1,'Almost all the major political parties in the country are well represented in Davao Oriental. However, the province is dominated by the NPC to which the provincial chief executive belongs. It is followed by the LAKAS CMD, KAMPI, PDSP and few belong to LDP and few elected officials are independent.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(415,0,6,1,'The NPC is the dominant and the ruling political party in the province with the LAKAS CMD comprising the opposition. The latter has also formed coalition with KAMPI. Despite that the Governor belongs to a different political party, the blessings from the national government is being felt in the province because the governor has maintained close relationship with the president','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(416,0,6,1,'The recently concluded May 2007 national and local election, as monitored by the Department, registered a turn-out of 78% higher than in 2004 with only 77%. The holding of the election every three years is in accordance with the Local Government Code in conformity with the Philippine Constitution','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(417,0,6,2,'The AFP Forces operating in Davao Oriental is the 67th Infantry (Agila) Battalion the headquarters is located at Baganga, and the 28 Infantry (Kamagong) Battalion stationed in Brgy Corporacion, Lupon, both in Davao Oriental. The two (2) infantry battalions is under the operational control of the 1001st Infantry (Pag-asa) Brigade, 10TH Infantry (Agila) Division stationed at So Quarry, Bry Mapaang, Maco, CVP. The 67IB covers the municipality of Boston, Cateel, Caraga, Tarragona and Manay. While 28th Infantry ( Kamagong ) Battalion covers the municipality of Lupon, Gov. Generoso, San Isidro, Mati and Banay-banay all of DOR','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(418,0,6,2,'The PNP Forces in the area is the Provincial Police Office (PPO) located at Brgy Dahican, Mati, DOR with respective PNP headquarters in every municipality and several outposts located at strategic areas in the AOR.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(419,0,6,2,'CPPNPANDF remains to be the most active threat in the province. The brigade is presently confronting the GF 15, GF 18, GF 20, PBC 5 and PBC 3 all of the Southern Mindanao Regional Committee (SMRC) with a total strength of 178 members and 124 assorted firearms.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(420,0,6,2,'The CT’s operating in the area got their source of funds from their extortion activities in the form of revolutionary taxation. Their logisticalfinancial source comes from their monthly collection from the sari-sari stores, grocery stores, illegal loggers, jeepneys, buses, and motorcycles “Habal-habal” plying in their controlled areas','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(421,0,6,2,'The enemy in the area will continue to create atrocities to embarrass the government and sow terror among the populace in the area. The decrease in strength and firearms of the Communist Terrorist for the first quarter of 2009 is insignificant. The number of affected brgys remains the same pending the area evaluation of the current SOT operations . They(CTs) still continue their IPO works to implement the expansion of areas. They are using agitation and propaganda to lure the masses to rise up in arms against the government.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(422,0,6,2,'The 111th Base Command, Eastern Mindanao Command, BIAF, MILF (Former 107th Base Command, 1st Field Division) is based at Brgy Nanapan, Pantukan, Compostela Valley Province (Camp 1) and its satellite camp at Brgy Mapanga, Tarragona, Davao Oriental (Camp 2) which operates in the whole province of Davao Oriental. It has a total strength of 271 fighters with 73 firearms.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(423,0,6,2,'The total crime volume recorded for the year 2009 reached to 350. This is higher by 15 compared to CY 2008 with only 335. Of the 350 crimes, 148 are classified as index crimes and 211 non-index crimes. The annual crime rate per 100T population is computed at 6.42 which is higher by 0.51 percentage points compared to 5.91 in CY 2008','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(424,0,6,2,'OPLAN “BIG BERTA” (Campaign against illegal drugs). Equipped with Search Warrant, a joint operation composed of Davao Oriental CIDT, PDEA, Philippines National Police (PNP) and the 72nd IB, Philippine Army raided a marijuana plantation in Caraga. Fully grown marijuana plants and dried marijuana leaves were seized.   In coordination with the PDEA, a buy-bust operation was conducted in Mati. The suspect was arrested where one sachet of shabu and dried marijuana leaves were confiscated.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(425,0,6,2,'OPLAN “ROULETTE” (Campaign against illegal gambling). Three suspects engaged in illegal numbers game were apprehended and arrested for violation of RA 9287. The cases were filed at the Municipal Trial Court.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(426,0,6,2,'OPLAN ‘KALIKASAN”. (Campaign against unlawful destruction of natural resources). In coordination with the Department of Environment and Natural Resources (DENR), a truck loaded with suspected illegally cut logs valued at Php 60,000.00 was apprehended. The truck and the seized forest products were placed under the custody of the DENR for appropriate action','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(427,0,6,2,'OPLAN “PAGTUTUGIS” (Campaign against wanted persons). Equipped with Warrants of Arrest , the Davao Oriental CIDT arrested forty-five persons for various offenses committed, to with','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(428,0,7,7,'Sarangani Province is composed of one (1) landlocked and six (6) coastal towns is found in the Southern tip of Mindanao.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(429,0,7,7,'Sarangani was named Sarangani for being close to Sarangani bay.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(430,0,7,4,'The Sarangani Province’s earliest known inhabitants were Maguindaoan, B’laan, T’boli and ethnic tribes in uplands.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(431,0,7,4,'Christian migration from the Visayas and Luzon islands in the 1900s opened its vast fertile lands to agriculture/','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(432,0,7,4,'The first migrants were Cebuanos who arrived in Glan in 1914, turning the vast cogonal terrain into farms with “corn stalks as big as children’s legs and ears as big as banana blossoms”.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(433,0,7,4,'Ilocano settlers set up homesteads in Kiamba in 1918. “Good news” about the Land of Promise triggered a wave of Christian migration in the 1920s.','','','','','Kiamba','Sarangani','Region XII','Philippines',6.0233926,124.6414028),(434,0,7,4,'Ilonggo settlers arrived in Malungon in the 1930s.','','','','','Malungon','Sarangani','Region XII','Philippines',6.3343032,125.2587964),(435,0,7,4,'In 1991, an archaeological find (human faces and figures in earthenware medium) in barangay Pinol, Maitum yielded hundreds of anthropomorphic potteries associated to the Metal Age in the Philippines circa 500 B.C. to A.D. 500. Although the findings of its age are still not conclusive, a National Museum curator has found out that “our Southeast Asian neighbors have nothing of this type of archaeological finds”.','','','','','Maitum','Sarangani','Region XII','Philippines',6.1240807,124.4863586),(436,0,7,4,'Another important historical landmark, the Tampat Shrine in Maasim, enshrines the tomb of revered earliest Muslim missionaries who arrived in the 15th century.','','','','','Maasim','Sarangani','Region XII','Philippines',5.9267175,124.994751),(437,0,7,4,'Sarangani Province was carved out from South Cotabato by initiative of Rep. James L Chiongbian through Republic Act 7228. This landmark legislation spurred unprecedented development in the former third district of South Cotabato, making the new province a key player in the emerging SOSKSARGEN (South Cotabato, Sultan Kudarat, Sarangani, General Santos City) growth area.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(438,0,7,3,'Upon its creation, Sarangani received massive funding support for infrastructure development never before enjoyed by its constituents.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(439,0,7,6,'A paved national highway connects all towns through General Santos City today.','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1043159,125.150972),(440,0,7,6,'The Capitol Building and other edifices within Sarangani Capitol Park now serve as the landmark of the province’s fast-tracked development.','','','','','Alabel','Sarangani','Region XII','Philippines',6.1011591,125.271982),(441,0,7,7,'Furthermore, Sarangani is directly facing Indonesia and other neighboring East ASEAN countries making it the gateway to BIMP-EAGA (Brunei Darussalam, Indonesia, Malaysia and the Philippines-East ASEAN Growth Area).','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(442,0,7,7,'Sarangani serves as the country’s backdoor to international linkage. Because of its strategic geographical location, the Province, as part of the SOCSKSAGEN Growth Area, has great potential for industry complementation and cultural ties with its proximate neighbor countries.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(443,0,7,3,'Sarangani serves as the country’s backdoor to international linkage. Because of its strategic geographical location, the Province, as part of the SOCSKSAGEN Growth Area, has great potential for industry complementation and cultural ties with its proximate neighbor countries.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(444,0,7,7,'The terrain of Sarangani Province is characterized by flatlands, rolling hills and mountains.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(445,0,7,7,'Wide stretches of fertile flatlands are found along the coastal areas of Alabel.','','','','','Alabel','Sarangani','Region XII','Philippines',6.1850325,125.3466253),(446,0,7,7,'Wide stretches of fertile flatlands are found along the coastal areas of Malapatan','','','','','Malapatan','Sarangani','Region XII','Philippines',5.9663386,125.2853778),(447,0,7,7,'Wide stretches of fertile flatlands are found along the coastal areas of Glan','','','','','Glan','Sarangani','Region XII','Philippines',5.7600383,125.3466253),(448,0,7,7,'Wide stretches of fertile flatlands are found along the coastal areas of Maasim','','','','','Maasim','Sarangani','Region XII','Philippines',5.9267175,124.994751),(449,0,7,7,'Wide stretches of fertile flatlands are found along the coastal areas of Kiamba','','','','','Kiamba','Sarangani','Region XII','Philippines',6.0233926,124.6414028),(450,0,7,7,'Wide stretches of fertile flatlands are found along the coastal areas of Maitum','','','','','Maitum','Sarangani','Region XII','Philippines',6.1240808,124.4863567),(451,0,7,7,'Rolling hills and mountains dominate the landscape of Malungon as well as the eastern and southern portions of the provinces of Davao del Sur and South Cotabato respectively.','','','','','Malungon','Sarangani','Region XII','Philippines',6.3343032,125.2587964),(452,0,7,7,'Mountain ranges with great elevation also exist within Sarangani.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(453,0,7,7,'The landscape of Sarangani is traversed by numerous rivers and creeks which directly flow towards Sarangani Bay.','','','','','','','','Philippines',5.9656144,125.1928634),(454,0,7,7,'Sarangani~s Major Rivers include Buayan River (the largest).','','','','','General Santos','Sarangani','Region XII','Philippines',6.1309342,125.2366514),(455,0,7,7,'Sarangani~s Major Rivers include Maribulan River.','','','','','Alabel','Sarangani','Region XII','Philippines',6.1174482,125.2500427),(456,0,7,7,'Sarangani~s Major Rivers include Lun Padidu River.','','','','','Malita','Davao del Sur','Davao Region','Philippines',6.152922,125.5431819),(457,0,7,7,'Sarangani~s Major Rivers include Lun Masla River.','','','','','Malapatan','Sarangani','Region XII','Philippines',6.0748496,125.5105577),(458,0,7,7,'Sarangani~s Major Rivers include Glan River.','','','','','Glan','Sarangani','Region XII','Philippines',5.819216,125.2327236),(459,0,7,7,'Sarangani~s Major Rivers include Pangi River.','','','','','','Sarangani','Region XII','Philippines',6.0629234,124.5623016),(460,0,7,7,'Sarangani~s Major Rivers include Kalaong River.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(461,0,7,7,'Sarangani is a typhoon-free province. Its climate belongs to Type IV of the country’s climate classification. This type is characterized by a rainfall that is more or less evenly distributed throughout the year. Heavy rainfall occurs during the months of June to August.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(462,0,7,7,'The hottest month is April where the maximum temperature reached its highest at 33.7o C, while the coldest month is January which registered at 21.5o C, the lowest. Prevailing wind direction blows towards North to Northeast','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(463,0,7,3,'Sarangani is a vast agri-producing province. Its economy is mainly dependent on agriculture Dominant crops grown by farmers include coconut, corn, rice, and banana.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(464,0,7,3,'The principal crops planted include coconut, sugarcane, banana, corn, rice, asparagus and mango. Other cops grown were coffee, rubber, root crops, legumes, vegetables and fruits. Rice and corn are among the province’s most important food crops.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(465,0,7,3,'Based on 2000 DTI data, there are forty three (43) registered existing agricultural enterprises in Sarangani Province. These agricultural enterprises are lead industries . Major products include corn, rice, banana and cattle.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(466,0,7,3,'Malungon is the corn and banana-producing municipality','','','','','Malungon','Sarangani','Region XII','Philippines',6.3343032,125.2587964),(467,0,7,3,'Kiamba is a rice-producing municipality','','','','','Kiamba','Sarangani','Region XII','Philippines',6.0233926,124.6414028),(468,0,7,3,'Maitum is a rice-producing municipality','','','','','Maitum','Sarangani','Region XII','Philippines',6.1240808,124.4863567),(469,0,7,3,'Maasim is a cattle-producing municipality.','','','','','Maasim','Sarangani','Region XII','Philippines',5.9267175,124.994751),(470,0,7,3,'Alabel is a cattle-producing municipality.','','','','','Alabel','Sarangani','Region XII','Philippines',6.1850325,125.3466253),(471,0,7,3,'Malapatan is a cattle-producing municipality','','','','','Malapatan','Sarangani','Region XII','Philippines',5.9663386,125.2853778),(472,0,7,3,'There are fourteen (14) registered fishery enterprises in Sarangani Province. These enterprises are engaged in prawn farming, milkfish and tilapia production, and deep sea fishing.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(473,0,7,3,' Five (5) of the registered fishery enterprises in Sarangani belong to large-enterprise category. Alsons Aqua, SACI Aqua, Eastern Aqua are inland fishery operators;\n while RD Fishing, and San Andres are both inland and offshore fishing operators. The other nine (9) registered fishery enterprises belong to micro and small enterprise categories.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(474,0,7,3,'Most of Sarangani~s fishery industry are prawn growers who shifted production to tilapia and mudfish due to technical problems in production and the deterioration of prices in the world prawn market.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(475,0,7,3,'The large fishery enterprises produce and sell to both foreign and domestic markets while the rest are producing for markets only.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(476,0,7,3,'Under the cottage/small scale industry category, Agriculture, Fishery and Forestry Is the number one (1) revenue generating activity in the Province in terms of capitalization and also in terms of employment generated. This industry group accounts for about 55% of the investment revenue of the province. This is followed by Wholesale and Retail Trade, then Financing Insurance and Real Estate.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(477,0,7,3,'The trading and vending activities of the province are done in the municipality. Businessmen usually transact business in the public market which becomes the center of trade, commerce and industry in every municipality or (BCD) business center district. It is also in this place where exchanges of goods and services take place before shipment to market for further processing.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(478,0,7,6,'In 2001, a total of 58,09 million was allocated for 172 public construction projects, involving construction, rehabilitation, improvement, renovation and completion of public buildings, social infrastructure, roads and bridges, water systems and other public construction.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(479,0,7,6,'The road network of Sarangani was classified into four categories based on administrative responsibility, namely: Nation Roads (arterial roads), Provincial Roads (secondary roads), Municipal Roads (generally urban) and Barangay Roads.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(480,0,7,6,'The General Santos City Alternate Airport serves as a jump-off point to the adjoining Province of Sarangani. The airport facilities include a 3,200 meter x 45 meter runway, 2 taxiways, 1 apron, a state of the art terminal building, flight and emergency service stations, hangar, and fueling station, cargo handling equipment, and cold storage, aerodrome control tower, fire and rescue station and medical/PNP station. Philippine Air Lines and Air Philippines are servicing the passenger needs of the area. Direct flights to and from Manila and Cebu are available daily.','','','','','General Santos','South Cotabato','Region XII','Philippines',6.0558176,125.097993),(481,0,7,4,'Between the census years 1990 and 2000, Sarangani’s population grew by 3.78 percent, which is higher than Region XI’s growth of 2.62 percent, making the province the region’s fastest growing area. The provincial growth rate is 1.2 percentage points higher that the average annual growth rate recorded over the period 1980-1990.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(482,0,7,4,'Among the municipalities, Malungon posted the largest population growth with 4.86 percent','','','','','Malungon','Sarangani','Region XII','Philippines',6.3343032,125.2587964),(483,0,7,4,'Kiamba~s population grew by 2.36% between 1990-2000','','','','','Kiamba','Sarangani','Region XII','Philippines',6.0233926,124.6414028),(484,0,7,4,'The main health centers or rural health units are the basic peripheral units dispersed in every municipality together with their satellite barangay health stations. Its manpower complement consists of a doctor, nurse, dentist, dental aide, midwife and sanitary inspector. The 7 main health centers in the province, one (1) in each municipality, have an average facility-population ration of 1:59,368. Such ratio is twice more than the national standard of 1:20,000','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(485,0,7,4,'A barangay health station, on the other hand, is manned by a rural health midwife. The province has 58 barangay health stations reflecting a ratio of 1:7,156. This is far behind the standard of 1:5,000','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(486,0,7,4,'Maitum~s barangay health stations have almost reached the ratio of 1:5,000','','','','','Maitum','Sarangani','Region XII','Philippines',6.1240808,124.4863567),(487,0,7,4,'Maasim~s barangay health stations have almost reached the ratio of 1:5,000','','','','','Maasim','Sarangani','Region XII','Philippines',5.9267175,124.994751),(488,0,7,4,'Malapatan~s barangay health stations have almost reached the ration of 1:5,000','','','','','Malapatan','Sarangani','Region XII','Philippines',5.9663386,125.2853778),(489,0,7,4,'Specialized services provided by the rural health units/main health centers and barangay health stations/centers are the following: health education, control of endemic diseases, immunization, maternal/child health and family planning, nutrition, prescritpiton for common diseases and supply of essential drugs. Primary hospital also provides services like health education, immunization, maternal/child health and family planning, nutrition and supply of essential drugs. Moreover, it renders services like minor surgery an simple laboratory examination.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(490,0,7,4,'The total fertility rate (TFR) represents the number of children that would be born alive to a woman during her lifetime if she were to pass through her childbearing years (15-49) conforming to the age-specific fertility rates.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(491,0,7,4,'Predominant causes of deaths in the province are preventable diseases. Data show that there is an increasing incidence of degenerative diseases like pneumonia;\n tuberculosis and diarrhea have also ranked among the leading causes of death.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(492,0,7,4,'Infant Mortality Rate (IMR) represents the number of deaths of children below one (1) year of age per 1,000 live births. Nevertheless, health facility and registration reports shows that the total infant deaths have been declining over the years from 52 infant deaths in 1995 to 38 in 1999.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(493,0,7,4,'Since 1994, pneumonia has been the lading cause for infant deaths;\n followed by neo-natal death, pre-maturity, congenital defect and neonatal sepsis.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(494,0,7,4,'A very good indicator of the health status sin the province is the maternal mortality rate (MMR). This rate represents the number of mothers who died as a result of childbirth. During the period 1994 to 1998, placenta retention and hemorrhage have been the leading causes of maternal deaths, followed by toxemia. However, amniotic and rapture of the uterus have added as major causes of maternal deaths in 1999.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(495,0,7,4,'Although decreasing in the past six years, communicable diseases are still the predominant causes of morbidity in the province. Among the leading causes were infectious diseases and nutritional deficiencies. Cough and colds top the leading causes of illness;\n followed by diarrhea, pneumonia, influenza, bronchitis etc. However, these diseases can be prevented and controlled by public health measures such as better environmental sanitation, good nutrition and better health practices.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(496,0,7,4,'The prevalence of communicable diseases is also high among under-five children: respiratory tract infection with 4,960 cases, pneumonia with 4,934 cases and diarrhea with 33,72 cases. These cases are all preventable. However, statistics show that the conditions are not improving well despite of the interventions made. Perhaps, it is helpful to conduct a vivid review of the cases to further investigate the root causes.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(497,0,7,4,'There were 24 reported live births with unknown birth weight due to absence of weighing scale. These infants were only weighed after several days when mothers have the post natal check-up at the health center. Some of these infants with unknown birth may have been attended by untrained and/or illiterate hilots.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(498,0,7,4,'Majority (61.46%) of Sarangani’s total household population belong to the Roman Catholic Church.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(499,0,7,4,'A relatively large proportion of Islam followers are found in Maitum.','','','','','Maitum','Sarangani','Region XII','Philippines',6.1240808,124.4863567),(500,0,7,4,'A relatively large proportion of Islam followers are found in Malapatan','','','','','Malapatan','Sarangani','Region XII','Philippines',5.9663386,125.2853778),(501,0,7,4,'The other religious groups to which the rest of the populace of Sarangani belong are all Christian denominations, such as the following: UCCP, other Protestant sects, Alliance of Bible Christian Committees, other Evangelical churches, Iglesia ni Cristo, Aglipay, and Seventh Day Adventist, to name a few.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(502,0,7,1,'The Provincial Capitol of the province is located in the municipality of Alabel. Their vision is to have the province a peaceful and progressive community equipped with Human Resource and people oriented development programs, inhabited by empowered/partcipative citizenry, ecologically balanced with equitable access to basic services and infrastructure facilities, a high moral and spiritual consciousness sustained by efficient revenue generation, multicrop productions and light industries.','','','','','Alabel','Sarangani','Region XII','Philippines',6.1850325,125.3466253),(503,0,7,1,'The political history of Sarangani came with the election rules created by the Commission on Election (COMELEC). Political leaders are very active in restoring the peace and order situation and community development in the province. Defeated politicians are likewise concerned with the same problems.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(504,0,7,1,'Congressman of Sarangani is Erwin L. Chiongbian (Re-Elected)','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(505,0,7,1,'The Governor of Sarangani is Miguel Rene A. Dominguez (Re-elected)','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(506,0,7,1,'The Vice-Governor of Sarangani is Steve C. Solon(New)','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(507,0,7,1,'The board members of the first (1st) district are: raul C. Martinez, Arturo M. Lawa, Limuel N. Gacula, Nicanor A Ballan.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(508,0,7,1,'The board members of the second (2nd) district are: Victor James B. Yap, Eunice D. Santos, Norberto A Butiong, Napoleon F. Alaba, Rolando S. Octavio Jr., and Benedicto L. Ruiz II.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(509,0,7,1,'The Mayor of Maasim is Aniceto P. Lopez, Jr. (Re-Elected)','','','','','Maasim','Sarangani','Region XII','Philippines',5.9267175,124.994751),(510,0,7,1,'The Vice-Mayor of Maasim is Sawab J. Pangolima (Re-Elected)','','','','','Maasim','Sarangani','Region XII','Philippines',5.9267175,124.994751),(511,0,7,1,'The Mayor of Malapatan is Jorge T. Sambaga, who was elevated to the position after the death of late Hon Aida C. Singcoy.','','','','','Malapatan','Sarangani','Region XII','Philippines',5.9663386,125.2853778),(512,0,7,1,'The Vice-Mayor of Malapatan is Jimmy T. Bagit, who was elevated to the position after the death of late Hon Aida C. Singcoy.','','','','','Malapatan','Sarangani','Region XII','Philippines',5.9663386,125.2853778),(513,0,7,1,'The Mayor of Malungon is Reynaldo F. Constanteno (New)','','','','','Malungon','Sarangani','Region XII','Philippines',6.3343032,125.2587964),(514,0,7,1,'The Vice-Mayor of Malungon is Benjamin M. Guilley (Re-Elected)','','','','','Malungon','Sarangani','Region XII','Philippines',6.3343032,125.2587964),(515,0,7,1,'The Mayor of Maitum is Elsie R. Perrett (New)','','','','','Maitum','Sarangani','Region XII','Philippines',6.1240808,124.4863567),(516,0,7,1,'The Vice-Mayor of Maitum is Tito T. Balason (New)','','','','','Maitum','Sarangani','Region XII','Philippines',6.1240808,124.4863567),(517,0,7,1,'The Mayor of Alabel is Corazon S. Grafilo (New)','','','','','Alabel','Sarangani','Region XII','Philippines',6.1850325,125.3466253),(518,0,7,1,'The Vice-Mayor of Alabel is Vic Paul M. Salarda (New)','','','','','Alabel','Sarangani','Region XII','Philippines',6.1850325,125.3466253),(519,0,7,1,'The Mayor of Kiamba is Rommel Tomas Manuel Falgui (new)','','','','','Kiamba','Sarangani','Region XII','Philippines',6.0233926,124.6414028),(520,0,7,1,'The Vice-Mayor of Kiamba is Elmer T. De Peralta (New)','','','','','Kiamba','Sarangani','Region XII','Philippines',6.0233926,124.6414028),(521,0,7,1,'The Mayor of Glan is Enrique B. Yap, Jr (Re-elected)','','','','','Glan','Sarangani','Region XII','Philippines',5.7600383,125.3466253),(522,0,7,1,'The Vice-Mayor of Glan is Venancio S. Wata Jr. Re-Elected)','','','','','Glan','Sarangani','Region XII','Philippines',5.7600383,125.3466253),(523,0,7,2,'On peace and public safety, there are 293 policemen manning the province including 196 policemen distributed among the seven (7) municipalities. Add to this are 52 manning the Provincial Headquarters and 55 comprising the Provincial Mobile Groups. Similarly, the presence of the 1002nd Infantry Brigade, 73rd Infantry Battalion and the Foxtrot Company of 72nd Infantry (Cadre) Battalion, all of 10th Infantry Division of the Philippine Army reinforces the protective services afforded the populace of the province.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(524,0,7,2,'As shown in 1999 PNP record, there were 47 reported cases of child abuses in the province. Most of the cases were rape and physical injury with 16 and 15 cases, respectively. It is also noted that most of the child abuse cases are sex-oriented or related to domestic violence.','','','','','General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.171618),(525,0,7,2,'Rehabilitation of abused children from the province is referred to General Santos City and DSWD Regional office.','','','','','','Sarangani','Region XII','Philippines',6.1163861,125.171618),(526,0,7,2,'Out of 47 child abuse cases reported in 19999, 25 were filed in court and nothing had been decided yet. A large number (15) were settled outside and/or arraigned while 5 cases are still pending. There maybe more cases of abuses among children as shown by the data on domestic violence, but only few cases are reported.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(527,0,7,2,'In the same survey, about 15.66% or 9,667 families had children below 7 years old who are left unattended in their homes. These are children of irresponsible parents and/or working parents who spent most of their time outside the home earning income for the family. These children are prone to delinquency and child abuse. They are likewise susceptible to child diseases.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(528,0,7,2,'Unattended children and those under families with domestic violence are the possible victims of commercial and sexual exploitation. However, there are no data avalale regarding the extent of child trafficking as well as commercially and sexually exploited children from province. Common hazardous labor in the province includes mining, deep-sea fishing, coconut harvesting, sugarcane hauling, etc. Due to poverty, these children are forced to work in order to help their parents earn additional income for their families.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(529,0,7,2,'This only shows that more cases are being filed against children offenders. However, system and facility to correct behavior of children offenders have not been properly installed in the province, like the youth rehabilitation center. Most of these children are put in the same prison with adult criminals as their cases are tried in court. This existing situation of children offenders would worsen if not properly addressed.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(530,0,7,2,'These problems related to children become more evident due to the absence or inadequate structure/mechanism at the community level that ensures the protection of children. With the absence of family court, cases are referred to Municipal and Regional Trial Courts. Cases of child abuse are usually amicably settled at the PNP or barangay level without involving the other pillars of justice system who are mandated by law to intervene in case of failure of parents to protect the right of the child.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(531,0,7,2,'As an answer to the pressing issues on children, the province has started organizing Councils that would ensure the protection of children at the municipal and barangay levels and establish some child-friendly structure in pilot municipalities and barangays.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(532,0,7,2,'Of the 7 municipalities comprising the province, all of them have fire stations with their own firetrucks. The rest of the fire stations, same number of fire fighting equipment can be noted from the prevoiuos year.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(533,0,7,2,'Communist Terrorist Movement. Guerilla Front 71 under the Far South Mindanao Region (FSMR), KOMMID. Its armed component with (2) platoons namely Platoon 1 (CN: LAWIN) and Platoon 2 (CN: MAZDA) is composed of two (2) Squads sub-divide into two (2) teams respectively. They are highly mobile in the hinterlands of Malapatan-Glan-Jose Abad Santos-Don Marcelino complex and along the Brgys Pag-asa-Kihan-Upper Suyan-Kinam mountain ranges (mass base areas). While their consolidation/concentration areas are monitored in the mountainous/forested areas of the far flung Sitios of Brgys of Pag-asa and Datal Anggas, both of Alabel, SP towards Brgys Little Baguio, Datu Danwanta and Manuel Peralta (guerilla bases of Pltn 1 CN: LAWIN), all of Malita, DDS.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(534,0,7,2,'Platoon 2 (CN: MAZDA) is composed of one (1) minus Platoon sub-divided into two (2) Teams. Covers the whole of Malapatan, portions of Glan and Alabel, all of Sarangani Province and parts of Don Marcelino and Jose Abad Santos, both of DDS (expansion area).','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(535,0,7,2,'STRENGTH AND ARMMENTS. Guerilla Front 71, FSMR has a total strength of thirty-one (31) with forty-four (44) number of firearms.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(536,0,7,2,'1. Hit and Run Tactics, 2. Pose as mere civillian in case surrounded by operating troops, Stay in vegetated and advantage areas to avoid frontal confrontation with government troops, 4. Use intimidation and black propaganda to recruit new members. Note: (They also designate three of their personnel for sniping when in contact and conduct harassment to any military installation.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(537,0,7,2,'LOGISTICS. The Guerilla Front 71 were purchased their foodstuffs in Malita, DDS through single passenger motorcycle towards Brgy Macul, of same municipality then pick-up by masses then brought to Sitio Danao, Brgy Pangaleon through horseback. Further, the WAC specifically coming from Digos City are providing financial supports in the amount of one hundred thousand (P100,000.00) pesos monthly. However, some of their food supplies came from Sitio Buenavista, Brgy Pag asa, Alabel, SP. Likewise, GF 71 can generate logistic supplies through implementing extortion from farmers, businessman, local politicians and even small business sectors including their two hectares communal farm planted with different root crops located in Sitio Tangis, Brgy Datal Anggas, Alabel, SP and Sitio Kisoy, Brgy Little Baguio, Malita, DDS.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(538,0,7,2,'TRAINING. Generally, the CTM training is divided into two (2) fields: political and military. Recruited members must undergo educational programs through indoctrination on economic, political and communist ideology. Corresponding political education is provided, as they are elevated to the higher organizations. Likewise, GF 71 compossing from local guerillas (militias and armed regulars) must undergo military training to enhance their combat effectiveness particularly are the following;\n Commando, Marksmanship and Medical Specialization (Acue Puncture, Nurturing, Vaccination and First Aid).','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(539,0,7,2,'1. Mastery of terrain dictates the tempo of engagement. Extensive support of their masses especially on areas that were not frequented by government troops. 2. Presence of seasoned Cadres and huge pool of recruits. 3. Highly mobile and can easily shift to smaller group once detected. 4. Effective in hit and run tactics.5. The area is conducive for revolutionary struggle.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(540,0,7,2,'SOUTHERN PHILIPPINE SECESSIONIST GROUP. Moro Islamic Liberation Front. Political. Sarangani Provincial Committee (SPC) – Former Sugoda Buayan Regional Committee (SBRC) headed by Hadji Puad Japal covers the municipality of Glan.','','','','','Glan','Sarangani','Region XII','Philippines',5.7600383,125.3466253),(541,0,7,2,'SOUTHERN PHILIPPINE SECESSIONIST GROUP. Moro Islamic Liberation Front. Political. Sarangani Provincial Committee (SPC) – Former Sugoda Buayan Regional Committee (SBRC) headed by Hadji Puad Japal covers the municipality of Malapatan','','','','','Malapatan','Sarangani','Region XII','Philippines',5.9663386,125.2853778),(542,0,7,2,'SOUTHERN PHILIPPINE SECESSIONIST GROUP. Moro Islamic Liberation Front. Political. Sarangani Provincial Committee (SPC) – Former Sugoda Buayan Regional Committee (SBRC) headed by Hadji Puad Japal covers the municipality of Alabel.','','','','','Alabel','Sarangani','Region XII','Philippines',6.1850325,125.3466253),(543,0,7,2,'SOUTHERN PHILIPPINE SECESSIONIST GROUP. Moro Islamic Liberation Front. Political. Sarangani Provincial Committee (SPC) – Former Sugoda Buayan Regional Committee (SBRC) headed by Hadji Puad Japal covers the municipality of Malungon.','','','','','Malungon','Sarangani','Region XII','Philippines',6.3343032,125.2587964),(544,0,7,2,'SOUTHERN PHILIPPINE SECESSIONIST GROUP. Moro Islamic Liberation Front. Political. Sarangani Provincial Committee (SPC) – Former Sugoda Buayan Regional Committee (SBRC) headed by Hadji Puad Japal covers all of Sarangani Province.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.