107th Base Command, SMF has a total strength of 195 with a total number of firearms is placed at 496 and a total of 72 affected barangays.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(555,0,7,2,'AUXILIARY THREAT GROUPS. Lawless Crime Elements(Bandits/Pirates). Lawless Crime Elements operates in Sarangani Province area. It has composed of cultural minorities namely: B’laan, Kalagan, Tulagad, Kaulo and Manobo natives and other break-away factions from the MILF who are engaged in banditry, kidnapping, piracy, cattle rustling and other various forms of nefarious activities.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(556,0,7,2,'Guerilla Front 71, FSMR will intensively focus its IPO works for strengthening their rank in preparation of the forthcoming Nat’l and Local election 2010 to gain masses support with their fielded candidates and party list groups. Likewise, imposing of a Permit-To-Campaign (PTC) fee to political candidates are expected in CTs affected areas.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(557,0,7,2,'On the other hand, the LMGs and the alleged MAGDALO group of 8th Bde, 105th BC is expected to continue conducting extortion and other means of atrocities in MAKIMA area for their organizational build-up. It is believed that the SOG in connivance with the local JI will carry out bombing operations particularly in the City of General Santos and nearby municipalities in Sarangani Province when they feel that the gov’t troops will put down their guards. The ATGs will continue their criminal activities for personal end.','','','','','','Sarangani','Region XII','Philippines',5.9267175,124.994751),(558,0,8,2,'improvised explosive devices deployed in antipolo by abu sayaff','','','','','','Davao del Norte','Davao Region','Philippines',7.5617699,125.6532848),(559,0,8,7,'The province of Davao is divided into 3 provinces: Davao del Norte, Davao del Sur, and Davao Oriental by virtue of R.A. 4867 authored by then Congressman Hon. Lorenzo S. Sarmiento, Sr. on 8 May, 1967','','','','','','Davao del Norte','Davao Region','Philippines',7.5617699,125.6532848),(560,0,8,4,'The provinces of Davao del Norte, Davao del Sur, and Davao Oriental simultaneously celebrate their anniversary every 1st of July','','','','','','Davao del Norte','Davao Region','Philippines',7.5617699,125.6532848),(561,0,8,7,'Davao del Norte has 22 municipalities: Asuncion, Babak, Compostela, Kapalong, Mabini, Mawab, Monkayo, Nabunturan, Panabo, Pantukan, Samal, Sto. Tomas, Tagum, Carmen, Kaputian, Maco, Montevista, New Bataan and New Corella, Laak, Maragusan, and Talaingod','','','','','','Davao del Norte','Davao Region','Philippines',7.5617699,125.6532848),(562,0,8,4,'On May 6, 1970, 6 municipalities were created in Davao del Norte: Carmen, Kaputian, Maco, Montevista, New Bataan, and New Corella','','','','','','Davao del Norte','Davao Region','Philippines',7.5617699,125.6532848),(563,0,8,4,'Hon. Verulo C. Boiser was Davao del Norte’s first governor and was appointed by the president. infoHe served for 2 years from July 1, 1967 as an appointed official and two terms as an elected governor to July 7, 1977','','','','','','Davao del Norte','Davao Region','Philippines',7.5617699,125.6532848),(564,0,8,6,'The building construction of the capitol started in 1969 in the 20 hectare capitol site which was donated by the following land owners: Mr. Quirino Salcedo Magsanoc, Mrs. Margarita Magsanoc Aala, Mr. Pablo Laude Aala, Mrs. Thelma Aala Still, Engr. Richie Magsanoc Aala, Engr. Crisanto Magsanoc Aala, Mrs. Urduja Aala Julopzinen and Mr. Pablito Magsanoc Aala. It was completed and inaugurated on July 1, 1972 during the 5th Founding Anniversary of the province','','','','','','Davao del Norte','Davao Region','Philippines',7.5617699,125.6532848),(565,0,9,2,'A new group linked to the Abu Sayyaf group and Jemaah Islamiyah may be behind the supposed terrorist threat against Davao City, which has been on heightened alert since last week, a ranking military official said on Sunday. - See more at: http://www.gmanetwork.com/news/story/367889/news/regions/new-group-may-be-behind-threat-to-davao-city-afp-eastmincom#sthash.ZthRAVPP.dpuf','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(566,0,9,2,'The new group, supposedly led by master bombmaker Abdul Basit Usman is planning attacks in the country\'s largest city, Capt. Alberto Caber of the Armed Forces of the Philippines Eastern Mindanao Command said. (GMANews.com, 6/29/2014)','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(567,0,9,2,'Usman is a foreign-trained bomb expert who was caught in 2002, however, he escaped that the same year. The United states has offered $1 million for information that could lead to his arrest. (GMANews.com, 6/29/2014)','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(568,0,9,2,'On June 11, a joint police and military operation killed two of Usman\'s relatives, but the wounded bomb expert managed to escape. \"May intelligence report na may plano ang isang grupo na magsagawa ng bomb attack dito sa Davao City,\" he told GMA News Online in a phone interview. (GMANews.com, 6/29/2014)','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(569,0,9,2,'\"\"Wala pang pangalan itong grupo pero may link ito sa Abu Sayyaf at JI (Jemaah Islamiyah, a Southeast Asian terrorist organization linked to Al-Qaeda),\"\" Caber added.\"\"Puwede na new group ito,\"\" he said.(GMANews.com, 6/29/2014)','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(570,0,9,2,'Jemaah Islamiyah, a Southeast Asian terrorist organization linked to Al-Qaeda -(GMANews.com, 6/29/2014)','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(571,0,9,2,'Caber said that according to intelligence reports, the group might use bombs or improvised explosive devices for the attack. \"\"Puwedeng magpasabog ang mga ito to kill government forces or to kill civilians to attract international attention,\"\" he said. Still, Caber explained that the military has yet to validate the intelligence reports. (GMANews.com, 6/29/2014)','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(572,0,9,2,'The military is not discounting the possibility that the bomb threats are retaliation after the Philippine National Police captured top-ranking Abu Sayyaf leader Khair Mundos, who has a $500,000 bounty.Mundos was arrested in Barangay San Dionisio, Parañaque City on June 11. (GMANews.com, 6/29/2014)','','','','','Paranaque','','Metro Manila','Philippines',14.4937194,120.9847642),(573,0,9,2,'The police and military have tightened security measures in Davao City. Caber said that they have increased the number of personnel and checkpoints within and outside the city. \"\"We also have operatives in plain clothes,\"\" he added. According to Davao-based GMA News Online contributor Mac Macapendeg, there are more patrol cars and checkpoints in the city, especially in commercial areas.He said, though, that the heightened security has not kept residents from regular activities. (GMANews.com, 6/29/2014)','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(574,0,9,2,'Davao City has been on heightened alert since last week after President Benigno Aquino III called up Mayor Rodrigo Duterte to warn him of a possible security threat. (GMANews.com, 6/29/2014)','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(575,0,9,2,'\"\"There are reports of possible terrorist attack. For good measure, the president called Mayor Duterte,\"\" explained AFP public affairs chief Ramon Zagala in a separate phone interview. \"\"The public is warned. They should be aware and vigilant,\"\" he added. Caber said the heightened alert in Davao City will remain until August or after the celebration of the Kadayawan Festival, the city\'s biggest annual celebration. (GMANews.com, 6/29/2014)','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(576,0,9,2,'Meanwhile, the government assured residents that it has enough soldiers on the ground to keep civilians safe. \"We have more than enough forces to secure Davao City and its neighboring towns and communities… We have the support of the civilian population and the rest of the stakeholders,\" Presidential Communications Operations Office Secretary Herminio Coloma, in a radio interview on Sunday, quoted Zagala as saying. (GMANews.com, 6/29/2014)','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(577,0,10,2,'The presence of the Philippine Army in Davao Oriental is now being beefed up as the national government is bent on ending the decades-old insurgency problem through a new strategy that aims to win the hearts and minds of the people especially those living in the countryside where most the armed threat groups operate. (Official Website of the Province of Davao Oriental, 01/28/2011)','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(578,0,10,2,'But the new units of the Philippine Army here are quick to allay the local residents’ fear of militarization by painstakingly explaining to the locals their new counter-insurgency strategy that they claim will finally “win peace” that would enable the people to realize their shared vision of lasting peace and stability in their communities.','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(579,0,10,2,'Officials of the new military units in the province headed by Col. Leonido Bongcawil of the Philippine Army’s 701st Brigade has recently paid a courtesy visit to the office of Davao Oriental Governor Corazon Malanyaon during which they briefed the governor on the military’s new anti-insurgency strategy called “Bayanihan.” (Official Website of the Province of Davao Oriental, 01/28/2011)','','','','','Mati','Davao Oriental','Davao Region','Philippines',6.9456151,126.226625),(580,0,10,2,'The military officials have took turns in explaining to the governor the details of the Internal Peace and Security Plan (IPSP) which is the new anti-insurgency strategy of the Armed Forces of the Philippines. (Official Website of the Province of Davao Oriental, 01/28/2011)','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(581,0,10,2,'The military officials told Governor Malanyaon that the new anti-insurgency strategy aims to win the hearts and minds of the people rather than directly confronting the armed rebel groups like the Communist-led New People’s Army and the secessionist Moro Islamic Liberation Front. (Official Website of the Province of Davao Oriental, 01/28/2011)','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(582,0,10,2,'Aside from Col. Bongcawil, the military officials who briefed the governor on the AFP’s new counter-insurgency strategy are Col. Alfredo Fernandez, deputy brigade commander of the Army’s 701st Brigade;\n Lt. Col. Leopoldo Imbang Jr., commander of the Army’s 28th Infantry Battalion;\n and Lt. Col. Ruben Basiao, commander of the 67th Infantry Battalion. (Official Website of the Province of Davao Oriental, 01/28/2011)','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(583,0,10,2,'Bongcawil, however, disclosed that under the new anti-insurgency plan of President Benigno Aquino III, the whole provinces that comprise the Davao Region are now declared “priority areas” citing the result of the military’s internal security operations that showed that 46 percent of the forces of the Communist-led New People’s Army are now based in the Davao Peninsula. The Davao Region is composed of the provinces of Davao del Norte, Davao del Sur, Davao Oriental and Compostela Valley. (Official Website of the Province of Davao Oriental, 01/28/2011)','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(584,0,10,2,'Col. Bongcawil says that the Davao Region’s “vast resources” like its rich minerals and vast forests has attracted the NPA rebels to operate in the area and make big mining and logging companies and multinational banana firms that operate in the region as their milking cows. (Official Website of the Province of Davao Oriental, 01/28/2011)','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(585,0,10,1,'For her part, Davao Oriental Governor Corazon Malanyaon have expressed her gratitude to the top brass of the AFP, saying that their beefed up presence is indeed a big boost to her peace and development agenda which is focused on achieving a peaceful and just settlement of conflicts that will result to a lasting peace and security in her province. “We are so glad for all the support that the two battalions have extended to the province. We can turn to them for security. They are reliable and dependable. In our plan, it is important that we will be able to institutionalize the convergence of our resources, efforts, harmonization or integration. That’s the kind of strategy that we have been used to adopting in our peace and development efforts,” Governor Malanyaon told the military officials here.“I am very positive with your action plans. On our part, we have given you some modest support and I think we can give more things that are really necessary for your successful operations. So I don’t think may doubt pa tayo dyan. I think that’s one of the strengths of this provincial government na wala kaming mixed loyalty. We really show our support and we also try to help you in persuading some barangay officials who show some reservations about supporting you. Dapat talagang magkasama tayo dito di ba?,” adds the governor. (Official Website of the Province of Davao Oriental, 01/28/2011)','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(586,0,10,1,'The governor have also informed the military officials about a new policy of the provincial government that will soon ban all forms of cutting of trees in the whole province. She says the “total log ban” that will soon be implemented in the whole province is a drastic measure aimed at effectively stopping the rampant cutting of trees in several towns here. “I have always been against logging whether it is legal or illegal. There is no such thing as totally legal logging. That is my belief,” says the environment advocate governor who initiated the Million Trees Movement in Davao Oriental. The governor also hoped that the “total log ban” policy will be able to contribute greatly to efforts that aims to make this province insurgency-free. A province is categorized as insurgency-free when the threats posed by rebel groups are downgraded into a mere law and order problem. (Official Website of the Province of Davao Oriental, 01/28/2011)','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(587,0,10,2,'President Aquino is strongly pushing for the military’s new counter-insurgency strategy as he believed it will win the peace and not just defeat the enemy. The military’s new internal security plan will maximize the use of civil-military operations and development-oriented activities while combat operations against armed threat groups will be intelligence-driven and calibrated. (Official Website of the Province of Davao Oriental, 01/28/2011)','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(588,0,10,2,'“Under the plan, the AFP’s desired end state is that capabilities of internal armed threats are reduced to a level that they can no longer threaten the stability of the state and civil authorities can secure the safety and well-being of the Filipino people,” says the Executive Summary. (Official Website of the Province of Davao Oriental, 01/28/2011)','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(589,0,10,2,'It added that “The focus of this plan is on effects-based operations that are tailored for each armed threat group. The AFP internal peace and security initiatives shall be on the defeat of terrorist groups such as the Abu Sayyaf Group and the Jemaah Islamiah, in compliance with the policy of non-negotiation of the government.” (Official Website of the Province of Davao Oriental, 01/28/2011)','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(590,0,10,2,'With regards to the Moro Islamic Liberation Front, “the projected national end-state is a negotiated political settlement within the bounds of the Philippine Constitution to attain the conditions for a just and lasting peace in Mindanao,” the Executive Summary stated. (Official Website of the Province of Davao Oriental, 01/28/2011)','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(591,0,10,2,'In the strategy against the NPA, “The AFP’s internal peace and security initiatives shall focus on rendering the NPA irrelevant, with the communist insurgency abandoning its armed struggle and engaging in peace negotiations with the government,” the Executive Summary stated. (Official Website of the Province of Davao Oriental, 01/28/2011)','','','','','','Davao Oriental','Davao Region','Philippines',7.3171585,126.5419887),(592,0,11,3,'THE Department of Agriculture (DA) is pushing for more cacao processors to operate in Davao Region to further position Davao as the cacao capital in the Philippines. (Sun Star Davao, 10/12/2015)','','','','','','','Davao Region','Philippines',7.3041622,126.0893406),(593,0,11,3,'Agriculture Secretary Proceso J. Alcala, in his visit Friday during the turnover of 2015 Bottom-Up Budgeting (BUB) checks at the Waterfront Insular Hotel, said agency is targeting the region to be the leading prime mover for cacao in the Philippines.Sun Star Davao, 10/12/2015)','','','','Lanang','Davao City','Davao del Sur','Davao Region','Philippines',7.3041622,126.0893406),(594,0,11,3,'He also pointed out that as Davao is much productive as far as cacao is concerned compared to other regions, it is just right to make it as the cacao center in the country.Sun Star Davao, 10/12/2015)','','','','Lanang','Davao City','Davao del Sur','Davao Region','Philippines',7.3041622,126.0893406),(595,0,11,3,'Meanwhile, some P7.1-million worth of intervention such as cacao seedlings, nursery units and cacao solar dryers’ were turn-over Friday during the ceremony. At present, Davao City has a total of 16,000 farmers devoted to cacao covering a total of 6,000 has.Sun Star Davao, 10/12/2015)','','','','','','','Davao Region','Philippines',7.3041622,126.0893406),(596,0,11,3,'As part of the measures in positioning Davao as the cacao capital, the Cacao Industry Development Association in Mindanao Inc. (Cidami) with Department of Tourism and other stakeholders are now gearing up for a Geographical Indicator (GI) mark from the Department of Trade and Industry (DTI) in a bid to strengthen the position of Davao cacao-based products in the global market and increase its marketability.Sun Star Davao, 10/12/2015)','','','','','','','Davao Region','Philippines',7.3041622,126.0893406),(597,0,12,2,'The Philippine National Police on Sunday confirmed reports of a possible terror threat in Davao region, particularly in Davao City. In a statement, Philippine National Police (PNP) spokesperson Chief Supt. Reuben Theodore Sindac said the information about a threat of a terror attack in Davao was “received with high reliability.” “We could not, however, divulge any further details of said reports received so as not to compromise ongoing security operations by both the PNP and the Armed Forces of the Philippines in these areas,” Sindac said. (Manila Times, 06/29/2014)','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(598,0,12,2,'Sindac said Department of Interior and Local Government Secretary Mar Roxas has already ordered the PNP to “beef-up security operations against possible infiltration of suspected members of said reported threat groups.”“Similarly, all six Police Regional Offices in Mindanao remain on constant alert conditions to ensure their operational readiness and capabilities to respond to all possible contingencies,” he said. “Security forces in these areas will be initiating preemptive security measures in the form of aggressive foot and mobile patrols, conduct of intensified checkpoints and gun check operations, including rigid inspections in land, sea and air transport terminals, commercial centers, places of convergence and vital installations,” he added.(Manila Times, 06/29/2014)','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(599,0,12,2,'Duterte said intelligence reports tell of possible terror attacks in Kidapawan City. “Coming from the President, it must be very serious. So we are not taking it lightly,” Duterte said.Duterte also met with ranking officials of the police and the military on Thursday to talk about the security matters and prevent terror groups from successfully launching their attacks in Davao City. “There was an order from the President to take the reports seriously. And so I am asking everyone to work themselves to death,” he said.(Manila Times, 06/29/2014)','','','','','Kidapawan City','Cotobato','Region XII','Philippines',7.010607,125.0911341),(600,0,12,2,'Duterte said intelligence reports tell of possible terror attacks in Koronadal City. “Coming from the President, it must be very serious. So we are not taking it lightly,” Duterte said. Duterte also met with ranking officials of the police and the military on Thursday to talk about the security matters and prevent terror groups from successfully launching their attacks in Davao City. “There was an order from the President to take the reports seriously. And so I am asking everyone to work themselves to death,” he said.(Manila Times, 06/29/2014)','','','','','Koronadal City','South Cotobato','Region XII','Philippines',6.4973963,124.8471625),(601,0,12,2,'Duterte said intelligence reports tell of possible terror attacks in Cagayan de Oro City. “Coming from the President, it must be very serious. So we are not taking it lightly,” Duterte said. Duterte also met with ranking officials of the police and the military on Thursday to talk about the security matters and prevent terror groups from successfully launching their attacks in Davao City.“There was an order from the President to take the reports seriously. And so I am asking everyone to work themselves to death,” he said.(Manila Times, 06/29/2014)','','','','','Cagayan de Oro City','Misamis Oriental','Northern Mindanao','Philippines',8.4542363,124.6318977),(602,0,13,6,'UNLIKE in the past, Davao City did not experience flooding amid heavy rains Friday night that lasted for more than one hour. But the heavy downpour, which started around 6 p.m. left hundreds of commuters stranded along the streets. (Sun Star Davao, 10/10/2015)','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(603,0,13,6,'Based on the monitoring of the Davao City Risk Reduction and Management Council (DCRRMC), no flashflood was reported in the downtown area neither in some residential areas that are usually flooded during heavy rains.(Sun Star Davao, 10/10/2015)','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(604,0,14,2,'Before the September 21 kidnapping of three foreigners and a Filipina from a resort in the Island Garden City of Samal, the crime index in the region had gone down by 28.38%. The crime index in the Davao Region went down by 28.38 percent with 13,476 incidents recorded between January and August this year, compared with last year’s 18,936 for the same period. (Mindanews, 10/03/2015)','','','','','','','Davao Region','Philippines',7.3041622,126.0893406),(605,0,14,2,'No kidnapping incident was recorded between January and August 2015. Kidnappings are rare in the region comprising the four Davao provinces – Davao del Sur, Davao Occidental, Davao del Norte and Davao Oriental – and Compostela Valley and the cities of Davao, Digos, Panabo, Tagum, Island Garden City of Samal and Mati. The recent kidnapping in Samal came 14 years after a foiled attempt in another resort. The kidnappers, reportedly based outside Davao, have allegedly brought their victims to Sulu.(Mindanews, 10/03/2015)','','','','','','','Davao Region','Philippines',7.3041622,126.0893406),(606,0,14,2,'Mayor Rodrigo Duterte, chair of the Regional Peace and Order Council last week cited reports indicating the kidnappers, reportedly allied with the Abu Sayyaf, had brought the victims to Sulu.(Mindanews, 10/03/2015)','','','','','','','Davao Region','Philippines',7.3041622,126.0893406),(607,0,14,2,'Records from the Police Regional Office (PNP) showed that physical injuries with 6,562 cases comprised the biggest share of the total crime index at 48.69 percent, lower than last year’s 8,606 for the same period.(Mindanews, 10/03/2015)','','','','','','','Davao Region','Philippines',7.3041622,126.0893406),(608,0,14,2,'At the Regional Peace and Order Council (RPOC) meeting at the Grand Men Seng Hotel on Wednesday, Senior Supt. Michael John Dubria, chief of Regional Operations and Plans Division of PRO 11, said the decrease can be attributed to the intensified implementation of its anti-criminality plan, “Lambat-Sibat.”(Mindanews, 10/03/2015)','','','','','','','Davao Region','Philippines',7.3041622,126.0893406),(609,0,15,2,'As chairman of the Regional Peace and Order Council, Davao City Mayor Rodrigo Duterte immediately called a crisis meeting with key leaders of security groups in the Davao Region to discuss the kidnapping of three foreigners and a Filipino from the Holiday Oceanview Samal Resort on Samal Island. Two of those kidnapped — John Ridsdel and Robert Hall — are Canadians connected with TVI Pacific, Inc., a Calgary-based mining group which has operations in Zamboanga del Norte. The company has launched \"an intense rescue effort\" for Ridsdel, a semi-retired consultant and Hall, a geologist, according to Shirley Anthony, a spokeswoman for TVI. (CNN Philippines, 09/24/2015)','','','','','','','Davao Region','Philippines',7.3041622,126.0893406),(610,0,15,2,'For its part, the Philippine Department of Foreign Affairs (DFA) issued a statement of reassurance about the security of leaders, delegates, and guests at November\'s Asia Pacific Economic Cooperation Economic Leaders\' Meeting (AELM) in Manila. (CNN Philippines, 09/24/2015)','','','','','','','Davao Region','Philippines',7.3041622,126.0893406),(611,0,15,2,'The Davao Region has been relatively peaceful for more than a decade. In 2014, a peace agreement with the Moro Islamic Liberation Front (MILF), largest Muslim rebel group in the south, ended 45 years of conflict in which about 120,000 people were killed and 2 million displaced.So the kidnapping, which happened on Monday night, took military and officials by surprise. As of this writing, no group has claimed responsibility for the kidnapping. (CNN Philippines, 09/24/2015)','','','','','','','Davao Region','Philippines',7.3041622,126.0893406),(612,0,15,2,'According to police, five hours after the kidnapping, a private security found a note at the resort gate, apparently left behind by the kidnappers, saying: \"Katarungan ng aming commander, by NPA.\" [Translation: \"Justice for our commander, by the NPA.\" (CNN Philippines, 09/24/2015)','','','','','','','Davao Region','Philippines',7.3041622,126.0893406),(613,0,15,2,'The NPA has long stood against mining. But authorities said they doubted whether the NPA had the capability to carry out such an attack. Senior Supt. Aaron Aquino, deputy regional director of Police Regional Office 11, said the note could merely be part of a diversionary tactic to mislead investigators. (CNN Philippines, 09/24/2015)','','','','','','','Davao Region','Philippines',7.3041622,126.0893406),(614,0,15,2,'In 2001, Islamist militants from Abu Sayyaf, a group linked to al Qaeda, failed to kidnap foreign tourists on Samal island\'s Pearl Farm resort. Three security men died fighting off the attack. (CNN Philippines, 09/24/2015)','','','','','','','Davao Region','Philippines',7.3041622,126.0893406),(615,0,16,1,'The secretary-general of the Organization of the Islamic Cooperation (OIC) met separately with leaders of the Moro National Liberation Front (MNLF) and Moro Islamic Liberation Front (MILF) Saturday evening, hosted a seaside dinner for both and on Sunday met them jointly to discuss, through the Bangsamoro Coordination Forum (BCF), on how best to move forward in harmonizing the tracks of the peace agreements they signed separately with the Philippine government. (Mindanews, 04/20/2015)','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(616,0,16,1,'“We pushed for the reviving, reinvigorating of the Forum. We think it provides an excellent stage for all sides to communicate to express their views,” OIC Secretary-General Iyad Ameen Madani told MindaNews after the four-hour closed door meeting that started at 11:29 a.m. and ended at 3:38 p.m. at the Tinalak Rooms 1 and 2 at the Seda Abreeza hotel here. “We are optimistic that this Forum is reducing the gap between the different views. We are all interested in peace,” Madani, the first OIC Secretary-General to have visited Mindanao, said, adding the next meeting of the BCF has been set for next month, in Kuwait, at the sidelines of the Council of Foreign Ministers’ meeting on May 26 to 28. (Mindanews, 04/20/2015)','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(617,0,17,1,'The Eastern Mindanao Command (EastMinCom) of the Armed Forces of the Philippines (AFP) gave assurance that the presence of the Moro Islamic Liberation Front (MILF) in Davao Oriental is not a security threat in Region 11.EastMinCom acting public information officer Major Ezra Balagtey told Edge Davao yesterday that the MILF members in the province are not combatants but are regular members who are also natives of Davao Oriental. “These members of the MILF do not want any fight and they are being engaged by the local government of Davao Oriental,” Balagtey said. (Edge Davao, 02/11/2015)','','','','','','','Davao Region','Philippines',7.3041622,126.0893406),(618,0,17,1,'Davao Oriental Police Provincial Office (DOPPO) provincial director Senior Superintendent Jose Carumba had earlier said the police are monitoring the activities of the MILF in the province following the deadly January 25 incident. Carumba said MILF members are present in the province particularly in the town of Tarragona, but the DOPPO does not consider them a security threat since the peace process is still on-going. Carumba also said the DOPPO is coordinating with the MILF commanders and vowed to help them monitor security threats in Davao Oriental. Armando B. Fenequito Jr. (Edge Davao, 02/11/2015)','','','','','','','Davao Region','Philippines',7.3041622,126.0893406),(619,0,18,1,'Davao City Mayor Rodrigo Duterte is planning to meet the top leaders of the Moro Islamic Liberation Front to discuss some issues concerning the proposed controversial Bangsamoro Basic Law now pending before Congress. (Davao Breaking News, 03/25/2015)','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(620,0,18,1,'Duterte said that he wanted to personally meet MILF chair Murad Ebrahim and vice chair Ghadzali Jaafar to express his support to the BBL at the same time some of his misgivings on the proposed law. (Davao Breaking News, 03/25/2015)','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(621,0,18,1,'The mayor said that one particular issue is on the proposal for an autonomous police and armed forces for the Bangsamoro region. Duterte said that this particular proposal could be used in the future by some nefarious individuals for their personal end. (Davao Breaking News, 03/25/2015)','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(622,0,18,2,'The National Police Commission will however exercise administrative supervision of the Bangsamoro police through a Police Board made up of elected members of the Bangsamoro parliament and sectoral representatives. (Davao Breaking News, 03/25/2015)','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.455341),(623,0,19,2,'At least 30 Abu Sayyaf Group (ASG) rebels and Philippine Army soldiers were either killed or wounded in fierce clashes between the two groups on Wednesday in Sulu province in the southern Philippines, according to officials. (Manila Times, 02/25/2015)','','','','','','Sulu','Autonomous Region in Muslim Mindanao','Philippines',5.9749011,121.03351),(624,0,19,2,'Marine Capt. Maria Rowena Muyuela, a spokesperson for the Western Mindanao Command, on Wednesday said the fighting erupted in the village of Tanum in Patikul town, a known stronghold of the Abu Sayyaf Group, which has links to global terror networks such as al-Qaeda.','','','','','Patikul','Sulu','Autonomous Region in Muslim Mindanao','Philippines',6.0666666,121.0999985),(625,0,19,2,'Military and police authorities have blamed the Abu Sayyaf for the spate of violence and terrorism in the autonomous region in the South. (Manila Times, 02/25/2015)','','','','','','Sulu','Autonomous Region in Muslim Mindanao','Philippines',5.9749011,121.03351),(626,0,20,4,'The Department of Health (DOH) has again recorded an increase in the number of dengue cases in the country with 