anagement Project (FRMP)-Fishery project and Strengthening of Fishery Law Enforcement project in the city.(Sun Star Davao,10/12/2015)','','','','','','','Davao Region','Philippines',7.3041622,126.0893406),(631,0,22,3,'Two of the poorest municipalities and the capital city of Davao del Sur have been allocated some P705 million under the Accelerated and Sustainable Anti-Poverty Program (ASAPP), a government inter-agency initiative intended to help the poor by stimulating local economic activities. Among the projects lined up under the program are farm-to-market roads, shared service facilities, and sustainable livelihood projects. (Business World, 10/20/2015)','','','','','','','Davao Region','Philippines',7.3041622,126.0893406),(632,0,22,3,'“A total of P705.5 million has been committed in the different municipalities including Hagonoy,” Department of Agriculture (DA)-Davao Region Director Remelyn R. Recoter said during the ASAPP presentation of accomplishment held in the city Thursday. (Business World, 10/20/2015)','','','','','Hagonoy','Davao del Sur','Davao Region','Philippines',6.6970077,125.3137005),(633,0,22,3,'“A total of P705.5 million has been committed in the different municipalities including Digos City,” Department of Agriculture (DA)-Davao Region Director Remelyn R. Recoter said during the ASAPP presentation of accomplishment held in the city Thursday. (Business World, 10/20/2015)','','','','','Digos City','Davao del Sur','Davao Region','Philippines',6.7575087,125.352398),(634,0,22,3,'“A total of P705.5 million has been committed in the different municipalities including Magsaysay.” Department of Agriculture (DA)-Davao Region Director Remelyn R. Recoter said during the ASAPP presentation of accomplishment held in the city Thursday. (Business World, 10/20/2015)','','','','','Magsaysay','Davao del Sur','Davao Region','Philippines',6.7915557,125.148879),(635,0,22,3,'Ms. Recoter said Davao del Sur, which ranked as the top most competitive province in the National Competitiveness Council’s Cities and Municipalities Competitiveness Index for this year, is identified as one of the ten poorest provinces in the country. (Business World, 10/20/2015)','','','','','','Davao del Sur','Davao Region','Philippines',6.7662687,125.3284269),(636,0,22,3,'Digos City is getting the largest share at P438 million, followed by Magsaysay with P176 million, and Hagonoy with P84.7 million, while the remaining P6 million is shared by the three other areas. “Completion rate for the project amounts to 9.88% or P69 million, while 61.59% are ongoing and 28.53% are up for implementation,” Ms. Recoter said. (Business World, 10/20/2015)','','','','','Digos City','Davao del Sur','Davao Region','Philippines',6.7575087,125.352398),(637,0,22,3,'Of the total amount committed, the largest comes from the Department of Public Works and Highways at P236.7 million, followed by the Department of Social Welfare and Development (DSWD) at P 166.7 million. DA Undersecretary Emerson U. Palad said there are now 89 programs enrolled under ASAPP. (Business World, 10/20/2015)','','','','','Davao City','','Davao Region','Philippines',7.190708,125.455341),(638,0,22,3,'Meanwhile, the Bureau of Fisheries and Aquatic Resources (BFAR) in Davao Region has completed intervention projects with an estimated amount of P200,000 in the Davao del Sur area. Among the interventions are fingerling dispersal, fishing gear distribution, training on shallow fishing (payao), shelter installation and distribution of multiple long lines. (Business World, 10/20/2015)','','','','','','','Davao Region','Philippines',7.3041622,126.0893406),(639,0,23,3,'Agriculture Secretary Proceso Alcala lauded the steady increase in livestock and poultry production in Davao region during the recently concluded 2015 Davao Trade Expo at the SMX Convention Center here. Alcala lauded the high performances of the livestock and poultry sectors in Davao region for registering an increased production output of 2.34 percent to 3.6 percent. Data provided by the agriculture department states that Davao region’s hog production increased from 127,700 metric tons (MT) in 2010 to 136,200 MT in 2014;\n chicken production from 60,700 MT in 2010 to 68,400 MT in 2014;\n and cattle production from 11,400 MT in 2010 to 12,400 MT in 2014, the data added. (Manila Bulletin, 10/02/2015)','','','','','Davao City','','Davao Region','Philippines',7.190708,125.455341),(640,0,23,3,'About 200 delegates composed of contractors, exporters and importers, logistics companies, and the micro, small and medium enterprises (MSMEs) from various parts of the country will gather on Monday next week, October 5 at the Marco Polo Hotel here for the Brunei Darussalam-Indonesia-Malaysia-Philippines East ASEAN Growth Area (BIMP-EAGA) Trade, Tourism and Investment Forum. The event will be hosted by the Department of Trade and Industry in Davao region (DTI-11), the Department of Tourism (DOT 11), Mindanao Development Authority (MinDA), Mindanao Business Council (MinBC) and the City Government of Davao. The gathering is expected to become the platform for convergence of the BIMP-EAGA clusters and development partners to present business and investment opportunities, including the priority programs and projects of those in the national and sub-regional economic growth corridors. (Manila Bulletin, 10/02/2015)','','','','','Davao City','','Davao Region','Philippines',7.190708,125.455341),(641,0,24,3,'The Department of Agriculture in Davao Region has intensified its campaign against the Banana Fusarium Disease that afflicts the banana industry by enhancing broadcast skills of community information officers involved in the disease management. (Gov.ph, 10/08/2015)','','','','','Davao City','','Davao Region','Philippines',7.190708,125.455341),(642,0,24,3,'Noel Provido, Regional Information Officer of the DA 11 said the activity is outcome of the initial gathering among community information officers in Tagum City recently, where they asked for improving their knowledge in handling agriculture information through broadcast. “We need to hone the skills of our partners for them to effectively address this problem that affects the banana farmers through the broadcast media,” he said. (Gov.ph, 10/08/2015)','','','','','Davao City','','Davao Region','Philippines',7.190708,125.455341),(643,0,24,3,'The Promusa, a knowledge-sharing platform on bananas defined Fusarium wilt of banana or Panama disease as a lethatl fungal disease caused by the soil-borne fungus called Fusarium oxysporum f.sp. cubense where it enters the plant through the roots and colonizes the xylem vessels thereby blocking the flow of water and nutrients. Disease progression results in the collapse of leaves at the petiole, the splitting of the pseudostem base and eventually plant death. Once established in a field, the fungus persists in soil for an indefinite period of time and cannot be managed using chemical pesticides. (Gov.ph, 10/08/2015)','','','','','Davao City','','Davao Region','Philippines',7.190708,125.455341),(644,0,24,3,'The solution best adapted to the continued production of bananas in infested soils is replacing susceptible cultivars by resistant ones. Fusarium wilt is the first disease of bananas to have spread globally. (Gov.ph, 10/08/2015)','','','','','Davao City','','Davao Region','Philippines',7.190708,125.455341),(645,0,25,4,'THE Department of Education (DepEd) in Davao Region is conducting early registration for incoming senior high school students, starting October 12 until October 23. (Sun Star Davao, 10/11/2015)','','','','','','','Davao Region','Philippines',7.3041622,126.0893406),(646,0,25,4,'DepEd-Davao Supervisor for English and K to 12 program focal person Janet Veloso said this initiative, which will be conducted nationwide, aims to ensure enrollment of incoming senior high school students when the program is implemented in 2016-2017. (Sun Star Davao, 10/11/2015) \'','','','','','','','Davao Region'