lippines',7.3041622,126.0893406),(853,0,31,2,'Chief Insp. Aldrin Gonzales, spokesman of the Central Mindanao police, said they also received information that the victims and the gunmen were seen passing by the waters of Glan town of Sarangani on Friday. “We immediately deployed our personnel there but it turned out negative. Up to now, we are continuously monitoring,” said Gonzales. So far, military intelligence reports indicate that the victims and the gunmen have already slipped past the Naval blockade and successfully arrived in Sulu either on Thursday or Friday. (Manila Bulletin, 09/27/2015)','','','','','','','Davao Region','Philippines',7.3041622,126.0893406),(854,0,32,2,'One person was killed and 48 others injured Friday as a parked car exploded in the southern Philippines, with the local authorities blaming the blast on al-Qaeda-linked Islamic militants. (GMA News Online, 01/23/2015)','','','','','Zamboanga','','Zamboanga Peninsula','Philippines',6.9214424,122.0790267),(855,0,32,2,'Witnesses told police a parked car went up in flames and was torn to pieces in a powerful mid-afternoon blast that shattered glass panels in a commercial section on Zamboanga city\'s outskirts. (GMA News Online, 01/23/2015)','','','','','Zamboanga','','Zamboanga Peninsula','Philippines',6.9214424,122.0790267),(856,0,32,2,'\"There was a suspected bomb in the car,\" Senior Superintendent Angelito Casimiro, the city police chief, told reporters. The explosion occurred in front of a pub and across the street from a bus terminal, he said. (GMA News Online, 01/23/2015)','','','','','Zamboanga','','Zamboanga Peninsula','Philippines',6.9214424,122.0790267),(857,0,32,2,'No group has claimed responsibility for the blast and the lone fatality was not immediately identified, he said. Most of the other casualties were cut from flying glass shards and are being treated at nearby hospitals, Casimiro added.(GMA News Online, 01/23/2015)','','','','','Zamboanga','','Zamboanga Peninsula','Philippines',6.9214424,122.0790267),(858,0,32,2,'Zamboanga city Mayor Maria Isabelle Climaco alleged the blast was linked to a plan by the Abu Sayyaf armed group to spring 57 comrades detained at the city jail. She demanded that the national government remove the prisoners from the city and transfer them to a detention facility elsewhere so the city would not be targeted by bombings. \"This is an SOS call for the 57 inmates to be removed and transferred for the safety and protection of the city,\" Climaco told reporters. (GMA News Online, 01/23/2015)','','','','','Zamboanga','','Zamboanga Peninsula','Philippines',6.9214424,122.0790267),(859,0,34,2,'Four Philippine Army soldiers and one New People\'s Army (NPA) rebel were killed during a shootout Saturday night at a Davao Oriental police station. According to a report by GMA News\' Unang Balita’s Real Sorroche, not less than 50 NPA rebels attacked a police station in Mati City, Davao Oriental on February 14. (GMA News Online, 02/16/2015)','','','','','Mati','Davao Oriental','Davao Region','Philippines',6.9543253,126.2668131),(860,0,34,2,'The NPA rebels were able to enter the station but the 30 officers on duty were able to defend it from being complete taken. (GMA News Online, 02/16/2015)','','','','','Mati','Davao Oriental','Davao Region','Philippines',6.9543253,126.2668131),(861,0,34,2,'The NPA escaped in three vans after soldiers arrived, leaving behind a truck. When the soldiers gave chase, a landmine exploded, killing three soldiers and injuring one. Another soldier was killed when he passed by an NPA checkpoint. (GMA News Online, 02/16/2015)','','','','','Mati','Davao Oriental','Davao Region','Philippines',6.9543253,126.2668131),(862,0,34,2,'According to 10th Infantry Division public affairs officer 1Lt. Vergel Lacambra, the insurgents attacked the police station around 7:30 p.m. Soldiers from the 701st Brigade caught up with the retreating gunmen. (GMA News Online, 02/16/2015)','','','','','Mati','Davao Oriental','Davao Region','Philippines',6.9543253,126.2668131),(863,0,34,2,'\"Responding Army troops engaged the withdrawing enemy and a firefight erupted in a running gunbattle resulting in two [soldiers wounded] and one enemy killed,\" Lacambra said. (GMA News Online, 02/16/2015)','','','','','Mati','Davao Oriental','Davao Region','Philippines',6.9543253,126.2668131),(864,0,34,2,'Col. Bienvenido Datuin, commander of the 701st Brigade, said that joint AFP-PNP personnel based in Mati had contained the situation, with pursuing troops now tracking the attackers. Meanwhile, 10th ID commander Maj. Gen. Eduardo Año called the attack a \"desperate nuisance move\" by the insurgents. (GMA News Online, 02/16/2015)','','','','','Mati','Davao Oriental','Davao Region','Philippines',6.9543253,126.2668131),(865,0,35,2,'Security forces launched a massive hunt for the bombers that set off Friday night two explosives near a mosque in a police camp in Jolo town in Sulu that injured at least 18 people.(Philippine Star, 05/30/2015)','','','','','Jolo','Sulu','Autonomous Region in Muslim Mindanao','Philippines',6.0473648,121.0089611),(866,0,35,2,'The first explosion hit outside mosques at the compound of Police Senior Superintendent Julasirim Kasim at Barangay Asturias about around 7:30 p.m. that left seven civilians, including three minors injured. (Philippine Star, 05/30/2015)','','','','','Jolo','Sulu','Autonomous Region in Muslim Mindanao','Philippines',6.0514256,121.0032126),(867,0,35,2,'A more powerful improvised explosive device, planted just several meters away from where the fragmentation grenade went off, exploded just as responding policemen were trying to cordon the scene for a post-blast examination. (Philippine Star, 05/30/2015)','','','','','Jolo','Sulu','Autonomous Region in Muslim Mindanao','Philippines',6.0514256,121.0032126),(868,0,35,2,'The second explosion injured 11 police operatives, among them an officer, Senior Inspector Jeremy Dogao, who sustained shrapnel wounds in different p