,125.6323118),(945,0,33,6,'Nephrology Center of Davao City','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.0987399,125.6242223),(946,0,33,6,'UM Medical and Multitest Diagnostic Center Inc.','','','','Poblacion District','Davao City','Davao del Sur','Davao Region','Philippines',7.0693061,125.609794),(947,0,33,6,'Polyclinic Davao Inc.','','','','Poblacion District','Davao City','Davao del Sur','Davao Region','Philippines',7.0695776,125.6152626),(948,0,33,6,'SES Davao Diagnostics','','','','','Davao City','Davao del Sur','Davao Region','Philippines',7.0987399,125.6242223),(949,0,36,7,'A magnitude 5.4 earthquake shook Occidental Mindoro on Monday evening, October 19, according to the Philippine Institute of Volcanology and Seismology (Phivolcs).',NULL,NULL,NULL,NULL,NULL,'Occidental Mindoro','MIMAROPA','Philippines',13.1024111,120.76512839999998),(950,0,36,7,'A magnitude 5.4 earthquake shook Occidental Mindoro on Monday evening, October 19, according to the Philippine Institute of Volcanology and Seismology (Phivolcs).',NULL,NULL,NULL,NULL,NULL,'Occidental Mindoro','MIMAROPA','Philippines',13.1024111,120.76512839999998),(951,0,36,7,'A magnitude 5.4 earthquake blah blah blah',NULL,NULL,NULL,NULL,NULL,'Occidental Mindoro','MIMAROPA','Philippines',13.1024111,120.76512839999998),(952,0,36,2,'q',NULL,NULL,NULL,NULL,NULL,'Occidental Mindoro','MIMAROPA','Philippines',13.1024111,120.76512839999998),(953,0,1,2,'Davao is amazing',NULL,NULL,NULL,NULL,'Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.45534099999998),(954,0,37,1,'Mayor Dario Otaza of Loreto town in Agusan del Sur and his son Daryl were found dead just hours after unidentified armed men, reportedly wearing uniforms of the National Bureau of Investigation (NBI), abducted them',NULL,NULL,NULL,NULL,NULL,'Agusan del Sur','Caraga','Philippines',8.6051665,125.916739),(955,0,37,1,'According to the 401st Infantry Brigade, some 18 armed men kidnapped Otaza and his son at their home in Barangay Baan Riverside in Butuan City at around 6:45 p.m. on Monday.\n\nTroops going after the kidnappers, suspected to be members of the New People\'s Army, found the bodies of father and son at around 6:50 a.m on Tuesday in Purok 2, Barangay Bitang-again in the same city.',NULL,NULL,NULL,NULL,NULL,'Agusan del Sur','Caraga','Philippines',8.6051665,125.916739),(956,0,37,1,'The bodies were hogtied and had several gunshot wounds.\n\nLast September 21, Otaza led the Agusan del Sur Provincial Tribal Council into signing a manifesto that condemned what it called the exploitation and abuses committed on lumads (native persons) by the NPA, along with the Communist Party of the Philippines (CPP) and the National Democratic Front (NDF).\n\nThe manifesto also declared the ancestral domain of lumads off limits to the CPP-NPA-NDF.',NULL,NULL,NULL,NULL,NULL,'Agusan del Sur','Caraga','Philippines',8.6051665,125.916739),(958,0,39,2,'Two Chinese diplomats have been killed and a third wounded in a shooting at a restaurant in Cebu in the Philippines.',NULL,NULL,NULL,NULL,'Cebu City','Cebu','Central Visayas','Philippines',10.3156992,123.88543660000005),(959,0,39,2,'The deputy consul and the finance officer for the Chinese consulate in the city were killed and the consul general wounded, police said.\nThe consul general, Song Ronghua, who was celebrating his birthday at the restaurant, is in a stable condition after being shot through the neck.',NULL,NULL,NULL,NULL,'Cebu City','Cebu','Central Visayas','Philippines',10.3156992,123.88543660000005),(960,0,39,2,'Police have arrested a woman who works at the consulate and her husband.\nReports vary as to who fired the shot.\n\"We\'re still trying to determine the motive for the shooting,\" said Chief Superintendent Prudencio Banas.\nThe consul general\'s male deputy, Sun Shen, was shot in the neck and finance officer Li Hui, a woman, was shot in the head, police said.\nA handgun has been recovered from the scene, police spokesman Wilben Mayor told AFP news agency.',NULL,NULL,NULL,NULL,'Cebu City','Cebu','Central Visayas','Philippines',10.3156992,123.88543660000005),(961,0,40,1,'A day after the bullet-riddled bodies of Mayor Dario Otaza of Loreto town and his son, Daryl, were found in a remote village here, the Philippine National Police on Tuesday relieved the police chiefs of Agusan del Sur province and this city from their posts.',NULL,NULL,NULL,NULL,'Butuan City','Agusan Del Norte','Caraga','Philippines',8.9475377,125.54062339999996),(962,0,40,1,'Senior Supt. Joseph Plaza, provincial police director, and Senior Supt. Francisco Dungo, city police chief, were removed pending the outcome of an investigation into purported security and intelligence lapses that led to the abduction and execution of Otaza and his son, said Supt. Martin Gamba, spokesperson for the Caraga police.',NULL,NULL,NULL,NULL,'Butuan City','Agusan Del Norte','Caraga','Philippines',8.9475377,125.54062339999996),(963,0,40,1,'On Monday, armed men disguised as agents of the National Bureau of Investigation barged into the mayor’s house here shortly after he arrived past 6 p.m. and forcibly took him and his 27-year-old son. The next day, their bodies were recovered, hogtied and riddled with bullets.',NULL,NULL,NULL,NULL,'Butuan City','Agusan Del Norte','Caraga','Philippines',8.9475377,125.54062339999996),(964,0,40,1,'On Monday, armed men disguised as agents of the National Bureau of Investigation barged into the mayor’s house here shortly after he arrived past 6 p.m. and forcibly took him and his 27-year-old son. The next day, their bodies were recovered, hogtied and riddled with bullets.',NULL,NULL,NULL,NULL,'Butuan City','Agusan Del Norte','Caraga','Philippines',8.9475377,125.54062339999996),(965,0,40,2,'Police, military and politicians in the Caraga region have condemned the death of Otaza, 53, a Manobo and a former communist rebel who became an outspoken critic of the New People’s Army (NPA) after he was elected in 2013.',NULL,NULL,NULL,NULL,'Butuan City','Agusan Del Norte','Caraga','Philippines',8.9475377,125.54062339999996),(966,0,41,2,'THE BENGUET police chief has been sacked due to the high number of casualties and the lack of preparation in the province during the onslaught of Typhoon “Lando” (international name: Koppu).\nInterior Secretary Mel Senen Sarmiento relieved Senior Supt. David Lacdan on Wednesday.',NULL,NULL,NULL,NULL,NULL,'Benguet','Cordillera Administrative Region','Philippines',16.5577257,120.80394739999997),(967,0,41,2,'The number of fatalities in Benguet shot up from only two by Wednesday morning to 11 by Wednesday afternoon, bringing the total number of reported deaths nationwide from 26 to 35 within the day.',NULL,NULL,NULL,NULL,NULL,'Benguet','Cordillera Administrative Region','Philippines',16.5577257,120.80394739999997),(968,0,41,2,'The Philippine National Police spokesperson, Chief Supt. Wilben Mayor, said in a press briefing that Lacdan’s relief would “serve as a warning” to other police officers tapped for disaster response.\n“The PNP already established standard operating procedures when it comes to disasters. We have a disaster incident management task group, and it is expected from the police to be proactive,” Mayor said.',NULL,NULL,NULL,NULL,NULL,'Benguet','Cordillera Administrative Region','Philippines',16.5577257,120.80394739999997),(969,0,41,2,'The Philippine National Police spokesperson, Chief Supt. Wilben Mayor, said in a press briefing that Lacdan’s relief would “serve as a warning” to other police officers tapped for disaster response.\n“The PNP already established standard operating procedures when it comes to disasters. We have a disaster incident management task group, and it is expected from the police to be proactive,” Mayor said.',NULL,NULL,NULL,NULL,NULL,'Benguet','Cordillera Administrative Region','Philippines',16.5577257,120.80394739999997),(970,0,41,2,'The Philippine National Police spokesperson, Chief Supt. Wilben Mayor, said in a press briefing that Lacdan’s relief would “serve as a warning” to other police officers tapped for disaster response.\n“The PNP already established standard operating procedures when it comes to disasters. We have a disaster incident management task group, and it is expected from the police to be proactive,” Mayor said.',NULL,NULL,NULL,NULL,NULL,'Benguet','Cordillera Administrative Region','Philippines',16.5577257,120.80394739999997),(972,0,42,7,'They stood up and waited excitedly as President Aquino and other officials arrived at the municipal hall here to provide assistance and listen to their concerns.\n\nThey were back on their feet, literally and figuratively, after being in the eye of Typhoon Lando (Koppu) just last Sunday. And officials said this town could be the model for disaster preparedness despite meager resources.',NULL,NULL,NULL,NULL,'Casiguran','Aurora','Central Luzon','Philippines',16.2277929,122.06331950000003),(973,0,42,7,'“I just want to convey to everyone our gratefulness for the efficient preparations. Maybe starting from you (Aquino) on top who gave the orders, along with our governor, mayor... they kept on reminding us captains to force the people to be evacuated so there had not been much problem in our barangays, except for destroyed houses and crops. Thank you very much on behalf of our barangays. Thank you to the staff of Casiguran, you are all hardworking,” an enthusiastic Conchita Descarga, barangay captain of Calabgan, said to the applause and cheers of the audience. \n\nThe President, his Cabinet members and other visiting officials laughed, obviously pleased with Descarga’s energetic expression of thankfulness. ',NULL,NULL,NULL,NULL,'Casiguran','Aurora','Central Luzon','Philippines',16.2277929,122.06331950000003),(974,0,42,7,'“Everyone now has the permission to keep on prodding (the barangay captains) the next time,” Aquino said. \n\nSocial Welfare Secretary Corazon Soliman told the audience that such display of gratefulness and strong cooperation among people would give them the enthusiasm to keep on working for their welfare.',NULL,NULL,NULL,NULL,'Casiguran','Aurora','Central Luzon','Philippines',16.2277929,122.06331950000003),(975,0,42,7,'“Everyone now has the permission to keep on prodding (the barangay captains) the next time,” Aquino said. \n\nSocial Welfare Secretary Corazon Soliman told the audience that such display of gratefulness and strong cooperation among people would give them the enthusiasm to keep on working for their welfare.',NULL,NULL,NULL,NULL,'Casiguran','Aurora','Central Luzon','Philippines',16.2277929,122.06331950000003),(976,0,43,1,'The approval of the controversial proposed Bangsamoro Basic Law (BBL) remains a challenge for the House of Representatives, Speaker Feliciano Belmonte Jr. said yesterday.\n\n“This BBL is quite challenging for us,” he said.\n\nHe said he and other leaders of the chamber would try to finish floor debates on the measure and put it to a vote before the Christmas recess of Congress, which starts on Dec. 19.',NULL,NULL,NULL,NULL,'Manila',NULL,'Metro Manila','Philippines',14.5995124,120.9842195),(977,0,43,1,'He said he would like the four or five remaining members who have questions about the proposed law “to elicit new facts and not repeat what the others have been asking for the last half-year.”\n\nThat would shorten plenary debates, after which the House goes into the period of amending the draft BBL, he added.\n\nAfter the amendments, the chamber puts the measure to a vote.',NULL,NULL,NULL,NULL,'Manila',NULL,'Metro Manila','Philippines',14.5995124,120.9842195),(978,0,43,1,'Cagayan de Oro City Rep. Rufus Rodriguez, who chairs the ad hoc committee on the BBL and is principal sponsor of the measure, said there is still time for the House to approve the proposed law.\n\n“We will reconvene on Nov. 3. We have six weeks up to Dec. 16 or 19 to do it. We have to pass the draft BBL for the sake of peace,” he said.',NULL,NULL,NULL,NULL,'Manila',NULL,'Metro Manila','Philippines',14.5995124,120.9842195),(979,0,43,1,'Zamboanga City Rep. Celso Lobregat is not as optimistic. He is one of several members who still have a lot of questions for Rodriguez and his co-sponsors of the measure.\n\nHe expressed doubts on whether the House could meet its new deadline of voting on the draft BBL before the Christmas recess of Congress.\n\n“This is a moving timeline. The first deadline was in June, before the adjournment of the second regular session. The second is before our first recess on Oct. 10. So Dec. 16 before the Christmas break is the new deadline,” he said.\n\nHe said a lot of debates could still happen even during the period for amendments.\n\nHe said lack of quorum could derail approval of the proposed BBL before the Christmas recess.',NULL,NULL,NULL,NULL,'Manila',NULL,'Metro Manila','Philippines',14.5995124,120.9842195),(980,0,44,2,'Around 300 residents of a remote village in Malungon town in Sarangani Province have fled their homes following alleged harassment by armed members of the New People’s Army (NPA) in the area.',NULL,NULL,NULL,NULL,'General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.17161799999997),(981,0,44,2,'Malungon Mayor Reynaldo Constantino said Wednesday the residents of Sitios Mahayahay, Malaygang and Bulay in Barangay San Juan were forced to leave their homes after NPA rebels under its Front 75 reportedly harassed their communities on Monday night.\n\nHe said the rebels allegedly threatened the residents and fired several shots, although not one of them was harmed.\n\n“(They) decided to just leave their communities due to fears of more harassments from the rebels,” he said.',NULL,NULL,NULL,NULL,'Malungon','Sarangani','Region XII','Philippines',6.3343032,125.25879639999994),(982,0,44,2,'The mayor said that as of Wednesday morning, some 99 families or around 300 individuals have already evacuated to the barangay proper of San Juan and the neighboring villages.\n\nAhasueris Keen Pacheco, coordinator of the Malungon municipal disaster risk reduction and management council, said they already delivered some food packs and other relief items to the evacuees.',NULL,NULL,NULL,NULL,'Malungon','Sarangani','Region XII','Philippines',6.3343032,125.25879639999994),(983,0,44,2,'He said they are currently preparing for the delivery of more relief supplies to the area “as they expect the number of evacuees to increase in the coming days.”\n\n“We have not even listed yet those who just arrived in the evacuation centers and according to reports, more evacuees will be arriving today,” Pacheco said.',NULL,NULL,NULL,NULL,'Malungon','Sarangani','Region XII','Philippines',6.3343032,125.25879639999994),(984,0,44,2,'Chief Insp. Lurobe Rojo, Malungon police chief, said the NPA rebels initially came to the area last June 13 and abducted two officials of Barangay San Juan.\n\nHe said Barangay San Juan councilors Tirso Manambay and Edgar Tamalon were on their way home to the barangay proper at around 7 p.m. when they were taken at gunpoint by the NPA rebels.\n\nBut the rebels released the two officials unharmed about three hours later following negotiations made by their relatives.',NULL,NULL,NULL,NULL,'Malungon','Sarangani','Region XII','Philippines',6.3343032,125.25879639999994),(985,0,44,2,'Capt. Rey Balibagoso, spokesperson of the Army’s 1002nd Brigade, said they received reports that the NPA rebels had planned to use the two victims as human shields in an ongoing military offensive operation in the area.\n\nHe identified the leader of the group responsible for the abduction as a certain Manuel Garduque alias Dodong Sidlak, leader of Platoon Uno of the NPA Guerrilla Front 75, which operates in the hinterlands of Sarangani and Davao Occidental provinces.',NULL,NULL,NULL,NULL,'Malungon','Sarangani','Region XII','Philippines',6.3343032,125.25879639999994),(986,0,45,2,'A news crew of broadcast network ABS-CBN was allegedly harassed by an agent of the Philippine Drug Enforcement Agency (PDEA) while they were on coverage in Maitum town, Sarangani province Tuesday, the National Union of Journalists of the Philippines (NUJP) said Friday.',NULL,NULL,NULL,NULL,'Maitum','Sarangani','Region XII','Philippines',6.124080800000001,124.48635669999999),(987,0,45,2,'An alert issued by the NUJP\'s Mindanao Safety Office said cameraman Randy Estrella was approached by a PDEA agent who refused to identify himself and ordered to stop shooting footage.\n\nThe agent allegedly told Estrella: \"Bantay ka lang \'pag lumabas \'yan (You better watch out if that comes out).\"',NULL,NULL,NULL,NULL,'Maitum','Sarangani','Region XII','Philippines',6.124080800000001,124.48635669999999),(988,0,45,2,'An alert issued by the NUJP\'s Mindanao Safety Office said cameraman Randy Estrella was approached by a PDEA agent who refused to identify himself and ordered to stop shooting footage.\n\nThe agent allegedly told Estrella: \"Bantay ka lang \'pag lumabas \'yan (You better watch out if that comes out).\"',NULL,NULL,NULL,NULL,'Maitum','Sarangani','Region XII','Philippines',6.124080800000001,124.48635669999999),(989,0,45,2,'When confronted by TV Patrol Socsksargen reporter Jay Dayupay, the agent said: \"Parati niyo kaming binibira sa mga huli namin sa Silway\" (You are always criticizing our operations in Silway),\" a reference to a PDEA operation  on February 18.   \n',NULL,NULL,NULL,NULL,'Maitum','Sarangani','Region XII','Philippines',6.124080800000001,124.48635669999999),(990,0,45,2,'The ABS-CBN news team was in Maitum to follow up on a story on a drug raid by police and PDEA personnel earlier in the day. Senior Superintendent Florendo Quidilla, Sarangani police director, confirmed the operation and told the team they recovered some P 70,000 worth of methamphetamine hydrochloride, or shabu. \n\nDayupay told the NUJP that the harassment apparently stemmed from earlier reports on complaints by Silway residents about the alleged rough treatment by PDEA personnel during the earlier raid.',NULL,NULL,NULL,NULL,'Maitum','Sarangani','Region XII','Philippines',6.124080800000001,124.48635669999999),(991,0,45,2,'The ABS-CBN reporter said they have already lodged a complaint with the PDEA Region 12 office in General Santos City.\n\nHowever, the NUJP said PDEA-12 spokesman Wilson Esparcia refused to identify the agent who harassed the news team, calling the incident a mere misunderstanding. \n\nDayupay said they also reported the incident to the Investigation, Detection and Management Section or IDMS of the Gensan police.',NULL,NULL,NULL,NULL,'Maitum','Sarangani','Region XII','Philippines',6.124080800000001,124.48635669999999),(992,0,47,6,'Fly to General Santos City. From Manila, that’s a one-and-a-half-hour flight. Take a van to Sarangani. These aren’t van rentals per se, but vans that take travellers to Sarangani on a regular basis. The fare for the one-hour ride costs P20 per person.',NULL,NULL,NULL,NULL,NULL,'Sarangani','Region XII','Philippines',5.926717500000001,124.99475099999995),(993,0,47,6,'There are no trains in Sarangani.',NULL,NULL,NULL,NULL,NULL,'Sarangani','Region XII','Philippines',5.926717500000001,124.99475099999995),(994,0,47,6,'There is a bus station in Glan, Sarangani called E. Alegado Transport Station.',NULL,'National Highway',NULL,NULL,'Glan','Sarangani','Region XII','Philippines',5.7507399,125.23328620000007),(995,0,46,3,'The town of Maasim in Sarangani is seeking to expand its existing economic zone to accommodate the strong interest of the private sector to locate in the area, its top executive said.\n\nIn an interview, Maasim Mayor Aniceto P. Lopez Jr. said there is a deluge of companies in different industries sending intent letters to locate in the Kamanga Agro-Industrial Economic Zone (KAIEZ).',NULL,NULL,NULL,NULL,'Maasim','Sarangani','Region XII','Philippines',5.926717500000001,124.99475099999995),(996,0,46,3,'Among those companies is local cement maker Holcim Philippines and some textile companies from Cebu and Davao.\n\n“The local government is proposing to Philippine Economic Zone Authority (PEZA) to expand the ecozone to 500 hectares,” he said.\n\n“Basing on the number of interested locators, the existing 60-hectare ecozone will not be enough,” the mayor added.',NULL,NULL,NULL,NULL,'Maasim','Sarangani','Region XII','Philippines',5.926717500000001,124.99475099999995),(997,0,46,3,'The 54.6-hectare KAIEZ is one of the two ecozones in the province of Sarangani. It is operated by Kamanga Agro-Industrial Ecozone Development Corp., which is part of the Alcantara Group.\n\nCurrently, 28 hectares is being occupied by the 201-megawatt (MW) coal-fired power plant of Alsons Powers Sarangani Energy Corp. (SEC), which is also part of the Alcantara Group.\n\nAlsons Power project implementation vice president and head of coal operations Nicandro Fucoy said the group is inviting other locators to the ecozone.',NULL,NULL,NULL,NULL,'Maasim','Sarangani','Region XII','Philippines',5.926717500000001,124.99475099999995),(998,0,48,2,'GENERAL SANTOS CITY- The New’s People’s Army-Front Committee 71 has owned up to the burning last Tuesday of three heavy equipment owned by a private contractor which is undertaking a government road project in a remote barangay in Malapatan, Sarangani.\n',NULL,NULL,NULL,NULL,'Malapatan','Sarangani','Region XII','Philippines',5.966338599999999,125.28537779999999),(999,0,48,2,'Some 60 NPA rebels stormed the construction compound in sitio Datal Bob, Barangay Daan Suyan shortly after midnight Tuesday and ordered all construction workers to get out of the compound before they set on fire the heavy equipment worth P5 million.\n',NULL,'Sarangani-Davao del Sur Coastal Road',NULL,NULL,'Malapatan','Sarangani','Region XII','Philippines',5.966137817239075,125.28539787686896),(1000,0,49,3,' Sarangani Energy Corp. (SEC), a unit of Alsons Power, has delayed the commercial operation of the first 105-megawatt section of its 210-MW coal-fired power plant in the province to January 2016, one month behind the earlier target set.\n\nThe company, however said, the development would help provide a lasting and sustainable solution to Mindanao’s five-year-old power shortage.',NULL,NULL,NULL,NULL,'Maasim','Sarangani','Region XII','Philippines',5.926717500000001,124.99475099999995),(1001,0,49,3,'The company is also currently working on the details of Phase 2 for the SEC plant, to have a total capacity of 210 MW by 2018.\n\nRunning at full capacity by then, it will service a total of six million, expanding its coverage area to the entire province of South Cotabato and the provinces of Davao del Sur, Zamboanga del Norte and Zamboanga del Sur and key areas in Misamis Oriental and North Cotabato. It will also service the cities of Cagayan de Oro, Dapitan, Digos, Dipolog, Koronadal, Kidapawan, and Pagadian.\n\nThe SEC coal-fired power plant is the single largest investment in the province of Sarangani and the entire Region 12 at $570 million.',NULL,NULL,NULL,NULL,'Maasim','Sarangani','Region XII','Philippines',5.926717500000001,124.99475099999995),(1002,0,49,3,'In a briefing yesterday, Alsons Power project implementation vice president and head of coal operations Nicandro Fucoy said the Phase 1 of the project is 97.91 percent complete as of end-July.\n\nThe project, which costs $309 million, would begin commissioning by October and would start operating by end-January 2016.',NULL,NULL,NULL,NULL,'Maasim','Sarangani','Region XII','Philippines',5.926717500000001,124.99475099999995),(1003,0,49,3,'Earlier this year, the company said Phase 1 of the project is intended to start commissioning in the first half of 2015 and eventually commence commercial operations in the fourth quarter.\n\nBut once operational, Fucoy said the plant’s first section would provide power to more than three million residents in the provinces of Sarangani, Compostela Valley, Agusan del Norte, and Agusan del Sur; the cities of General Santos, Iligan, Bayugan, Butuan, Samal, and Tagum as well as key municipalities in Davao del Norte and South Cotabato.',NULL,NULL,NULL,NULL,'Maasim','Sarangani','Region XII','Philippines',5.926717500000001,124.99475099999995),(1004,0,48,2,'The NPA spokesperson claimed that the management of Jargon construction firm did not heed to their demand for revolutionary taxes despite the letter they had sent to the owner.\n\n“The incident will serve as a warning to all private contractors who are undertaking projects in NPA strongholds to pay revolutionary taxes otherwise they will suffer the same fate,” Mahusay said.\n\nThe NPA-Alex Ababa Command is operating in the provinces of Sarangani and Davao del Sur.',NULL,NULL,NULL,NULL,'Malapatan','Sarangani','Region XII','Philippines',5.966338599999999,125.28537779999999),(1005,0,48,2,'\nLt Col Shalimar Imperial, 27th Infantry Battalion commander, said the NPA is engaged in extortion activities called “Rebolusyonaryong Buwis sa Kaaway na Uri” (RBKU) designed to mulct companies not just merely for logistical and financial support but mainly to paralyze their operations and displace workers of the company.',NULL,NULL,NULL,NULL,'Malapatan','Sarangani','Region XII','Philippines',5.966338599999999,125.28537779999999),(1006,0,48,2,'“The NPA does not want the entry of development projects in the countryside so that it can perpetuate issues against the government for their propaganda and deception schemes,” Imperial said.\n\nImperial said the NPA, the armed-wing of the Communist Party of the Philippines, launched the attack amid the government’s unilateral declaration of Suspension of Military Operations (SOMO) against NPA rebels effective December 21, 2013 to January 15, 2014. “The incident showed the treacherous nature of the NPA rebels and their utter disregard to any peace initiative,” Imperial said.',NULL,NULL,NULL,NULL,'Malapatan','Sarangani','Region XII','Philippines',5.966338599999999,125.28537779999999),(1007,0,50,1,'Nagsagawa ng kilos-protesta ang mahigit 100 miyembro ng militanteng grupo kasabay ng paggunita ng Philippine-American Friendship Day celebration.\n\nAyon kay Ryan Lariba, presidente ng Bayan Muna-Socsargen, patuloy nilang kinokondena ang umano\'y pakikialam Amerika sa pamahalaang Pilipinas.\n',NULL,NULL,NULL,NULL,NULL,'Sarangani','Region XII','Philippines',5.926717500000001,124.99475099999995),(1008,0,50,1,'Higit umano nilang kinokondena ngayon ang isinasagawang naval exercises sa Sarangani province.\n\nAni Lariba, isa lamang umanong panloloko ang ginagawa ng US upang sang-ayunan ang nasabing Philippine-US naval exercises.\n\nWala rin umano itong silbi dahil wala silang nakikitang mga pagbabago o modernisasyon sa mga kagamitang pandigma ng mga sundalong Pinoy.\n',NULL,NULL,NULL,NULL,NULL,'Sarangani','Region XII','Philippines',5.926717500000001,124.99475099999995),(1009,0,50,1,'Mula sa GenSan, tumulak ang grupo papuntang Alabel Glan, Sarangani kung saan mayroon isa pang grupo ng mga militante ang naghihintay sa kanila para sa iba pang programa.\n\nMeron din silang isinagawang aktibidad sa Oval Plaza sa lungsod ng GenSan.',NULL,NULL,NULL,NULL,NULL,'Sarangani','Region XII','Philippines',5.926717500000001,124.99475099999995),(1010,0,48,2,'Rogelio Tamayo, regional director of Department of Public Works and Highways, had earlier appealed to military authorities to secure private contractors undertaking government projects in the wake of series of burning incidents involving heavy equipment of private construction firms.\n',NULL,NULL,NULL,NULL,'Malapatan','Sarangani','Region XII','Philippines',5.966338599999999,125.28537779999999),(1011,0,48,2,'Last September, suspected NPA rebels also burned the heavy equipment of VT Lao construction firm in Barangay Bagacay, Alabel, Sarangani.',NULL,NULL,NULL,NULL,'Alabel','Sarangani','Region XII','Philippines',6.110931900000001,125.312457),(1012,0,48,2,'Early last year, suspected Moro rebels also set on fire the heavy equipments of Jargon construction firm in a hinterland village in Maitum, Sarangani.',NULL,NULL,NULL,NULL,'Maitum','Sarangani','Region XII','Philippines',6.124080800000001,124.48635669999999),(1013,0,51,4,'Calling it a stepping stone towards achieving lasting peace in Mindanao, local government officials of Sarangani Province, with the assistance of the Local Monitoring Team, spearheaded the conduct of Peace Forum on March 31, 2015 at the Provincial Capitol Gymnasium, Alabel, Sarangani Province, with the theme : “ PEACE is EVERYONE’s RESPONSIBILITY “.',NULL,NULL,NULL,NULL,'Alabel','Sarangani','Region XII','Philippines',6.185032500000001,125.34662530000003),(1014,0,51,4,'The forum, graced by government chief negotiator Miriam Coronel-Ferrer of the GRP Peace Panel, focused on the significant provisions of the Bangsamoro Basic Law (BBL). The event brought significant awareness to the Sarangans relative to the continuing peace process with the Moro Islamic Liberation Front (MILF).',NULL,NULL,NULL,NULL,'Alabel','Sarangani','Region XII','Philippines',6.185032500000001,125.34662530000003),(1015,0,51,4,'Governor Steve C. Solon showed his noble intention of fully supporting the passage of the BBL. “While it is true that not all provinces in Mindanao will be considered part of the proposed BBL regional core areas, they would still benefit from the BBL’s implementations. Just imagine the tremendous benefit that we will all get when we have genuine and lasting peace here in Mindanao“, the governor said. \nThe conduct of the Tri-People Prayer Rally led by Sr. Gladella N. Enanoria, SMSM Peace Educator Center Coordinator of the Notre Dame of Dadiangas University and the turn-over of livelihood cash assistance to the nine (9) FRs of Sarangani, in the amount of PhP 65,000.00 per person through the DILG’s Comprehensive Local Integration Program (CLIP), were simultaneously conducted during the Peace Forum.',NULL,NULL,NULL,NULL,'Alabel','Sarangani','Region XII','Philippines',6.185032500000001,125.34662530000003),(1016,0,51,4,'Local government officials, community leaders, representatives of various sectoral groups and officers of the different national agencies, joined the said activity. LGMED Chief Ester P. Valdez representing Regional Director Reynaldo M. Bungubung, CESO IV, Sarangani Provincial Director Flor G. Limpin, Regional Legal Officer Atty. Rhys Guiamadel and other members of the DILG family were among those who graced the activity. \nThe Peace Forum concluded with community singing and the Signing of the Peace Covenant among local officials, peace advocates and stakeholders for the joint pursuit of lasting peace in the Province.',NULL,NULL,NULL,NULL,'Alabel','Sarangani','Region XII','Philippines',6.185032500000001,125.34662530000003),(1017,0,52,2,'January 15, 2014 Patuloy umano ang pagpapadala ng mga nagpapakilalang miyembro ng rebeldeng grupo ng extortion letters sa mga negosyante na nasa Sarangani Province at South Cotabato.\n \nIto ang kinumpirma ni Army Captain Rey Balibagoso, tagapagsalita ng 1002nd Brigade Philippine Army, matapos nakatanggap ng mga ulat mula sa mga negosyante ukol sa naturang sulat.',NULL,NULL,NULL,NULL,NULL,'Sarangani','Region XII','Philippines',5.926717500000001,124.99475099999995),(1018,0,52,2,'Aniya, mayroon ding mga negosyanteng na nakatanggap ng katulad na extortion letter na nananahimik muna.\nSubalit hindi na binanggit ng naturang opisyal ang mga pangalan nito.',NULL,NULL,NULL,NULL,NULL,'Sarangani','Region XII','Philippines',5.926717500000001,124.99475099999995),(1019,0,52,2,' Communist insurgents burned millions of pesos worth of heavy equipment used in government road projects in the southern Philippine province of Sarangani, officials said.\nCapt. Alberto Caber, chief, Public Information Office, Eastern Mindanao Command, on Wed–nesday the rebels burned a backhoe, a grader and a road roller truck, which were being used in a road construction in Barangay Suyan in Malapatan town.',NULL,NULL,NULL,NULL,'Malapatan','Sarangani','Region XII','Philippines',5.966338599999999,125.28537779999999),(1020,0,33,6,'Veranza mall',NULL,NULL,NULL,NULL,NULL,'Sarangani','Region XII','Philippines',5.926717500000001,124.99475099999995),(1021,0,52,2,'He expressed belief that the burning incident was in retaliation to the construction firm’s refusal to give in to the extortion demand or the so-called revolutionary tax imposed by the New People’s Army (NPA) on firms and businesses operating in their areas of jurisdiction.',NULL,NULL,NULL,NULL,'Malapatan','Sarangani','Region XII','Philippines',5.966338599999999,125.28537779999999),(1022,0,33,6,'Robinsons Place GenSan',NULL,NULL,NULL,NULL,NULL,'Sarangani','Region XII','Philippines',5.926717500000001,124.99475099999995),(1023,0,33,6,'SM City General Santos',NULL,NULL,'Lagao',NULL,'General Santos','South Cotabato','Region XII','Philippines',6.1155985,125.18281430000002),(1024,0,52,2,'He said the rebels escaped after the burning the equipment, but Eastmincom chief Lt. Gen. Ricardo Rainier Cruz 3rd, the regional army commander, deployed troops from the 72nd Infantry Battalion to help the Malapatan police pursue the raiders.',NULL,NULL,NULL,NULL,'Malapatan','Sarangani','Region XII','Philippines',5.966338599999999,125.28537779999999),(1025,0,33,6,'KCC Mall of Gensan',NULL,NULL,NULL,NULL,'General Santos','South Cotabato','Region XII','Philippines',6.115377199999999,125.1885691),(1026,0,52,2,'MILF also set fire to two banana-transporting trucks owned by Sumifru Corp. and Dole Philippines in Bukidnon and destroyed some 15 hectares of banana plants in Surigao del Sur.',NULL,NULL,NULL,NULL,'Malapatan','Sarangani','Region XII','Philippines',5.966338599999999,125.28537779999999),(1027,0,33,6,'General Santos Doctors Hospital',NULL,NULL,NULL,NULL,'General Santos','South Cotabato','Region XII','Philippines',6.1203167,125.17826179999997),(1028,0,52,2,'Much earlier, two dumptrucks, two backhoes and a Hilux pick-up owned by Eagles Equipment Inc. in Tagoloan, Misamis Oriental were also burned by alleged communist rebels.',NULL,NULL,NULL,NULL,'Malapatan','Sarangani','Region XII','Philippines',5.966338599999999,125.28537779999999),(1029,0,33,6,'Glan Medicare Community Hospital',NULL,NULL,NULL,NULL,'Glan','Sarangani','Region XII','Philippines',5.820836799999999,125.21008729999994),(1030,0,33,6,'General Santos City District Hospital',NULL,'Fernandez Street','Lagao',NULL,'General Santos','South Cotabato','Region XII','Philippines',6.1257414,125.18564879999997),(1031,0,33,6,'Maasim Municipal Hospital',NULL,NULL,NULL,NULL,'Maasim','Sarangani','Region XII','Philippines',5.862824799999999,124.9974095),(1032,0,52,2,'Armed Forces of the Philippines records showed that the MILF and Communist Military Movement destroyed and damaged a total of P1.2 billion of private and public properties in 31 recorded atrocities last year.\nThey also earned at least P300 million from alleged extortion activities.',NULL,NULL,NULL,NULL,'Malapatan','Sarangani','Region XII','Philippines',5.966338599999999,125.28537779999999),(1033,0,52,2,'The sea robberies in Southern Mindanao are being perpetrated by the Ambak Pare group and the members of the MILF. The MILF is also behind the sea marauding incidents in Southwestern and Northern Mindanao. Among the notorious MILF leaders who are engaged in piracy and extortion activities are Nurhan Amil, Mosanip Maquib, and commander Samal Masgal of Cotabato',NULL,NULL,NULL,NULL,NULL,'Sarangani','Region XII','Philippines',5.926717500000001,124.99475099999995),(1034,0,53,2,'Police authorities are eyeing extortion behind a grenade explosion on Monday evening in front of an office of a mining firm based in Kiamba town in Sarangani Province.\nSenior Inspector Luis Pedrio, Kiamba police chief, said Tuesday the explosion occurred at around 7 p.m. inside the compound of the Kiamba Mining Corporation (KMC) located along Mondragon Street in Barangay Poblacion.\nCiting accounts from several witnesses, he said the grenade was hurled by one of two unidentified motorcycle-riding suspects who passed by the area.',NULL,NULL,NULL,NULL,'Kiamba','Sarangani','Region XII','Philippines',5.9887646,124.62354989999994),(1035,0,53,2,'Pedrio said investigators recovered from the scene the pin of the hand grenade that was lobbed by the suspects.\nHe said no one was hurt and no major damages were reported as a result of the attack, which came about two weeks after the company received an extortion letter from an undisclosed group.\nHe said they are currently digging deeper into the extortion angle but said they are not also discounting other possible motives.',NULL,NULL,NULL,NULL,'Kiamba','Sarangani','Region XII','Philippines',5.9887646,124.62354989999994),(1036,0,54,3,'There were more than one hundred child laborers identified in the area working as harvesters (mananabas) during harvest timeand grass cutters/removers (hornal) during planting and growing period.',NULL,NULL,NULL,NULL,NULL,'Sarangani','Region XII','Philippines',5.926717500000001,124.99475099999995),(1037,0,54,3,'The child laborers were between the ages six to fourteen years old . Some were enrolled at JWB Adoracion Elementary School, while others cannot afford to go to school for reason of poverty.\n\nThey work on non-school hours and days, but they also spend time working during school days especially on harvest season and only paid by-piece of output and received as low as P2.00 per 20 pieces/sticks of sugar cane (tubu).',NULL,NULL,NULL,NULL,NULL,'Sarangani','Region XII','Philippines',5.926717500000001,124.99475099999995),(1038,0,55,3,'The Department of Agrarian Reform (DAR) has installed 142 agrarian-reform beneficiaries (ARBs) at a 95-hectare banana plantation in Maribulan, Alabel in Sarangani province.\n\nThe plantation is previously owned by the Sarangani Agricultural Co. Inc. (Saci), which was placed under coverage of the Comprehensive Agrarian Reform Program (CARP).  As its new owners, and with their installation, the farmers can now start to cultivate the land as its owners.',NULL,'Sarangani-Davao del Sur Coastal Road',NULL,NULL,'Alabel','Sarangani','Region XII','Philippines',6.106887785981836,125.26625763333868),(1039,0,55,3,'As ARBs, the farmers will be provided basic rural infrastructures to enhance farm productivity, and get livelihood skills/training programs to help them put up their own business enterprises, Municipal Agrarian Reform Officer Salvador D. Solaña Jr. said.',NULL,'Sarangani-Davao del Sur Coastal Road',NULL,NULL,'Alabel','Sarangani','Region XII','Philippines',6.1070584731811675,125.26642929471564),(1040,0,33,6,'Glan Medicare Community Hospital',NULL,'Hombrebueno Street',NULL,NULL,'Glan','Sarangani','Region XII','Philippines',5.8168282,125.20512250000002),(1041,0,56,4,' A teenage girl was found dead inside a hole near a hill in Barangay Malandag, Malungon town in Sarangani Sunday.\n\nThe victim was identified as Darlene Jane Las Piñas, 14. She was last seen Thursday night.',NULL,NULL,NULL,NULL,'Malungon','Sarangani','Region XII','Philippines',6.3343032,125.25879639999994),(1042,0,33,6,'Kiamba District Hospital',NULL,NULL,NULL,NULL,'Kiamba','Sarangani','Region XII','Philippines',6.023392599999999,124.64140279999992),(1043,0,56,4,'According to her father, he asked the victim to buy some noodles for their dinner but she failed to return.\n\nAccording to Alejandro Masaglad, purok chairperson, they found the body in a 20-foot-deep hole near a hill.\n\nAuthorities have yet to confirm whether the victim was raped before she was killed and buried in the hole.\n\nThey also believe that the suspects knew the place well, and that the crime was planned.\n\nInvestigation on the incident is ongoing',NULL,NULL,NULL,NULL,'Malungon','Sarangani','Region XII','Philippines',6.3343032,125.25879639999994),(1044,0,33,6,'Maasim Municipal Hospital',NULL,NULL,NULL,NULL,'Maasim','Sarangani','Region XII','Philippines',5.926717500000001,124.99475099999995),(1045,0,33,6,'Maitum Municipal Hospital',NULL,NULL,NULL,NULL,'Maitum','Sarangani','Region XII','Philippines',6.124080800000001,124.48635669999999),(1046,0,33,6,'Malungon Municipal Hospital',NULL,NULL,NULL,NULL,'Malungon','Sarangani','Region XII','Philippines',6.3343032,125.25879639999994),(1047,0,33,6,'Tiburcio B. Aquino Memorial Hospital',NULL,NULL,NULL,NULL,'Kiamba','Sarangani','Region XII','Philippines',5.9887807,124.6335732),(1048,0,57,2,'Alarmed with the rising cases of rape and sexual assault, the city government is set to create a special task force that will spearhead a massive campaign against the menace and address the needs of the victims.',NULL,NULL,NULL,NULL,'General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.17161799999997),(1049,0,57,2,'Dr. Antonieta Odi, medico-legal officer of the City Integrated Health Services Office (CIHSO), said Thursday the move is part of the immediate initiatives identified by the local government to help curb the reported rape and sexual assault incidence in the area that already reached 179 cases since January.\n\n“We’re launching a citywide campaign to make everybody aware of the gravity of the problem that we’re currently facing regarding rape and enjoin our residents to become more vigilant and help run after the suspects or offenders,” she said.',NULL,NULL,NULL,NULL,'General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.17161799999997),(1050,0,57,2,'Odi said the creation of the proposed task force was an offshoot of a consultative meeting on rape and sexual assault cases organized by the city council’s committee on women and children protection.\n\nDuring the meeting, which was joined by local officials and representatives from various government agencies and non-government groups, she said it was agreed that a special body should be set up to effectively address the problem.\n',NULL,NULL,NULL,NULL,'General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.17161799999997),(1051,0,57,2,'Odi said among the task force’s proposed strategies are the launching of a citywide information and education program, distribution of campaign materials against rape like stickers and leaflets, reorientation of newly-elected barangay officials, education program for parents in coordination with the schools, activation of hotline numbers and the establishment of an identification system for drivers of public utility vehicles.\n\nShe said the task force will set up a one-stop center for rape victims at the city hospital that will mainly cater to victims of rape and child abuse cases.',NULL,NULL,NULL,NULL,'General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.17161799999997),(1052,0,57,2,'The center will be directly manned by a nurse, a psychiatrist, a social worker and policemen and will be backed up by a lawyer, she said. “This will be a continuing initiative and there are initial plans to institutionalize these interventions later on,” Odi said.\n\nSupt. Rolly Octavio, deputy city police director for operations, said they are presently evaluating the status of the reported rape and sexual assault cases in the city in support of the operationalization of the task force.',NULL,NULL,NULL,NULL,'General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.17161799999997),(1053,0,57,2,'“We’re updating our information database regarding the rape cases, establishing the identities of the victims and their present status,” he said.\n\nOctavio said they are studying other possible assistance for the rape victims or complainants, whom they found to be usually reluctant or quite shy about reporting their plight to the police.\n',NULL,NULL,NULL,NULL,'General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.17161799999997),(1054,0,57,2,'Based on records from the CIHSO’s medico-legal office, the reported incidence of rape and sexual assault in the city already increased by 50 cases as of November this year compared to the 129 cases recorded in 2009.\n\nIt said 75 percent of the victims of the reported rape cases this year were children, the youngest of whom was three years-old.\n\nSome of the recorded cases involved drivers of trisikads (bicycles with sidecars) and other public utility vehicles as well as gang-rapes perpetrated by members of gangs and fraternities based in some secondary schools in the city',NULL,NULL,NULL,NULL,NULL,'Sarangani','Region XII','Philippines',5.926717500000001,124.99475099999995),(1055,0,58,4,'A math teacher at a national high school in the town of Malapatan town has been accused of rape by a 17-year-old student who is now pregnant.',NULL,NULL,NULL,NULL,'Malapatan','Sarangani','Region XII','Philippines',5.966338599999999,125.28537779999999),(1056,0,58,4,'In a complaint lodged at the provincial prosecutor’s office here, the student identified her alleged rapist as  Josue Canillo, who she said had sex with her three times since March 3, twice inside the campus. She said the teacher had threatened to harm her.\nThe girl’s parents said they found out about the girl’s ordeal when her pregnancy became obvious in its fifth month.',NULL,NULL,NULL,NULL,'Malapatan','Sarangani','Region XII','Philippines',5.966338599999999,125.28537779999999),(1057,0,58,4,'In a complaint lodged at the provincial prosecutor’s office here, the student identified her alleged rapist as  Josue Canillo, who she said had sex with her three times since March 3, twice inside the campus. She said the teacher had threatened to harm her.\nThe girl’s parents said they found out about the girl’s ordeal when her pregnancy became obvious in its fifth month.',NULL,NULL,NULL,NULL,'Malapatan','Sarangani','Region XII','Philippines',5.966338599999999,125.28537779999999),(1058,0,58,4,'They made her undergo a medico-legal examination on September 7, the report of which showed  “definite evidence of abuse or sexual contact.”\nThe provincial prosecutor’s office gave the suspect 10 days to file his counter-affidavit, after which formal charges of rape and violation of the anti-child abuse law on three counts would be filed in court.',NULL,NULL,NULL,NULL,'Malapatan','Sarangani','Region XII','Philippines',5.966338599999999,125.28537779999999),(1059,0,58,4,'Canillo has been in hiding since Monday. But the girl’s parents said he sent them a text message on Thursday, when the girl filed the charges, asking them for an amicable settlement.\nThey said they rejected the offer.',NULL,NULL,NULL,NULL,'Malapatan','Sarangani','Region XII','Philippines',5.966338599999999,125.28537779999999),(1060,0,58,4,'The girl’s parents said aside from the criminal case, they will also file administrative complaints against the suspect with the Department of Education.\nAllan Farnazo, Sarangani Schools Division superintendent, said he would take action once formal criminal and administrative charges have been filed against Canillo.',NULL,NULL,NULL,NULL,'Malapatan','Sarangani','Region XII','Philippines',5.966338599999999,125.28537779999999),(1061,0,59,2,'The Moro Islamic Liberation Front (MILF) rebel group in the Philippines has handed over its first batch of weapons as part of a peace process.\nThe event in Maguindanao, in Mindanao, was attended by President Benigno Aquino who hailed it as an important step forward.\nSeventy-five weapons will be deactivated as a gesture of MILF\'s commitment to peace.',NULL,NULL,NULL,NULL,NULL,'Maguindanao','Autonomous Region in Muslim Mindanao','Philippines',6.9422581,124.41982430000007),(1062,0,59,2,'In 2012, the government and MILF agreed to a framework for a peace accord.\nAbout 145 of the estimated 10,000 members of the MILF\'s armed faction, the Bangsamoro Islamic Armed Forces, will be integrated into mainstream society.\n\"As I look at the faces of each of our 145 brothers here this morning, I see 145 stories of struggle, of pain, of hopelessness and even of death. Yet I also see 145 stories of hope and faith that indeed peace is near and that all the sacrifices have been worth it,\" MILF lead negotiator Murad Ebrahim said, in quotes carried by the AP news agency.',NULL,NULL,NULL,NULL,NULL,'Maguindanao','Autonomous Region in Muslim Mindanao','Philippines',6.9422581,124.41982430000007),(1063,0,59,2,'The government will provide a cash handout of 25,000 Philippine peso ($555; £355) to each of the combatants to be used for education, training and livelihood, The Philippine Star newspaper said.\nIt comes as a law implementing a peace deal between the government and MILF has attracted only lukewarm support in congress.',NULL,NULL,NULL,NULL,NULL,'Maguindanao','Autonomous Region in Muslim Mindanao','Philippines',6.9422581,124.41982430000007),(1064,0,59,2,'Dozens of police commandos were killed in clashes with the rebels earlier this this year.\nPresident Aquino said that the number of weapons handed over on Tuesday was significant, AP reported.\n\"We are not talking of just one or a couple or a dozen firearms. These are high-powered firearms, modern and have not aged. These arms can deal and have dealt extreme suffering,\" he said at the ceremony.',NULL,NULL,NULL,NULL,NULL,'Maguindanao','Autonomous Region in Muslim Mindanao','Philippines',6.9422581,124.41982430000007),(1065,0,60,2,'Dozens of police commandos have been killed in heavy fighting with Islamist rebels in the southern Philippines province of Maguindanao, say officials.',NULL,NULL,NULL,NULL,NULL,'Maguindanao','Autonomous Region in Muslim Mindanao','Philippines',6.9422581,124.41982430000007),(1066,0,60,1,'Several rebels were also reportedly killed as police entered a village held by the Moro Islamic Liberation Front (Milf) early on Sunday.\nReports say two key terror suspects were the targets of the operation.\nIt is the worst fighting since the government and Milf signed a peace deal last year to end decades of fighting.',NULL,NULL,NULL,NULL,NULL,'Maguindanao','Autonomous Region in Muslim Mindanao','Philippines',6.9422581,124.41982430000007),(1067,0,60,2,'There was conflicting information about Sunday\'s fighting, but reports from the Philippines suggest police commandos launched a surprise raid on a village near the town of Mamasapano, in the Maguindanao province of Mindanao island.\nThey were reportedly seeking to arrest members of the Bangsamoro Islamic Freedom Fighters (Biff), a Milf splinter group which opposes the ceasefire.',NULL,NULL,NULL,NULL,'Mamasapano','Maguindanao','Autonomous Region in Muslim Mindanao','Philippines',6.9431397,124.51960400000007),(1068,0,60,2,'But the mayor of the town, Tahirudin Benzar Ampatuan, said police had not warned the Milf of the raid, as they should have under the peace deal, so its members fought back.\nThe gunfire reportedly went on for several hours.',NULL,NULL,NULL,NULL,'Mamasapano','Maguindanao','Autonomous Region in Muslim Mindanao','Philippines',6.9431397,124.51960400000007),(1069,0,60,2,'The number of casualties remains unclear. Local and international news reports citing various officials put the number of commandos killed between 40 and 50.\nMilf leaders confirmed the violence but the number of rebels killed and their affiliation was not clear. The violence ended when ceasefire monitors intervened, said local officials.\nThe military was not involved, but peacekeeping reinforcements have since been sent to the region.',NULL,NULL,NULL,NULL,'Mamasapano','Maguindanao','Autonomous Region in Muslim Mindanao','Philippines',6.9431397,124.51960400000007),(1070,0,61,1,'Sen. Alan Peter Cayetano expressed vehement opposition against the proposed Bangsomoro Basic Law (BBL), saying it only further weakens the country\'s resolution to achieve just and lasting peace in Mindanao.',NULL,NULL,NULL,NULL,'Manila',NULL,'Metro Manila','Philippines',14.5995124,120.9842195),(1071,0,61,1,'In a statement Monday, Cayetano called on Congress to be extremely cautious even in passing an amended BBL.\n\n\"Peace will never come out because of a piece of paper. It might even be complicated … Even if there is a written law, if it will not bring real and lasting peace,\" Cayetano said, quoting a statement a statement of the Catholic Bishops Conference of the Philippines.\n\n\"If we have to pass a new law, it must not be about one group but about a just, inclusive lasting peace in Mindanao,\" Cayetano added.',NULL,NULL,NULL,NULL,'Manila',NULL,'Metro Manila','Philippines',14.5995124,120.9842195),(1072,0,62,2,'The Mamasapano battle ended with 44 police commandos, 17 rebels, and four civilians dead. It also threatened the peace process with the MILF when lawmakers suspended work on the draft of the Bangsamoro Basic Law, which would create region to replace the Autonomous Region in Muslim Mindanao (ARMM).',NULL,NULL,NULL,NULL,'Mamasapano','Maguindanao','Autonomous Region in Muslim Mindanao','Philippines',6.9431397,124.51960400000007),(1073,0,62,2,'Both the Special Action Force (SAF) and the Moro Islamic Liberation Front (MILF) violated a ceasefire when they engaged in a firefight in Mamasapano, Maguindanao, on January 25.\n\nThe International Monitoring Team (IMT), a 60-member international group of Malaysian-led observers, made this conclusion in a report it submitted to the Philippine government.',NULL,NULL,NULL,NULL,'Mamasapano','Maguindanao','Autonomous Region in Muslim Mindanao','Philippines',6.9431397,124.51960400000007),(1074,0,62,2,'The report says the SAF failed to coordinate with the Armed Forces of the Philippines and other police units and ignored ceasefire mechanisms.\n\nThis means that the Philippine government violated a provision in the 1997 implementing operational guidelines on its ceasefire agreement with the MILF, Miriam Coronel-Ferrer, chief government negotiator, said in a news conference on Monday (April 6).',NULL,NULL,NULL,NULL,'Mamasapano','Maguindanao','Autonomous Region in Muslim Mindanao','Philippines',6.9431397,124.51960400000007),(1075,0,62,2,'Earlier, Director Getulio Napeñas, who was sacked as SAF commander, said the Mamasapano operation was kep secret to avoid any leak in the information.\n\nThe objective of the operation was the arrest of Malaysian terrorist bomb maker Zulkifli bin Hir, alias Marwan, and his Filipino associate, Abudl Basit Usman.',NULL,NULL,NULL,NULL,'Mamasapano','Maguindanao','Autonomous Region in Muslim Mindanao','Philippines',6.9431397,124.51960400000007),(1076,0,62,2,'The battle ended with 44 police commandos, 17 rebels, and four civilians dead. It also threatened the peace process with the MILF when lawmakers suspended work on the draft of the Bangsamoro Basic Law, which would create region to replace the Autonomous Region in Muslim Mindanao (ARMM).',NULL,NULL,NULL,NULL,'Mamasapano','Maguindanao','Autonomous Region in Muslim Mindanao','Philippines',6.9431397,124.51960400000007),(1077,0,62,2,'The IMT reports adds that SAF members violated the ceasefire when they shot and killed two MILF fighters on the morning of the operation. This led to a firefight between the SAF and the MILF forces.\n\nThe IMT agrees that, in the first encounter, the Moro troops only responded to police commandos\' attack.',NULL,NULL,NULL,NULL,'Mamasapano','Maguindanao','Autonomous Region in Muslim Mindanao','Philippines',6.9431397,124.51960400000007),(1078,0,62,1,'The IMT reports adds that SAF members violated the ceasefire when they shot and killed two MILF fighters on the morning of the operation. This led to a firefight between the SAF and the MILF forces.\n\nThe IMT agrees that, in the first encounter, the Moro troops only responded to police commandos\' attack.',NULL,NULL,NULL,NULL,'Mamasapano','Maguindanao','Autonomous Region in Muslim Mindanao','Philippines',6.9431397,124.51960400000007),(1079,0,62,1,'At the same, it says the MILF violated the ceasfire when it entered cornfields in the area and attacked another SAF unit.\n\nThe IMT finds no evidence, however, that the MILF provided sanctuary to Marwan and Usman, though it believes some MILF members knew where the two were hiding.',NULL,NULL,NULL,NULL,'Mamasapano','Maguindanao','Autonomous Region in Muslim Mindanao','Philippines',6.9431397,124.51960400000007),(1080,0,62,1,'As for the viral video showing some SAF commandos being executed, the IMT says there\'s not enough evidence that MILF fighters are the ones who did it.\n\nThe IMT also says one SAF commando violated the ceasefire when he killed four sleeping MILF fighters during his escape.',NULL,NULL,NULL,NULL,'Mamasapano','Maguindanao','Autonomous Region in Muslim Mindanao','Philippines',6.9431397,124.51960400000007),(1081,0,62,1,'The IMT calls on the government peace panel to create conflict prevention mechanisms to avoid future clashes between government and MILF forces.\n\nThe IMT says the MILF should strengthen command and control of its fighters and improve its intelligence gathering.\n',NULL,NULL,NULL,NULL,'Mamasapano','Maguindanao','Autonomous Region in Muslim Mindanao','Philippines',6.9431397,124.51960400000007);
