INSERT INTO `reg.mission` VALUES (1,0,3,2,'Operation Orange','MILF','Prevent MILF from taking any more civilian hostages','MILF are currently deployed as guerrilla units within the area and are to be considered heavily armed. Local residents, or lumads, appeal to the rebels due to fear of attack','Operations must be executed in a low-profile manner','Admin and logistics operations are to be sponsored by the 72th Infantry Battalian, stationed in the area','Command is to be issued in a 2-tier fashion from a command center, to be established at the local barangay hall','2015-10-22 12:40:46',NULL,NULL,NULL,NULL,NULL,'Davao City','Davao del Sur','Davao Region','Philippines',7.190708,125.45534099999998),(2,0,7,4,'Paglaya','New Peoples Army','To weaken the enemie`s will to fight','The threat has a strong influence over the small barangays of Gen San','To increase community support and activities','To be provided by LGUs','PO1, use of cellphones and radios','2015-10-22 15:22:00',NULL,NULL,NULL,NULL,NULL,'General Santos','South Cotabato','Region XII','Philippines',6.1163861,125.17161799999997),(3,0,7,4,'Oplan Pagsasayaayos','Sample Mission Threat','Sample Mission Objective','Sample Situation','Sample Execution\n','Admin and Logistics','Command and signal\n','2015-10-23 14:27:55',NULL,NULL,NULL,NULL,NULL,'Butuan City','Agusan Del Norte','Caraga','Philippines',8.9475377,125.54062339999996),(4,0,2,7,'Operation Ipaglaban','MILF','Decreast MILF presence','MILF is raping women everywhere. Raping here reping there raping everywhere.','Rape them back','frlakgjargjaklj','Radio and Cell phone','2015-10-23 15:01:14',NULL,NULL,NULL,NULL,NULL,NULL,'Compostela Valley','Davao Region','Philippines',7.512514999999999,126.17626150000001),(5,0,5,9,'OPERATION BAGONG SIMULA','MILF and Communist Military Movement',' To win the peace in order to establish a physically and psychologically secure environment conducive to socio-economic development.\n',' The MILF and CMM continue to expand and mobilize its members to conduct mass actions/rallies and demonstrations against the government offices and business establishments that often paralyze economic and government activities and functions. They have also successfully executed a series of liquidations, harassments and ambushes of government and police forces; while willfully conducting extortion and sabotage of business establishments.\n','Commander’s Intent:\nI intend to reduce the CMM influence On PsyOps - identification of the objectives to reduce the capability of the threat to influence the people.\n \nConcept of Operations:\nThe purpose of CMO is to gain popular support and weaken the adversary’s will to fight and to establish Barangay defense system.\n\nTasks\nSupport the PsyOps requirements of the PDT operations;\nConduct counter-propaganda against MILF and CCM;\nPerform other task as directed.\n','General \nBSA – Primary at 1203rd BDE HQs\nBn Trains – Bn Hqs\nPriority of resources shall be the production of PSYOPS products.\nMaterial and Services\nSupply\n      	a.        	Class I - Initial one (1) month ration.\nb. Class III - POL requirements initially shouldered by 1203rd BDE\n      		(Diesel-200Li, V95-200 Li)\n      	c.        	Class V – to be provided by supported unit.\n\n\nTransportation\nTo be provided by supported units.\nUse of civilian vehicles is authorized.\n\nMedical Evacuation and Hosp – supported unit’s SOP.\nPersonnel - No personnel replacement for the duration of the operation.\nMiscellaneous - Other peculiar requirements needed to support the operations for submission to the 7CMO Bn, 7ID, PA.\n','1.  	Commander 1203ND BDE is the overall commander during this operation.\n2.  	Commanders 1stIB and 2ndIB are ground commanders during this operation.\n3.     PsyOps Team Commander is MAJ ESTRADA.\n4.  	Civil Affairs Team Commander is CPT MARCOS.\n5.  	Public Affairs Team Commander is CPT AQUINO.\n6.  	BDE HQs initially located at Bgy Mahayayahay, Nueva Ecija.\n7.  	Succession of Command will be Commander 1stIB and 2ndIB in that order.\n\nSignal\nRadio Net Diagram – supported unit radio net.\nUse of Cellular phone is encouraged.\nCountersign – supported unit SOP.\n','2015-10-28 17:11:22',NULL,NULL,NULL,NULL,NULL,NULL,'Sarangani','Region XII','Philippines',5.926717500000001,124.99475099999995);
