CREATE DEFINER=`root`@`localhost` FUNCTION `formatExcerpt`(str TEXT) RETURNS text CHARSET utf8
    DETERMINISTIC
BEGIN

DECLARE result TEXT;
SET result = REPLACE(str, '  ', ' ');
WHILE(result <> str) DO
	SET str = result;
    SET result = REPLACE(str, '  ', ' ');
END WHILE;
SET result = REPLACE(REPLACE(str, ',', ''), ' ', ',');
RETURN result;
END ;;
