CREATE DEFINER=`root`@`localhost` PROCEDURE `add_excerpt`(
	IN in_user_id INT, 
    IN in_source_id INT, 
    IN in_category INT, 
    IN in_text TEXT, 
    IN in_level8 VARCHAR(60),
	IN in_level7 VARCHAR(60),
	IN in_level6 VARCHAR(60),
	IN in_level5 VARCHAR(60),
	IN in_level4 VARCHAR(60),
	IN in_level3 VARCHAR(60),
	IN in_level2 VARCHAR(60), 
	IN in_level1 VARCHAR(60),
	IN in_lat DOUBLE, 
    IN in_lng DOUBLE
)
BEGIN

DECLARE i INT DEFAULT 0;
DECLARE excr_id INT;
DECLARE text_formatted TEXT;
DECLARE token VARCHAR(50);
DECLARE tokn_id INT;
DECLARE spaceCount INT;

SET text_formatted = formatExcerpt(in_text); 
SET spaceCount = length(text_formatted) - length(replace(text_formatted, ',', ''));

INSERT INTO 
	`shield`.`reg.excerpt`(
		`source_id`, 
        `category`, 
        `text`, 
        `area_level8`,
		`area_level7`,
		`area_level6`,
		`area_level5`,
		`area_level4`,
		`area_level3`,
		`area_level2`,
		`area_level1`,
		`lat`,
		`lng`
	) 
VALUES (
	in_source_id, 
    in_category, 
    in_text, 
    in_level8,
    in_level7,
    in_level6,
    in_level5,
    in_level4,
    in_level3,
    in_level2,
    in_level1,
    in_lat,
    in_lng
);
-- ----------
SELECT 
	MAX(`id`) 
INTO 
	excr_id 
FROM 
	`shield`.`reg.excerpt` 
WHERE 
	REC_DELETED = 0;
-- ------------
INSERT INTO 
	`shield`.`log.user_action`(
		`USER_ID`, 
        `ACTION`
	) 
VALUES (
	in_user_id, 
    CONCAT('created excerpt with id ', excr_id)
);
-- ------------------
WHILE i <= spaceCount DO
	SET token = substring_index(SUBSTRING_INDEX(text_formatted, ',', i+1), ',', -1);
    -- ----------------
    IF(NOT EXISTS(SELECT ID FROM `shield`.`reg.token` WHERE `TEXT` = token AND `REC_DELETED` = 0)) THEN
		INSERT INTO 
			`shield`.`reg.token`(`TEXT`) 
		VALUES (token);  
    END IF;
    -- ------------
    SELECT 
		`ID` 
	INTO 
		tokn_id 
	FROM 
		`shield`.`reg.token` 
	WHERE 
		`TEXT` = token 
        AND `REC_DELETED` = 0;
	-- --------------
    IF(NOT EXISTS(SELECT `TOKEN_ID` FROM `shield`.`rel.excerpt_token` WHERE `EXCERPT_ID` = excr_id AND `TOKEN_ID` = tokn_id)) THEN
        INSERT INTO 
			`shield`.`rel.excerpt_token` 
		VALUES(
			excr_id, 
            tokn_id
		);
    END IF;
    
    SET i = i + 1;
END WHILE;
  
SELECT excr_id AS SUCCESS;
END ;;
DELIMITER ;
