    IN in_phase INT
)
BEGIN

DECLARE gen_mission_status INT DEFAULT 0;

SELECT `status` INTO gen_mission_status FROM `shield`.`reg.mission` WHERE `id` = in_mission_id AND `rec_deleted` = 0;
IF(in_phase <= 3 OR gen_mission_status = in_phase) THEN
	SET gen_mission_status = (in_phase + 1);
	UPDATE 
		`shield`.`reg.mission`
	SET
		`status` = gen_mission_status
	WHERE
		`id` = in_mission_id;
	SELECT gen_mission_status AS SUCCESS; 
ELSE
	SELECT 0 AS SUCCESS;
END IF;
END ;;
