CREATE DEFINER=`root`@`localhost` PROCEDURE `get_all_access`()
BEGIN
SELECT 
	`log`.`id`,
    `log`.`user_id` AS `user_id`,
    `usr`.`uname` AS `user_uname`,
    `log`.`event_dt`,
    `log`.`access_id` AS `access_id`,
    `sys`.`desc` AS `access_desc`
FROM 
	`shield`.`log.user_access` `log`
LEFT JOIN
	`shield`.`sys.access` `sys`
    ON `log`.`access_id` = `sys`.`id`
LEFT JOIN
	`shield`.`reg.user` `usr`
    ON `log`.`user_id` = `usr`.`id`
ORDER BY 
	`log`.`event_dt` DESC;
END ;;
