CREATE DEFINER=`root`@`localhost` PROCEDURE `get_all_user`()
BEGIN
SELECT
	`usr`.`id` AS `userID`,
    `usr`.`class` AS `class_id`, 
    `sys`.`desc` AS `class_desc`, 
    `log`.`access_id` AS `last_action_id`,
    `log`.`event_dt` AS `last_action_dt`,
    `usr`.`uname`,
    `usr`.`name_title`, 
	`usr`.`name_first`, 
	`usr`.`name_other`, 
	`usr`.`name_last` 
FROM
	`shield`.`reg.user` `usr`
LEFT JOIN
	(SELECT 
			* 
        FROM (
			SELECT 
				`user_id`, 
                `event_dt`, 
                `access_id` 
			FROM 
				`shield`.`log.user_access` 
			ORDER BY 
				`event_dt` DESC
		) `sub_log`
        GROUP BY `user_id`
	) `log`
    ON `usr`.`id` = `log`.`user_id`
LEFT JOIN
	`shield`.`sys.user_class` `sys` 
	ON `usr`.`class` = `sys`.`id`
WHERE 
	`usr`.`rec_deleted` = 0;
END ;;
