CREATE DEFINER=`root`@`localhost` PROCEDURE `link_cv_spo`(IN in_mission_id INT, IN in_cr_id INT, IN in_cv_id INT, IN in_spo_text TEXT)
BEGIN

DECLARE gen_spo_id INT DEFAULT -1;

SELECT `id` INTO gen_spo_id FROM `shield`.`reg.spo` WHERE `text` = in_spo_text AND `mission_id` = in_mission_id AND `cr_id` = in_cr_id AND `rec_deleted` = 0;


IF(gen_spo_id = -1) THEN
	INSERT INTO `shield`.`reg.spo`(`mission_id`, `cr_id`, `text`) VALUES (in_mission_id, in_cr_id, in_spo_text);
    SELECT MAX(`id`) INTO gen_spo_id FROM `shield`.`reg.spo` WHERE `mission_id` = in_mission_id AND `rec_deleted` = 0 ;
END IF;

IF(NOT EXISTS(SELECT `spo_id` FROM `shield`.`rel.cv_spo` WHERE `cv_id` = in_cv_id AND `spo_id` = gen_spo_id)) THEN
	INSERT INTO `shield`.`rel.cv_spo` (`cv_id`, `spo_id`) VALUES (in_cv_id, gen_spo_id);
    SELECT 'created' AS SUCCESS;
END IF;
END ;;
DELIMITER ;
