SELECT `id` INTO gen_tag_id FROM `shield`.`reg.tag` WHERE `text` = in_tag_desc AND `rec_deleted` = 0;

-- Getting tag id from DB
IF(gen_tag_id = -1) THEN
	INSERT INTO `shield`.`reg.tag`(`text`) VALUES (in_tag_desc);
    SELECT MAX(`id`) INTO gen_tag_id FROM `shield`.`reg.tag` WHERE `rec_deleted` = 0;
