IF(NOT EXISTS(SELECT `excerpt_id` FROM `shield`.`rel.excerpt_tag` WHERE `excerpt_id` = in_excerpt_id AND `tag_id` = gen_tag_id)) THEN
	INSERT INTO `shield`.`rel.excerpt_tag` (`excerpt_id`, `tag_id`) VALUES (in_excerpt_id, gen_tag_id);
    SELECT 'created' AS SUCCESS;
END IF;
END ;;
