CREATE DEFINER=`root`@`localhost` PROCEDURE `login`(
	IN user VARCHAR(64), 
	IN pass VARCHAR(64)
)
BEGIN

DECLARE user_id INT;
DECLARE user_class INT;
DECLARE user_uname VARCHAR(64);
DECLARE n_title VARCHAR(45);
DECLARE n_first VARCHAR(45);
DECLARE n_other VARCHAR(45);
DECLARE n_last VARCHAR(45);

IF (EXISTS(SELECT id FROM `shield`.`reg.user` WHERE uname = user AND pword = pass)) THEN
	SELECT 
		`id`, 
        `class`,  
        `uname`, 
        `name_title`, 
        `name_first`, 
        `name_other`, 
        `name_last` 
	INTO 
		user_id, 
        user_class, 
        user_uname, 
        n_title, 
        n_first, 
        n_other, 
        n_last 
	FROM 
		`shield`.`reg.user` 
	WHERE 
		uname = user 
        AND pword = pass;
	-- ---------------------
	INSERT INTO 
		`shield`.`log.user_access` (
			`user_id`, 
            `access_id`
		) 
	VALUES (
		user_id, 
        1
	);
    -- ---------
	SELECT 
		1 AS SUCCESS, 
        user_id AS ID, 
        user_class AS CLASS, 
		user_uname AS UNAME, 
        n_title AS NAME_TITLE, 
        n_first AS NAME_FIRST, 
        n_other AS NAME_OTHER, 
        n_last AS NAME_LAST; 
ELSE
	SELECT 0 AS SUCCESS;
END IF;
END ;;
DELIMITER ;
