CREATE DEFINER=`root`@`localhost` PROCEDURE `logout`(IN in_user_id INT)
BEGIN
DECLARE last_access INT;
SELECT `access_id` INTO last_access FROM `shield`.`log.user_access` WHERE `user_id` = in_user_id ORDER BY `event_dt` DESC LIMIT 1;
IF (last_access  = 1) THEN
	INSERT INTO 
			`shield`.`log.user_access` (
				`user_id`, 
				`access_id`
			) 
		VALUES (
			in_user_id, 
			2
		);
	SELECT 1 AS SUCCESS;
ELSE
	SELECT 0 AS SUCCESS;
END IF;

END ;;
