CREATE DEFINER=`root`@`localhost` PROCEDURE `primary_search`(IN in_search_string TEXT)
BEGIN
-- PRIMARY SEARCH
SELECT
	`excr`.`ID`,
    `excr`.`TEXT`,
    `excr`.`lat`,
    `excr`.`lng`,
    50 AS STRENGTH -- Fix this later
FROM
	`shield`.`reg.excerpt` `excr`
RIGHT JOIN
(
	SELECT
		DISTINCT(`extk`.`EXCERPT_ID`)
	FROM
		`shield`.`rel.excerpt_token` `extk`
	RIGHT JOIN
    (
		SELECT
			`ID`
		FROM
			`shield`.`reg.token`
		WHERE
			MATCH(`TEXT`) AGAINST(in_search_string)
			
    ) `tokn`
    ON `extk`.`TOKEN_ID` = `tokn`.`ID`
) `srch`
ON `excr`.`ID` = `srch`.`EXCERPT_ID`;
END ;;
DELIMITER ;
