CREATE DEFINER=`root`@`localhost` PROCEDURE `rep_completed_missions_per_user`()
BEGIN
SELECT
	`usr`.`id`,
    `usr`.`uname`,
	(SELECT COUNT(id) FROM `shield`.`reg.mission` WHERE `user_id` = `usr`.`id` AND `status` = 7 AND `rec_deleted` = 0) AS `success_count`,
    (SELECT COUNT(id) FROM `shield`.`reg.mission` WHERE `user_id` = `usr`.`id` AND `status` != 7 AND `rec_deleted` = 0) AS `ongoing_count`
FROM
	`shield`.`reg.user` `usr`;
END ;;
