CREATE DEFINER=`root`@`localhost` PROCEDURE `rep_source_usage`()
BEGIN

SELECT
	`exr`.`source_id` AS `source_id`,
	`src`.`title`,
    COUNT(`rel`.`use_count`) AS `use_count`
FROM
	(SELECT
		`excerpt_id`,
		COUNT(`eentity_id`) AS `use_count`
	FROM
		`shield`.`rel.eentity_excerpt` `rel`
		GROUP BY `excerpt_id`) `rel`
	LEFT JOIN
		`shield`.`reg.excerpt` `exr`
		ON `rel`.`excerpt_id` = `exr`.`id`
	LEFT JOIN
		`shield`.`reg.source` `src`
		ON  `exr`.`source_id` = `src`.`id`
GROUP BY
	`exr`.`source_id`
ORDER BY
	`use_count` DESC;
END ;;
