CREATE DEFINER=`root`@`localhost` PROCEDURE `reset_mission`(IN in_mission_id INT, IN in_phase INT)
BEGIN

DECLARE cur_mission_status INT;

SELECT `status` INTO cur_mission_status FROM `shield`.`reg.mission` WHERE `id` = in_mission_id;
-- If Mission Status is at or beyond COG and you're saving at the COG
IF((cur_mission_status >= 3) AND (in_phase <= 3)) THEN
	DELETE FROM `shield`.`reg.spo` WHERE `mission_id` = in_mission_id;
	DELETE FROM `shield`.`ext.eentity_cc` WHERE `mission_id` = in_mission_id;
    DELETE FROM `shield`.`ext.eentity_cr` WHERE `mission_id` = in_mission_id;
    DELETE FROM `shield`.`ext.eentity_cv` WHERE `mission_id` = in_mission_id;
    DELETE FROM `shield`.`ext.mission_cog` WHERE `mission_id` = in_mission_id;
END IF;
-- If mission was at 2
IF((cur_mission_status >= 2) AND (in_phase <= 2)) THEN
	DELETE FROM `shield`.`reg.eentity` WHERE `mission_id` = in_mission_id;
END IF;

SELECT 1 AS SUCCESS;
END ;;
