CREATE DEFINER=`root`@`localhost` PROCEDURE `search_excerpts`(IN in_search_string TEXT)
BEGIN
SELECT
	`srch`.`id`,
    `excr`.`category` AS `category_id`,
    `sys`.`desc` AS `category_desc`, 
    `excr`.`text`,
    `src`.`published_d`,
    `excr`.`lat`,
    `excr`.`lng`,
    `excr`.`area_level8`,
    `excr`.`area_level7`,
    `excr`.`area_level6`,
    `excr`.`area_level5`,
    `excr`.`area_level4`,
    `excr`.`area_level3`,
    `excr`.`area_level2`,
    `excr`.`area_level1`,
    `srch`.`strength`
FROM
(
	SELECT
		`id`,
		(SUM(`tag_hit`) * 60) + (SUM(`text_hit`) * 40) AS `strength`
	FROM(
		-- TAGS
		SELECT
			DISTINCT(`extg`.`excerpt_id`) AS `id`,
			1 AS `tag_hit`,
			0 AS `text_hit`,
			0 AS `mission_hit`
		FROM
				`shield`.`rel.excerpt_tag` `extg`
		RIGHT JOIN(
			SELECT
				`id`
			FROM
				`shield`.`reg.tag`
			WHERE
				MATCH(`text`) AGAINST(in_search_string)
		 ) `tag`
		ON `extg`.`tag_id` = `tag`.`id`
		UNION
		-- TEXT
		SELECT
			DISTINCT(`extk`.`excerpt_id`) AS `id`,
			0 AS `tag_hit`,
			1 AS `text_hit`,
			0 AS `mission_hit`
		FROM
			`shield`.`rel.excerpt_token` `extk`
		RIGHT JOIN(
			SELECT
				`id`
			FROM
				`shield`.`reg.token`
			WHERE
				MATCH(`text`) AGAINST(in_search_string)
		) `token`
		ON `extk`.`token_id` = `token`.`id`
	) `rel` 
	GROUP BY
		`id`
) `srch`
LEFT JOIN
	`shield`.`reg.excerpt` `excr`
	ON `srch`.`id` = `excr`.`id`
LEFT JOIN
	`shield`.`sys.excerpt_category` `sys` 
	ON `excr`.`category` = `sys`.`id`
LEFT JOIN
	`shield`.`reg.source` `src` 
	ON `excr`.`source_id` = `src`.`id`
ORDER BY `strength` DESC;
END ;;
DELIMITER ;
