CREATE DEFINER=`root`@`localhost` PROCEDURE `update_excerpt`(
	IN in_user_id INT, 
    IN in_excerpt_id INT, 
    IN in_category_id INT,
    IN in_text TEXT, 
    IN in_level8 VARCHAR(60),
	IN in_level7 VARCHAR(60),
	IN in_level6 VARCHAR(60),
	IN in_level5 VARCHAR(60),
	IN in_level4 VARCHAR(60),
	IN in_level3 VARCHAR(60),
	IN in_level2 VARCHAR(60), 
	IN in_level1 VARCHAR(60),
	IN in_lat DOUBLE, 
    IN in_lng DOUBLE
)
BEGIN

DECLARE i INT DEFAULT 0;
DECLARE excr_id INT;
DECLARE text_formatted TEXT;
DECLARE token VARCHAR(50);
DECLARE tokn_id INT;
DECLARE spaceCount INT;

SET text_formatted = formatExcerpt(in_text); 
SET spaceCount = length(text_formatted) - length(replace(text_formatted, ',', ''));

UPDATE 
	`shield`.`reg.excerpt`
SET
	`category` = in_category_id,
	`text` = in_text,
    `area_level8` = in_level8,
    `area_level7` = in_level7,
    `area_level6` = in_level6,
    `area_level5` = in_level5,
    `area_level4` = in_level4,
    `area_level3` = in_level3,
    `area_level2` = in_level2,
    `area_level1` = in_level1
WHERE
	`id` = in_excerpt_id;
    
-- unlink tokens
DELETE FROM
	`shield`.`rel.excerpt_token`
WHERE
	`excerpt_id` = in_excerpt_id;

-- Relinking Tokens
WHILE i <= spaceCount DO
	SET token = substring_index(SUBSTRING_INDEX(text_formatted, ',', i+1), ',', -1);
    -- ----------------
    IF(NOT EXISTS(SELECT ID FROM `shield`.`reg.token` WHERE `TEXT` = token AND `REC_DELETED` = 0)) THEN
		INSERT INTO 
			`shield`.`reg.token`(`TEXT`) 
		VALUES (token);  
    END IF;
    -- ------------
    SELECT 
		`ID` 
	INTO 
		tokn_id 
	FROM 
		`shield`.`reg.token` 
	WHERE 
		`TEXT` = token 
        AND `REC_DELETED` = 0;
	-- --------------
    IF(NOT EXISTS(SELECT `TOKEN_ID` FROM `shield`.`rel.excerpt_token` WHERE `EXCERPT_ID` = in_excerpt_id AND `TOKEN_ID` = tokn_id)) THEN
        INSERT INTO 
			`shield`.`rel.excerpt_token` 
		VALUES(
			in_excerpt_id, 
            tokn_id
		);
    END IF;
    
    SET i = i + 1;
END WHILE;
SELECT 1 AS SUCCESS;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
