CREATE DEFINER=`root`@`localhost` PROCEDURE `update_user`(
	IN in_user_id INT, 
	IN in_uname VARCHAR(64),
    IN in_pword_old VARCHAR(64),
    IN in_pword_new VARCHAR(64),
    IN in_name_title VARCHAR(45),
    IN in_name_first VARCHAR(45),
    IN in_name_other VARCHAR(45),
    IN in_name_last VARCHAR(45)
)
BEGIN

IF(EXISTS(SELECT `id` FROM `shield`.`reg.user` WHERE `UNAME` = in_uname AND `pword` = in_pword_old AND `REC_DELETED` = 0)) THEN
	UPDATE
		`shield`.`reg.user`
	SET
		`uname` = in_uname,
        `pword` = in_pword_new,
        `name_title` = in_name_title,
        `name_first` = in_name_first,
        `name_other` = in_name_other,
        `name_last` = in_name_last
	WHERE 
